(103, 'Tourist Hotel', 'Гостиница \"Турист\" расположена в зеленом жилом районе Харькова рядом с парком имени Василия Юрьева. К услугам гостей круглосуточная стойка регистрации и бесплатный Wi-Fi в зонах общественного пользования.', 'Moskovsky Prospekt', 'Харьков', '61082', 'Украина', '7.1', 'full/2c772921d1566f1120e5bc1dd1911a4e3badd166.jpg', 'https://www.booking.com/hotel/ua/tourist-kharkov.ru.html', '2019-07-29 12:09:47', '2019-07-29 12:09:47'),
(104, 'Hotel Na Rudneva', 'Этот отель расположен в 4 минутах езды от площади Конституции в Харькове. К услугам гостей бесплатный WiFi, бильярд и номера с холодильником.', 'Ploschad Geroev Nebesnoj Sotni (Pl. Rudneva)', 'Харьков', '61000', 'Украина', '7.3', 'full/ffccc622fb62b7a997a23a9f34d597a880a021c6.jpg', 'https://www.booking.com/hotel/ua/na-rudneva.ru.html', '2019-07-29 12:09:47', '2019-07-29 12:09:47'),
(105, 'Гостиница Мир', 'Этот отель расположен в Харькове, всего в 50 м от станции метро \"Ботанический сад\". Стойка регистрации отеля \"Мир\" работает круглосуточно.', 'Проспект Ленина 27А', 'Харьков', '61072', 'Украина', '7.6', 'full/17867808f43454cd2d25a5aa9fb1103f7381758f.jpg', 'https://www.booking.com/hotel/ua/mir.ru.html', '2019-07-29 12:09:48', '2019-07-29 12:09:48'),
(106, 'Отель Reikartz Харьков', 'Этот 3-звездочный отель находится в историческом центре Харькова, всего в 1,5 км от Благовещенского собора и площади Свободы. К услугам гостей бесплатный WiFi и просторные номера с элегантным интерьером.', 'Улица Чубаря 4', 'Харьков', '61024', 'Украина', '8.8', 'full/c56fb41e6ff6b2ad385f15054174c842d06f8468.jpg', 'https://www.booking.com/hotel/ua/reikartz-kharkiv.ru.html', '2019-07-29 12:09:49', '2019-07-29 12:09:49'),
(107, 'Дружба гостиница и ресторан', 'Гостинично-ресторанный комплекс \"Дружба\" располагает номерами с бесплатным Wi-Fi в 7 км от центра Харькова. В ресторане можно отведать блюда украинской, русской и европейской кухни. Из отеля открывается вид на живописное озеро.', 'Проспект Гагарина 185', 'Харьков', '61009', 'Украина', '7.4', 'full/f97625d5adb6aa7574be9a5285ce045b2bde5e9d.jpg', 'https://www.booking.com/hotel/ua/druzhba-kharkov.ru.html', '2019-07-29 12:09:49', '2019-07-29 12:09:49'),
(108, 'Covent - Garden - Kharkiv', 'Комплекс «Ковент - Гарден» расположен в деловом центре Харькова, в 5 минутах ходьбы от Ботанического сада. К услугам гостей апартаменты и номер-студио с собственной кухней и бесплатным WiFi.', 'Lenina Prospekt area', 'Харьков', '61072', 'Украина', '7.7', 'full/d9afe2a297cbb6682b0de667cba3de03d3f74cdb.jpg', 'https://www.booking.com/hotel/ua/covent-garden.ru.html', '2019-07-29 12:09:54', '2019-07-29 12:09:54'),
(109, 'Guest House NIK', 'Гостевой дом «НИК» с бесплатным Wi-Fi расположен в Харькове, в 17 км от Харьковского исторического музея. Расстояние до стадиона «Металлист» составляет 19 км. Стойка регистрации работает круглосуточно.', 'Bogdana Khmelnytskogo/Kievskaya 19/16 ', 'Харьков', '62459', 'Украина', '9.4', 'full/92b39facc2fea55c9f6def376e4680bd48f69edf.jpg', 'https://www.booking.com/hotel/ua/gostievoi-dom-quot-guest-house-nik-quot.ru.html', '2019-07-29 12:09:54', '2019-07-29 12:09:54'),
(110, 'Hostel 777', 'Хостел «777» расположен в Харькове, в 4,4 км от Харьковского исторического музея и в 8 км от стадиона «Металлист». К услугам гостей круглосуточная стойка регистрации и бесплатный Wi-Fi.', 'курилiвська 85', 'Харьков', '61016', 'Украина', '5.0', 'full/376a2f7fdb50c4c42fdd47c83e64e5bb613188b9.jpg', 'https://www.booking.com/hotel/ua/sdam-koiko-miesto.ru.html', '2019-07-29 12:09:55', '2019-07-29 12:09:55'),
(111, 'Мини-отель Метро Спортивная', 'Мини-отель «Метро Спортивная» расположен в Харькове, Харьковская область, в 1,5 км от стадиона «Металлист». Расстояние до Харьковского исторического музея составляет 2,8 км.', 'улица Шота Руставели 31', 'Харьков', '61124', 'Украина', '8.2', 'full/39f8fa99df1cfe6f75e9895026a94a5e5cc2a071.jpg', 'https://www.booking.com/hotel/ua/mini-metro-sportivnaya.ru.html', '2019-07-29 12:09:55', '2019-07-29 12:09:55'),
(112, 'Мини-отель Рылеев', 'Мини-отель «Рылеев» расположен в центре Харькова, в 5 минутах ходьбы от от железнодорожного вокзала.', 'Переулок Рылеева 18 А', 'Харьков', '61093', 'Украина', '9.0', 'full/3a95cc6ec022c944fc566a090db4828c9f327796.jpg', 'https://www.booking.com/hotel/ua/ryleev.ru.html', '2019-07-29 12:09:55', '2019-07-29 12:09:55'),
(113, 'Миракс Бутик Отель', 'Этот дизайн-отель расположен в городе Харьков, всего в 1,8 км от футбольного стадиона «Металлист». К услугам гостей бесплатный фитнес-центр, бесплатный Wi-Fi и круглосуточный супермаркет (на 1 этаже). Просторные номера оформлены в модных светлых тонах.', 'Московский проспект 86 а', 'Харьков', '61001', 'Украина', '8.6', 'full/cde342f265b10fc16daf6e8792ccf097faf2cc59.jpg', 'https://www.booking.com/hotel/ua/mirax-boutique.ru.html', '2019-07-29 12:09:56', '2019-07-29 12:09:56'),
(114, 'Premier Hotel Cosmopolit', 'Четырехзвездочный отель Premier Cosmopolit располагает роскошными, современными номерами в Харькове, Украина. Отель находится в деловом районе Харькова.', 'Akademika Proskury Str.1', 'Харьков', '61070', 'Украина', '8.8', 'full/eb2f8c28827db2c3e41a09e4cc1d0be77fc0e5b7.jpg', 'https://www.booking.com/hotel/ua/art-cosmopolit.ru.html', '2019-07-29 12:09:56', '2019-07-29 12:09:56');
INSERT INTO `hotels` (`id`, `name`, `description`, `address`, `city`, `postcode`, `country`, `rating`, `image`, `url_hotel`, `created_at`, `updated_at`) VALUES
(115, 'Квартира студия возле метро Южный вокзал', 'Offering free WiFi and city views, Квартира студия возле метро Южный вокзал is an accommodation situated in Kharkov.', '57 вулиця Полтавський Шлях', 'Харьков', '61000', 'Украина', '9.6', 'full/4e023b31a648070b0ed2d8b538c92d25f642cc9c.jpg', 'https://www.booking.com/hotel/ua/57-vulitsia-poltavs-kii-shliakh.ru.html', '2019-07-29 12:09:56', '2019-07-29 12:09:56'),
(116, 'Плетневский Хостел', 'Этот хостел находится в Харькове, в 10 минутах ходьбы от станции метро \"Радянська\". К услугам гостей номера с кондиционером, общая кухня и бесплатный Wi-Fi.', 'Кузнечная Улица 13 Кв 1', 'Харьков', '61003', 'Украина', '7.1', 'full/4e9aaa94ef356f11909aa6a5ecd1a54f7a062ce8.jpg', 'https://www.booking.com/hotel/ua/pletnevskiy.ru.html', '2019-07-29 12:09:57', '2019-07-29 12:09:57'),
(117, 'Volodarsky Apartment', 'Апартаменты «Володарский» с бесплатным Wi-Fi расположены в Харькове, в 3,6 км от Харьковского исторического музея и в 5 км от стадиона «Металлист».', 'Kashyrs\'ka St', 'Харьков', '61093', 'Украина', '8.3', 'full/3dd5115c3bbf677e5866579ae9ad7ceeb359a656.jpg', 'https://www.booking.com/hotel/ua/inn-volodarsky.ru.html', '2019-07-29 12:09:58', '2019-07-29 12:09:58'),
(118, 'Чичиков Отель', 'Современная гостиница \"Чичиков\" находится в историческом центре Харькова. К вашим услугам хорошо укомплектованные номера с бесплатным Wi-Fi, а также круглосуточный ресторан \"Персонаж\", специализирующийся на блюдах итальянской кухни.', 'Улица Гоголя 6/8', 'Харьков', '61057', 'Украина', '9.1', 'full/6f50ccbfefbe4517e8a049cb035e61da718f2139.jpg', 'https://www.booking.com/hotel/ua/chichikov.ru.html', '2019-07-29 12:09:58', '2019-07-29 12:09:58'),
(119, 'Moskovskiy 118 avenue', 'Апартаменты «Московский, 118» с видом на город и бесплатным Wi-Fi расположены в Харькове, в 6 км от Харьковского исторического музея и в 2,4 км от стадиона «Металлист».', '118 Московський проспект', 'Харьков', '61000', 'Украина', '8.5', 'full/d7c2c23e27b5900e43d691e5661da3711fdddc73.jpg', 'https://www.booking.com/hotel/ua/moskovskiy-118-avenue.ru.html', '2019-07-29 12:09:59', '2019-07-29 12:09:59'),
(120, 'Kharkiv Palace Hotel', 'Featuring a rooftop lounge and a spa centre, this 5-star hotel in Kharkiv city centre offers air-conditioned rooms with a spacious bathrooms and flat-screen TV. Free Wi-Fi is available.', 'Проспект Независимости', 'Харьков', '61058', 'Украина', '9.3', 'full/2b5f0b3e8ea03b704d35b7e18ece63448f9117c1.jpg', 'https://www.booking.com/hotel/ua/kharkiv-palace-premier.ru.html', '2019-07-29 12:09:59', '2019-07-29 12:09:59'),
(121, 'Nordian', 'Апарт-отель Nordian с видом на город и бесплатным Wi-Fi расположен в Харькове, менее чем в 1 км от Харьковского исторического музея и в 2,8 км от стадиона «Металлист».', '10 Pavlivska Square 2nd entrance', 'Харьков', '61000', 'Украина', '9.4', 'full/e7ce3ed414d2c7d6430158799e2583a050e2832c.jpg', 'https://www.booking.com/hotel/ua/nordian.ru.html', '2019-07-29 12:09:59', '2019-07-29 12:09:59'),
(122, 'Отель Артуа', 'Этот отель с бесплатным Wi-Fi расположен в 10 минутах езды от аэропорта Харькова и стадиона «Металлист». К услугам гостей номера с кондиционером и телевизором с плоским экраном.', 'Улица Льва Ландау (бывший Проспект 50-летия СССР) 151В', 'Харьков', '61128', 'Украина', '8.0', 'full/2f8e7636839d2cb738a31a1df7514c40ffae53b4.jpg', 'https://www.booking.com/hotel/ua/artua.ru.html', '2019-07-29 12:09:59', '2019-07-29 12:09:59'),
(123, 'Hotel Airport', 'Гостиница «Аэропорт» расположена в Харькове, в 7 км от стадиона «Металлист» и в 9 км от Исторического музея. К услугам гостей ресторан.', 'Aeroflotskaya street 16', 'Харьков', '61031', 'Украина', '8.3', 'full/e64aef392351c4e84e8e44fbb6b2c3db2eb94f47.jpg', 'https://www.booking.com/hotel/ua/airport-kharkov.ru.html', '2019-07-29 12:10:00', '2019-07-29 12:10:00'),
(124, 'Отель Виктория', 'Отель «Виктория» расположен в деловом центре Харькова. К услугам гостей большой спа-центр и крытый бассейн. К услугам гостей конференц-зал и бесплатный Wi-Fi. В отеле работают ресторан и круглосуточный бар.', 'Примеровская ул.23', 'Харьков', '61001 ', 'Украина', '8.2', 'full/1b1824140e4b79d36b238c51ee8251f37794d3a6.jpg', 'https://www.booking.com/hotel/ua/victoria.ru.html', '2019-07-29 12:10:00', '2019-07-29 12:10:00'),
(125, 'Nauky avenue', 'Апартаменты «Проспект Науки» расположены в Харькове, в 5 км от Харьковского исторического музея и в 9 км от стадиона «Металлист». К услугам гостей кондиционер и бесплатный Wi-Fi. Из окон открывается вид на город.', '39 Nauky Avenue', 'Харьков', '61166', 'Украина', '8.9', 'full/acf0b9c70e42d95302550faa27f02080be3aca7e.jpg', 'https://www.booking.com/hotel/ua/nauky-avenue.ru.html', '2019-07-29 12:10:04', '2019-07-29 12:10:04'),
(126, 'Paradise Garden', 'Апартаменты Paradise Garden расположены в Харькове, в 1,5 км от Харьковского исторического музея и в 2,8 км от стадиона «Металлист». К услугам гостей хорошо оборудованные апартаменты с бесплатным Wi-Fi.', 'Vorobyeva Street 10', 'Харьков', '61000', 'Украина', '7.4', 'full/9fc4c44db9f9a3b60c726f3ea87dbe81e5cbfc94.jpg', 'https://www.booking.com/hotel/ua/park-avenue.ru.html', '2019-07-29 12:10:05', '2019-07-29 12:10:05'),
(127, 'Apartment On Molodoi Gvardii 5', 'Апартаменты «На Молодой Гвардии 5» расположены в Харькове, в 4,3 км от Исторического музея и в 1,1 км от стадиона «Металлист». К услугам гостей бесплатный Wi-Fi и кондиционер.', '5 Molodoi Gvardii Street', 'Харьков', '61000', 'Украина', '8.1', 'full/1792a95d41aa87866fb2f0df09d458d667d53537.jpg', 'https://www.booking.com/hotel/ua/apartment-on-molodoi-gvardii-5.ru.html', '2019-07-29 12:10:06', '2019-07-29 12:10:06'),
(128, 'Сумская Апарт-отель', 'Апарт-отель «Самская» расположен в Харькове, в 2,1 км от Харьковского исторического музея и в 5 км от стадиона «Металлист». К услугам гостей номера с бесплатным Wi-Fi.', 'Sumska Street 53', 'Харьков', '61002', 'Украина', '8.1', 'full/f2b84704a214883ae8de6a05d9dd1e8f4e05bc18.jpg', 'https://www.booking.com/hotel/ua/sumskaya-aparthotel.ru.html', '2019-07-29 12:10:06', '2019-07-29 12:10:06'),
(129, 'Apartment on 23 Serpnya', 'Апартаменты «На 23 Сербской» расположены в Харькове, в 6 км от Харьковского исторического музея и в 9 км от стадиона «Металлист». К услугам гостей бесплатный Wi-Fi и телевизор с плоским экраном.', '23 Serpnya St. 43', 'Харьков', '61072', 'Украина', '8.6', 'full/30bc1cd7044af1258720309f6aca83f5cd8e7524.jpg', 'https://www.booking.com/hotel/ua/apartment-23-ho-serpnya-43.ru.html', '2019-07-29 12:10:06', '2019-07-29 12:10:06'),
(130, 'Апарт-отель Smart Studio', 'Апарт-отель Smart Studio с бесплатным Wi-Fi расположен в городе Харьков, в 4,4 км от стадиона «Металлист» и в 4 минутах ходьбы от железнодорожного вокзала Харьков-Пассажирский и станции метро «Южный вокзал».', '7 Verkhivskyi Lane', 'Харьков', '61093', 'Украина', '9.0', 'full/b72a781abf9c0e6b4fcb64cac812ad72de13aeb8.jpg', 'https://www.booking.com/hotel/ua/apart-smart-kupe.ru.html', '2019-07-29 12:10:06', '2019-07-29 12:10:06'),
(131, 'Отель Колумб', 'Отель «Колумб» находится в Харькове, в 2 км от станции метро «Площадь Восстания». К услугам гостей современные, полностью меблированные апартаменты с открытой планировкой и бесплатным WiFi.', 'ул. Академика Павлова 44а', 'Харьков', '62005', 'Украина', '7.9', 'full/a31e631f1d89ccb613f8fcf91aac9db47166ec8b.jpg', 'https://www.booking.com/hotel/ua/colombo.ru.html', '2019-07-29 12:10:06', '2019-07-29 12:10:06'),
(132, 'WINE & ROSE BOUTIQUE HOTEL', 'Бутик-отель WINE & ROSE расположен в Харькове, менее чем в 1 км от Харьковского исторического музея. К услугам гостей бар, номера для некурящих и бесплатный Wi-Fi. К услугам гостей круглосуточная стойка регистрации, доставка еды и напитков в номер и камера хранения багажа.', 'Улица Рымарская 19', 'Харьков', '61057', 'Украина', '8.9', 'full/69742b79f639060214029f22f9676b711e148d9d.jpg', 'https://www.booking.com/hotel/ua/wine-amp-rose.ru.html', '2019-07-29 12:10:07', '2019-07-29 12:10:07'),
(133, 'Отель Classic', 'Отель «Классик» находится в 7 минутах ходьбы от станции метро им. Архитектора Бекетова в Харькове. При отеле работает кафе и обустроена бесплатная частная парковка. Гости могут пользоваться бесплатным Wi-Fi.', 'Улица Краснознаменная 14', 'Харьков', '61000', 'Украина', '8.8', 'full/5025aff755ce0865c08fe7030ff5e157d26544bf.jpg', 'https://www.booking.com/hotel/ua/a-classic-a.ru.html', '2019-07-29 12:10:07', '2019-07-29 12:10:07'),
(134, 'Apartment near the Kharkiv Railway Station – Kotlyara str. 8/10z', 'Апартаменты «Рядом с железнодорожным вокзалом – Котляра» расположены в Харькове. К услугам гостей апартаментов 8/10z балкон и бесплатный Wi-Fi.', '8 вулиця Євгена Котляра', 'Харьков', '61000', 'Украина', '0.0', 'full/78fb3f280b916ad5a222c608cd6c247985d9498c.jpg', 'https://www.booking.com/hotel/ua/apartment-near-the-kharkiv-railway-station-kotlyara-str-8-47-10z.ru.html', '2019-07-29 12:10:08', '2019-07-29 12:10:08'),
(135, 'Отель Кирофф', 'Гостиница «Кирофф» находится в Харькове, в 5 минутах ходьбы от станции метро «Спортивная». К услугам гостей сауна с гидромассажной ванной, бесплатная частная парковка на территории и бесплатный Wi-Fi.', 'улица Молочная 14а', 'Харьков', '61001', 'Украина', '8.9', 'full/c3f1075ca14b4667e34335767150d3ff81083830.jpg', 'https://www.booking.com/hotel/ua/hotel-kiroff.ru.html', '2019-07-29 12:10:08', '2019-07-29 12:10:08'),
(136, 'Отлель Яр', 'Отель «Яр» расположен в тихом районе Харькова, в 5 минутах езды от Парка победы. К услугам гостей сауна, принадлежности для барбекю, сад и бесплатная парковка на территории.', 'улица Блюхера 33', 'Харьков', '61123', 'Украина', '7.9', 'full/313ee39bf65f5bece6b3783bf52a1613b0c371a6.jpg', 'https://www.booking.com/hotel/ua/yar.ru.html', '2019-07-29 12:10:09', '2019-07-29 12:10:09'),
