(170, 'Отличная квартира в центре Харькова м. Университет и м. Пушкинская', 'Апартаменты «Отличная квартира в центре Харькова м. Университет и м. Пушкинская» с кондиционером, балконом и бесплатным Wi-Fi расположены в Харькове, в 2 км от Исторического музея Харькова и в 3,4 км от стадиона «Металлист». К услугам гостей полностью оборудованная кухня.', '85 Chernyshevska Street', 'Харьков', '61000', 'Украина', '7.7', 'full/a304b8dce7b905acc2807aa92f1266971804e24a.jpg', 'https://www.booking.com/hotel/ua/otlichnaia-kvartira-v-tsentre-khar-kova-m-universitet-i-m-pushkinskaia-kharkiv.ru.html', '2019-07-29 12:10:26', '2019-07-29 12:10:26'),
