(175, 'Квартира Прованс в центре Харькова.( Пушкинская).', 'Апартаменты «Квартира Прованс в центре Харькова.( Пушкинская)» расположены в 1,9 км от Харьковского исторического музея. В числе удобств сад, терраса и общая кухня. В апартаментах предоставляется бесплатный Wi-Fi.', 'Potebni Street 1', 'Харьков', '61002', 'Украина', '9.3', 'full/6396905bf31d8d392ff2d0b94c278005965858c0.jpg', 'https://www.booking.com/hotel/ua/kvartira-provans-v-tsientrie-khar-kova-pushkinskaia.ru.html', '2019-07-29 12:10:30', '2019-07-29 12:10:30'),
