(179, 'Furnished Apartments on Sovetskaya', 'Эти апартаменты расположены в центре Харькова. К вашим услугам меблированные апартаменты с бесплатным Wi-Fi, кондиционером и кухней. Станция метро \"Радьянская\" находится в 10 минутах ходьбы от апартаментов.', 'Район станции метро Советская (Исторический музей)', 'Харьков', '61057', 'Украина', '7.1', 'full/0bbfea34565cfff7d62fe8811556aa911eb27486.jpg', 'https://www.booking.com/hotel/ua/furnished-apartments-on-sovetskaya.ru.html', '2019-07-29 12:10:32', '2019-07-29 12:10:32'),
