(193, 'Квартира-студия на Котляра', 'Set in Kharkov, Квартира-студия на Котляра offers accommodation with a balcony and free WiFi. The property has city views and is 2.2 km from Kharkov Historical Museum and 6 km from Metallist Stadium.', 'вулиця Євгена Котляра', 'Харьков', '61000', 'Украина', '0.0', 'full/26faf7119790f83cad1a777bea33327427e15337.jpg', 'https://www.booking.com/hotel/ua/evgeniia-kotliara-ulitsa-apartamenty.ru.html', '2019-07-29 12:10:38', '2019-07-29 12:10:38'),
(194, 'Отельный Комплекс Ягуар', 'Отельный комплекс \"Ягуар\" находится в 3 км от центра города Харькова. К услугам его гостей традиционная русская баня, русский бильярд, крытый и открытый бассейны, кафе, бесплатный Wi-Fi и бесплатная парковка на территории.', 'Улица Чкалова 2', 'Харьков', '61022', 'Украина', '7.2', 'full/a19381f170caebab80c6fea291becedee8694a39.jpg', 'https://www.booking.com/hotel/ua/jaguar-complex.ru.html', '2019-07-29 12:10:38', '2019-07-29 12:10:38'),
(195, 'Отель Грант', 'Отель «Грант» находится в городе Песочин, недалеко от центра города Харьков. К услугам гостей крытый бассейн, прекрасный сад с фонтаном, а также бесплатный WiFi.', 'поселок Песочин', 'Харьков', '62418', 'Украина', '7.1', 'full/83d9ea0cfff9d3d177204692aa717b0e2593f6d0.jpg', 'https://www.booking.com/hotel/ua/grant.ru.html', '2019-07-29 12:10:38', '2019-07-29 12:10:38'),
(196, 'Стиль Отель', 'Отель расположен у реки Харьков, на исторической улице Шевченко, одной из старейших улиц Харькова. К услугам гостей сауна, круглосуточная стойка регистрации и бесплатный Wi-Fi.', 'Улица Шевченко 194/196', 'Харьков', '61033', 'Украина', '7.8', 'full/5c1f6810096f6d994422b1d084a49ca7e6a06007.jpg', 'https://www.booking.com/hotel/ua/style.ru.html', '2019-07-29 12:10:39', '2019-07-29 12:10:39'),
(197, 'Отель-ресторан Берлога', 'Отель-ресторан «Берлога» с садом расположен в Харькове, в 90 метрах от Харьковского исторического музея. Стойка регистрации этого 3-звездочного отеля работает круглосуточно. Открыт ресторан', '5 Kil\'tseva Street Строение', 'Харьков', '62341', 'Украина', '0.0', 'full/e9cc9a119bff8ad1206d1a9e3c2f730a4f444816.jpg', 'https://www.booking.com/hotel/ua/otel-restoran-berloga.ru.html', '2019-07-29 12:10:40', '2019-07-29 12:10:40'),
(198, 'Гостевой Дом Наша Дача', 'В гостевом доме \"Наша дача\" к вашим услугам бесплатный Wi-Fi, турецкая баня и сад с террасой и сезонным открытым бассейном. В ярком ресторане с люстрами и роялем подают блюда итальянской и украинской кухни.', 'Батумская Улица 4 А', 'Харьков', '61070', 'Украина', '9.3', 'full/76b8fc3d70c5f3418c73f89e337d1f2e07c2c04c.jpg', 'https://www.booking.com/hotel/ua/nasha-dacha.ru.html', '2019-07-29 12:10:40', '2019-07-29 12:10:40'),
(199, 'Studio with an amazing view', 'Апартаменты Studio with a amazing view in Kharkov с бесплатным Wi-Fi расположены в 1,3 км от Харьковского исторического музея и в 2,7 км от стадиона «Металлист».', 'Hrekivska Street 5', 'Харьков', '61000', 'Украина', '8.1', 'full/747a46431187321d45af5a232318b58a7e1908a2.jpg', 'https://www.booking.com/hotel/ua/vip-apartamenty-v-novostroe-s-potriasaiushchim-vidom-iz-okna.ru.html', '2019-07-29 12:10:41', '2019-07-29 12:10:41'),
(200, 'Arcadia', 'Мини-гостиница «Аркадия» расположена в Харькове, в 7 км от Харьковского исторического музея. К услугам гостей номера с кондиционером и бар. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер.', 'Bukovyi Lane 27', 'Харьков', '61185', 'Украина', '7.8', 'full/349a9cb610157869fea6bc7a598df5ab87c3c2c5.jpg', 'https://www.booking.com/hotel/ua/arkadia-kharkov.ru.html', '2019-07-29 12:10:40', '2019-07-29 12:10:40'),
(201, 'Admiral', 'Апартаменты «Адмирал» с бесплатным WiFi и телевизором с плоским экраном расположены на берегу Олексеевского водохранилища в Харькове.', 'Klochkovskaya street 258', 'Харьков', '61000', 'Украина', '8.3', 'full/5bd08b599c4eaa50ab2e8c644d82f5c88077d9b8.jpg', 'https://www.booking.com/hotel/ua/admiral-kharkiv.ru.html', '2019-07-29 12:10:41', '2019-07-29 12:10:41'),
(202, 'Elegia Hotel', 'Отель Elegia находится в 15 минутах ходьбы от площади Свободы и парка Шевченко в Харькове. В классических номерах отеля работает бесплатный Wi-Fi.', 'Chernyshevska Street 71', 'Харьков', '61002', 'Украина', '7.7', 'full/953f2d06317bd88cd4dd8fb779479be7b487a43d.jpg', 'https://www.booking.com/hotel/ua/elegia.ru.html', '2019-07-29 12:10:41', '2019-07-29 12:10:41'),
(203, 'Этуаль', 'Отель «Этуаль» с телевизором с плоским экраном расположен в Харькове, в зеленом районе Новая Бавария, всего в 10 минутах езды от центра города.', 'Ново-Баварский Проспект 91', 'Харьков', '61020', 'Украина', '8.8', 'full/7623348eda223ace19cfc046db974fbc1788585c.jpg', 'https://www.booking.com/hotel/ua/etoile.ru.html', '2019-07-29 12:10:42', '2019-07-29 12:10:42'),
(204, 'Aparthotel Flora', 'Апарт-отель \"Флора\" расположен в 15 минутах ходьбы от площади Свободы и парка Шевченко в Харькове. К услугам гостей номера с собственной мини-кухней и бесплатным Wi-Fi.', 'Zalesskaya Street 5', 'Харьков', '61022', 'Украина', '7.6', 'full/20de96db55cb6a6eda5749e0b30310872bd5fb92.jpg', 'https://www.booking.com/hotel/ua/flora-apartments.ru.html', '2019-07-29 12:10:42', '2019-07-29 12:10:42'),
