(207, 'Apartment on Kotlova', 'Апартаменты «На Котлова» расположены в Харькове, в 3,1 км от Харьковского исторического музея и в 7 км от стадиона «Металлист».', 'Kotlova Street 106 ', 'Харьков', '61017', 'Украина', '7.2', 'full/2e902a022eb053cb70b7609470be2f7f929ac710.jpg', 'https://www.booking.com/hotel/ua/apartment-on-kotlova-106.ru.html', '2019-07-29 12:10:46', '2019-07-29 12:10:46'),
(208, 'Apartaments on Balu-Moskovskiy avenue', 'Апартаменты «На проспекте Балюкова» с балконом и видом на город расположены в Харькове в Харьковской области. Расстояние до Харьковского исторического музея составляет 2,5 км. К услугам гостей бесплатный Wi-Fi и круглосуточная стойка регистрации.', '62 Московський проспект', 'Харьков', '61000', 'Украина', '0.0', 'full/9919c66836bc86c5a0e866f1e218e158acdc1009.jpg', 'https://www.booking.com/hotel/ua/apartaments-on-balu-moskovskiy-avenue.ru.html', '2019-07-29 12:10:46', '2019-07-29 12:10:46'),
(209, 'Studio apartment in the Center - Heroiv Nebesnoi Sotni sq. 21/7', 'Апартаменты-студио «В центре - Героев Небесной сотни» расположены в Харькове, в 2,2 км от Харьковского исторического музея и в 1,9 км от стадиона «Металлист». К услугам гостей бесплатный Wi-Fi.', 'майдан Героїв Небесної Сотні', 'Харьков', '61000', 'Украина', '0.0', 'full/dbf8776363dc10922d591c88134e8220768ff8e6.jpg', 'https://www.booking.com/hotel/ua/studio-apartment-in-the-center-heroiv-nebesnoi-sotni-sq-21-47-7.ru.html', '2019-07-29 12:10:46', '2019-07-29 12:10:46'),
