(212, 'Apartment on Slobodskay Usadba', 'Из окон открывается вид на город.Апартаменты «На Слободской» расположены в 3 км от Харьковского исторического музея. К услугам гостей общий лаундж и балкон. Апартаменты расположены в здании, построенном в 2001 году, в 6 км от стадиона «Металлист».', 'улица Данилевского дом 26', 'Харьков', '61058', 'Украина', '0.0', 'full/d4ac4af7b3bac663964e3906b8418866ff68229d.jpg', 'https://www.booking.com/hotel/ua/apartment-on-slobodskay-usadba.ru.html', '2019-07-29 12:10:47', '2019-07-29 12:10:47'),
