(215, 'Квартира рядом с метро Холодная гора улица Ильинская Апартаменты', 'Located in Kharkov, Квартира рядом с метро Холодная гора улица Ильинская Апартаменты provides accommodation with a balcony and free WiFi.', 'улица Ильинская улица Ильинская 67', 'Харьков', '61093', 'Украина', '0.0', 'full/04ba5226dcc9a713a7ec9816429939df8b1c8433.jpg', 'https://www.booking.com/hotel/ua/kvartira-riadom-s-metro-kholodnaia-gora-ulitsa-il-inskaia-apartamenty.ru.html', '2019-07-29 12:10:48', '2019-07-29 12:10:48'),
(216, 'Загородный дом с сауной на берегу озера Водобуд', 'Загородный дом «Загородный дом с сауной на берегу озера Водобуд» находится в Харькове. Из окон открывается вид на озеро. К услугам гостей ресторан, круглосуточная стойка регистрации, бар, сад, принадлежности для барбекю и терраса. Предоставляется бесплатный Wi-Fi.', 'ул. Академика Глущенко', 'Харьков', '62640', 'Украина', '0.0', 'full/8ece75297229f12a64896a53e8a2c2b797a41c2d.jpg', 'https://www.booking.com/hotel/ua/zagorodnyi-dom-s-saunoi-na-beregu-ozera-vodobud.ru.html', '2019-07-29 12:10:48', '2019-07-29 12:10:48'),
