(220, 'Квартира возле метро Холодная гора', 'Situated in Kharkov, 5 km from Kharkov Historical Museum and 8 km from Metallist Stadium, Квартира возле метро Холодная гора features air-conditioned accommodation with a balcony and free WiFi.', '68 вулиця Волонтерська', 'Харьков', '61093', 'Украина', '0.0', 'full/c5e69221ecdceb93af75b599186254ef3d861517.jpg', 'https://www.booking.com/hotel/ua/kvartira-vozle-metro-kholodnaia-gora.ru.html', '2019-07-29 12:10:50', '2019-07-29 12:10:50'),
