(227, 'Сдам свою гостинку Воробьёвы горы посуточно/почасово', 'Situated 9 km from Kharkov Historical Museum and 6 km from Metallist Stadium, Сдам свою гостинку Воробьёвы горы посуточно/почасово features accommodation set in Kharkov.', '30 Шевченківський провулок', 'Харьков', '61000', 'Украина', '0.0', 'full/0377b1897b963ae47077fc08a5d0e92015a382ea.jpg', 'https://www.booking.com/hotel/ua/sdam-svoiu-gostinku-vorob-iovy-gory-posutochno-47-pochasovo.ru.html', '2019-07-29 12:10:54', '2019-07-29 12:10:54'),
