(230, 'Central Fresh AP light Modern', 'Апартаменты Central Fresh AP light Modern расположены в Харькове, в 4,4 км от Исторического музея и в 8 км от стадиона «Металлист». К услугам гостей кондиционер, балкон и бесплатный Wi-Fi. В здании апартаментов работает казино.', 'Улица Мирная，19 этаж 7，кв. 407', 'Харьков', '61000', 'Украина', '8.8', 'full/3421cecedaa5e32f12b1bb26ed149a250a27030b.jpg', 'https://www.booking.com/hotel/ua/central-fresh-ap-light-modern.ru.html', '2019-07-29 12:10:54', '2019-07-29 12:10:54'),
