(325, 'Hostel Pushkinckiy', 'Хостел \"Пушкинский\" расположен в Харькове, в 1,9 км от Харьковского исторического музея и в 3,8 км от стадиона \"Металлист\". К услугам гостей бесплатный Wi-Fi и общая кухня.', 'Mystetstv 5a', 'Харьков', '62340', 'Украина', '5.7', 'full/ebd750208230241ef0c99844163cf686f1e23486.jpg', 'https://www.booking.com/hotel/ua/hostel-pushkinckiy.ru.html', '2019-07-29 12:11:35', '2019-07-29 12:11:35'),
(326, 'Yellowunlimited Отель', 'Этот отель находится в тихом месте в Старом городе Харькова, в 200 метрах от станции метро \"Исторический музей\". К услугам гостей бесплатный Wi-Fi, бесплатная парковка и элегантная кофейня. В лобби отеля можно послушать музыку.', 'Rymarskaya 24-G', 'Харьков', '61057', 'Украина', '8.0', 'full/466a67da0726bb281575db610a73e6afbddc924b.jpg', 'https://www.booking.com/hotel/ua/yellowunlimited.ru.html', '2019-07-29 12:11:35', '2019-07-29 12:11:35'),
(327, 'Ирис арт Отель', 'Арт-отель «Ирис» находится в Харькове, рядом со станцией метро «Площадь Восстания». К услугам гостей ресторан, бесплатный WiFi и бесплатная частная парковка.', 'улица Святодуховская 6а', 'Харьков', '61001', 'Украина', '8.7', 'full/7018ad1a5a391d1828d4c6fa65d77f276a9de355.jpg', 'https://www.booking.com/hotel/ua/iris-art.ru.html', '2019-07-29 12:11:35', '2019-07-29 12:11:35'),
(328, 'Гостиница Фелиса', 'Современный отель \"Фелиса\" находится в тихом месте в центре Харькова, всего в 100 метрах от реки Харьков. К услугам гостей круглосуточная стойка регистрации. На территории предоставляется бесплатный Wi-Fi.', 'Улица Люсиновская 43 ', 'Харьков', '61068', 'Украина', '8.4', 'full/93900f6561e004549b1f045315026e5357ac677f.jpg', 'https://www.booking.com/hotel/ua/felisa.ru.html', '2019-07-29 12:11:36', '2019-07-29 12:11:36');
INSERT INTO `hotels` (`id`, `name`, `description`, `address`, `city`, `postcode`, `country`, `rating`, `image`, `url_hotel`, `created_at`, `updated_at`) VALUES
(329, 'Apartamenty Na Lopatinskom', 'Апартаменты расположены в 1,6 км от Харьковского исторического музея в Харькове. Апартаменты «На Лопатинском» оснащены кондиционером и бесплатным Wi-Fi.', 'Pereulok Lopatinskiy', 'Харьков', '61003', 'Украина', '8.0', 'full/5889de1fa791ef3e3597929455905ceaffc6ca66.jpg', 'https://www.booking.com/hotel/ua/apartamenty-na-lopatinskom.ru.html', '2019-07-29 12:11:36', '2019-07-29 12:11:36'),
(330, 'Апартотель на Площади Руднева', 'Апартаменты находятся в 5 км от центра Харькова. К услугам гостей кондиционер, бесплатный Wi-Fi и полностью оборудованная кухня.', 'Площадь Руднева 25', 'Харьков', '61000', 'Украина', '7.6', 'full/cc9e8b403382acbd9508e2fe8b6beab37a218ece.jpg', 'https://www.booking.com/hotel/ua/kharkov-metallist-stadium-apartments.ru.html', '2019-07-29 12:11:36', '2019-07-29 12:11:36'),
(331, 'Шинок', 'Этот хостел расположен в 15 минутах езды на автомобиле к северу от центра Харькова, в 3,5 км от стадиона \"Металлист\" и городского пляжа \"Пески\". Гости хостела \"Шинок\" смогут бесплатно пользоваться общей кухней и беспроводным доступом в Интернет.', 'улица Деревянко 48', 'Харьков', '61103', 'Украина', '4.7', 'full/37e646e8b44d388f73e5f2db1464e77782da039f.jpg', 'https://www.booking.com/hotel/ua/shynok.ru.html', '2019-07-29 12:11:36', '2019-07-29 12:11:36'),
(332, 'Park Отель', 'Этот 4-звездочный отель находится в самом центре Харькова. К услугам гостей просторные звукоизолированные номера с бесплатным Wi-Fi. За 12 минут можно дойти до станции метро «Киевская», а оттуда добраться до главных туристических достопримечательностей Харькова.', 'Ул. Шевченко 79', 'Харьков', '61013', 'Украина', '8.4', 'full/0c9bc4300233960bd309eaa08fd7c2ef57f15659.jpg', 'https://www.booking.com/hotel/ua/park.ru.html', '2019-07-29 12:11:37', '2019-07-29 12:11:37'),
(333, 'Villa Four Rooms', 'Этот отель с Wi-Fi, сауной и гидромассажной ванной расположен в Харькове, в 1 км от станции метро «23 августа» и в 12,6 км от Фельдман-экопарка.', 'Кузнецкий въезд 27 (Улица Клочковская 250)', 'Харьков', '61003', 'Украина', '9.0', 'full/9645164d09702ca5473c93084701304d376352e5.jpg', 'https://www.booking.com/hotel/ua/villa-four-rooms.ru.html', '2019-07-29 12:11:38', '2019-07-29 12:11:38'),
(334, 'India Palace Hotel', 'Отель India Palace расположен в Харькове, в 5 км от Харьковского исторического музея. К услугам гостей номера с кондиционером и бар. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. По вечерам в отеле проводится развлекательная программа.', 'Matushenko 14', 'Харьков', '61013', 'Украина', '7.6', 'full/cd0a7a302dbadf237c3ad54618894aab62d3ae6c.jpg', 'https://www.booking.com/hotel/ua/india-palace.ru.html', '2019-07-29 12:11:38', '2019-07-29 12:11:38'),
(335, 'Center Hostel', 'Хостел «Центр» расположен в Харькове, в 5 минутах ходьбы от станции метро «Госпром». К услугам гостей бесплатный Wi-Fi и бесплатная парковка на территории хостела. Расстояние до международного аэропорта Харькова составляет 10 км.', 'B. Chichibabina Street 2', 'Харьков', '61022', 'Украина', '6.1', 'full/440cf19eeb6d41e9c639ec881aa556fb8481b836.jpg', 'https://www.booking.com/hotel/ua/center-hostel.ru.html', '2019-07-29 12:11:38', '2019-07-29 12:11:38'),
(336, 'Kharkov CITIZEN', 'Современный хостел Kharkov CITIZEN расположен в центре города. Кроме бесплатного Wi-Fi и сейфа, к услугам гостей общие кухонные зоны, в которых они могут пообщаться друг с другом.', 'проспект Московский 131б', 'Харьков', '61001', 'Украина', '8.3', 'full/35368149488f7f657b5af22368818d1faf0f0c94.jpg', 'https://www.booking.com/hotel/ua/kharkov-citizen.ru.html', '2019-07-29 12:11:39', '2019-07-29 12:11:39'),
(337, 'Hotel 19', 'Этот отель находится в историческом центре Харькова всего в 3 минутах ходьбы от Харьковской филармонии и Академического театра оперы и балета. В номерах с кондиционером и бесплатным Wi-Fi установлены телевизоры с плоским экраном.', 'Сумская Улица 19 ', 'Харьков', '61057', 'Украина', '9.4', 'full/e238c96b5b2afe41f2459224ccf852bc0250a7cb.jpg', 'https://www.booking.com/hotel/ua/hotel19.ru.html', '2019-07-29 12:11:39', '2019-07-29 12:11:39'),
(338, 'Отельный комплекс \"Місто\"', 'Отельный комплекс «Мiсто» находится всего в 2 км от центра Харькова. К услугам гостей сауна и оздоровительный центр. На территории комплекса сооружена детская игровая площадка. Гости смогут поиграть в боулинг и позаниматься в фитнес-центре.', 'Улица Клочковская', 'Харьков', '61145', 'Украина', '8.1', 'full/12eee3b7807290e3d4a4cac4f0a75759a68641e5.jpg', 'https://www.booking.com/hotel/ua/complex-misto.ru.html', '2019-07-29 12:11:39', '2019-07-29 12:11:39'),
(339, 'Мини-отель Пятница', 'Мини-отель «Пятница» находится всего в 700 метрах от железнодорожного вокзала Харькова. К услугам гостей солнечная терраса с принадлежностями для барбекю. В ярких номерах работает бесплатный Wi-Fi и установлен телевизор с плоским экраном.', 'Ryleeva Pereulok 20A', 'Харьков', '61093', 'Украина', '8.0', 'full/d106f967270c42599ad802fee3a715f55cc53169.jpg', 'https://www.booking.com/hotel/ua/d1-4d-d1-2d-d3-4ndud-n-dnnd1-2d-nddeg.ru.html', '2019-07-29 12:11:43', '2019-07-29 12:11:43'),
(340, 'Korolenko Apartment', 'Апартаменты Korolenko расположены в Харькове, в 1,7 км от Харьковского исторического музея и в 2,4 км от стадиона «Металлист». К услугам гостей бесплатный Wi-Fi.', '25 Korolenka Street', 'Харьков', '61003', 'Украина', '9.2', 'full/7fef3811d4e4a70db3c0e18990aa36a685c8bcef.jpg', 'https://www.booking.com/hotel/ua/korolenko-apartment.ru.html', '2019-07-29 12:11:44', '2019-07-29 12:11:44'),
(341, 'Royal Hotel', 'Отель «Роял» расположен в тихом районе Харькова с развитой инфраструктурой, в 7 км от центра города. К услугам гостей терраса и оформленные в классическом стиле номера с бесплатным Wi-Fi.', 'Улица Гвардейцев-широнинцев 34', 'Харьков', '61000', 'Украина', '7.4', 'full/d7f3a781f1c6cc39f0bc703a1ef785a04d0108ba.jpg', 'https://www.booking.com/hotel/ua/royal-kharkov.ru.html', '2019-07-29 12:11:44', '2019-07-29 12:11:44'),
(342, 'Мини-отель Марго', 'Этот отель находится в 5 минутах ходьбы от железнодорожного вокзала Харькова и станции метро \"Южный вокзал\". К услугам гостей бесплатный Wi-Fi и номера со спутниковым телевидением, чайником и собственной ванной комнатой с тапочками.', 'Полтавский Шлях 65', 'Харьков', '61052', 'Украина', '7.1', 'full/46264c8b79951707ec7a61d2256e45946283f14a.jpg', 'https://www.booking.com/hotel/ua/margo-mini-hotel.ru.html', '2019-07-29 12:11:44', '2019-07-29 12:11:44'),
(343, 'Отель Динамо', 'Этот отель расположен в Харькове, всего в 20 метрах от стадиона \"Динамо\". К услугам гостей отеля \"Динамо\" крытый бассейн, сауна и круглосуточная стойка регистрации.', 'Динамовская Улица 3', 'Харьков', '61000', 'Украина', '6.7', 'full/aecf2a8480082ec1373d891cd315a27bca50550b.jpg', 'https://www.booking.com/hotel/ua/dinamo.ru.html', '2019-07-29 12:11:44', '2019-07-29 12:11:44'),
(344, 'Апартаменты на Гагарина', 'Апартаменты «На Гагарина» расположены в Виннице, в 5 км от национального музея Пирогов и в 4,2 км от мультимедийного фонтана Рошен. К услугам гостей бесплатный Wi-Fi, кондиционер и общий лаундж.', 'Площадь Гагарина 4', 'Винница', '21050', 'Украина', '9.1', 'full/6680671bbee2af403bbc6e7498eba62507e75d62.jpg', 'https://www.booking.com/hotel/ua/apartments-on-gagarina-vinnytsya.ru.html', '2019-07-29 12:12:00', '2019-07-29 12:12:00'),
(345, 'Apartment on Mykoly Ovodova Street', 'Апартаменты «На улице Миколы Ододова» расположены в Виннице, в 5 км от национального музея Пирогов и в 2,5 км от мультимедийного фонтана Рошен. В этом районе популярны пешие походы. Из окон открывается вид на сад и город. К услугам гостей бесплатный Wi-Fi.', 'Mykoly Ovodova Street', 'Винница', '21000', 'Украина', '9.5', 'full/d915d9fcc44158a437eab5fa42a72f51af711bc4.jpg', 'https://www.booking.com/hotel/ua/shikarnaia-kvartira-v-tsientrie-ghoroda.ru.html', '2019-07-29 12:12:00', '2019-07-29 12:12:00'),
(346, 'Элитная квартира в центре Винницы', 'Апартаменты «Элитная квартира в центре Винницы» с бесплатным Wi-Fi и гостиной с телевизором с плоским экраном расположены в Виннице, в 4,1 км от музея-усадьбы Пирогова и в 4,3 км от фонтана Roshen.', 'ул. Писарева', 'Винница', '21036', 'Украина', '9.6', 'full/52dcb700b4e13483e828676891b55ddd0419d121.jpg', 'https://www.booking.com/hotel/ua/elitnaia-kvartira-v-tsentre-vinnitsy.ru.html', '2019-07-29 12:12:01', '2019-07-29 12:12:01'),
(347, 'Drive Hills', 'Апарт-отель Drive Hills находится в центре города Винница, в 5 минутах ходьбы от музыкального фонтана Рошен. К вашим услугам бесплатный WiFi, апартаменты с собственной кухней и выход в сад и на террасу. На территории обустроена бесплатная парковка.', '20-go Marta Street 32-b ', 'Винница', '21022', 'Украина', '9.3', 'full/afb9d2b683c76192bf63c5803c364ec49285e8d1.jpg', 'https://www.booking.com/hotel/ua/drive-hills.ru.html', '2019-07-29 12:12:01', '2019-07-29 12:12:01'),
(348, 'SWEEThostel', 'Хостел Sweethostel расположен в Виннице, в 5 км от Национального музея Пирогов, где производится экспресс-регистрация заезда и отъезда. К услугам гостей номера для некурящих, принадлежности для барбекю, бесплатный WiFi и терраса. Здание хостела было построено в 2017 году. Расстояние до мультимедийного фонтана Рошен составляет 3,2 км. В распоряжении гостей общая кухня и камера хранения багажа.', 'Khlibna Street 16', 'Винница', '21000', 'Украина', '9.6', 'full/e6028eb4c662e3b4ecc70755c175bfcaa377bae7.jpg', 'https://www.booking.com/hotel/ua/svithostel-amp-apartment.ru.html', '2019-07-29 12:12:01', '2019-07-29 12:12:01'),
(349, 'Hotel Villa Venice', 'Отель Villa Venice с сезонным открытым бассейном, баром и видом на озеро расположен в Виннице, в 3,5 км от Национального музея Пирогова. К услугам гостей ресторан, круглосуточная стойка регистрации, общий лаундж и бесплатный Wi-Fi. Расстояние от этого отеля для некурящих до мультимедийного фонтана Рошен составляет 8 км.', 'pereulok Sovremennyi', 'Винница', '21000', 'Украина', '9.1', 'full/cd6fdeb95451dc9f05a9ae231a2a3924338addf0.jpg', 'https://www.booking.com/hotel/ua/villa-vinietsiia.ru.html', '2019-07-29 12:12:01', '2019-07-29 12:12:01'),
(350, 'Family House', 'not found', 'Akademika Yushchenka Street', 'Винница', '21037', 'Украина', '9.9', 'full/0716d97184a3da0e98f1b23beb6deb4c4e291c6d.jpg', 'https://www.booking.com/hotel/ua/seven-sky-vinnytsya.ru.html', '2019-07-29 12:12:02', '2019-07-29 12:12:02'),
(351, 'Apartment On Ierusalimka 9', 'Апартаменты On Ierusalimka 9 с балконом и бесплатным Wi-Fi расположены в Виннице. Эти апартаменты расположены в здании 1965 года, в 7 км от национального музея Пирогов и в 1,5 км от мультимедийного фонтана Рошен.', 'Ulitsa Ierusalimka', 'Винница', '21000', 'Украина', '9.7', 'full/9e6e4e7a695a44702187baff0c2ac1e7e5462625.jpg', 'https://www.booking.com/hotel/ua/apartment-on-ierusalimka-9.ru.html', '2019-07-29 12:12:02', '2019-07-29 12:12:02'),
(352, 'Париж', 'Комплекс апартаментов «Париж» с террасой и бесплатным Wi-Fi расположен в городе Винница, в 5 км от Музея-усадьбы Пирогова и в 2,4 км от мультимедийного фонтана «Рошен».', 'вулиця Пушкіна 32', 'Винница', '21000', 'Украина', '9.5', 'full/5a82dd9c3bead98a117e1e35b6fb79bb340615c3.jpg', 'https://www.booking.com/hotel/ua/parizh.ru.html', '2019-07-29 12:12:04', '2019-07-29 12:12:04'),
(353, 'Comfort Apartments Park Tower', 'Апартаменты Comfort Park Tower с балконом и чайником расположены в 4,4 км от Национального музея Пирогова. Из окон открывается вид на сад.', 'Магістратська вулиця', 'Винница', '21050', 'Украина', '0.0', 'full/a12975c2098dbeb0f340733f2d5626af84dd13ab.jpg', 'https://www.booking.com/hotel/ua/comfort-apartments-park-tower.ru.html', '2019-07-29 12:12:04', '2019-07-29 12:12:04'),
(354, 'Hotel France', 'Отель «Франция» с видом на реку, общим лаунджем, баром, рестораном, банкоматом и круглосуточной стойкой регистрации расположен в Виннице в 6 км от музея-усадьбы Н.И. Пирогова. В гостинице предоставляется услуга доставки еды и напитков в номер, свежие газеты и бизнес-удобства, в том числе факс и ксерокс.', 'Soborna St', 'Винница', '21000', 'Украина', '9.4', 'full/88c9623bb8b3865601c39f7191514ca370c45c68.jpg', 'https://www.booking.com/hotel/ua/francia.ru.html', '2019-07-29 12:12:03', '2019-07-29 12:12:03'),
(355, 'City center apartment', 'Апартаменты City center расположены в Виннице, в 5 км от Национального музея Пирогов и мультимедийного фонтана Рошен и в 5 км от мультимедийного фонтана Рошен. К услугам гостей бесплатный Wi-Fi и кондиционер. Из окон открывается вид на город.', 'Гоголя 5/23', 'Винница', '21000', 'Украина', '9.3', 'full/044d3176be56ea48ba91ce1e9a1c1236113b0cc5.jpg', 'https://www.booking.com/hotel/ua/city-center-apartment-vinnitsia.ru.html', '2019-07-29 12:12:06', '2019-07-29 12:12:06'),
(356, 'Пироговски', 'Offering city views, Пироговски is an accommodation situated in Vinnytsya, 3.5 km from The National Pirogov\'s Estate Museum and 4.3 km from Multimedia Fountain Roshen. It features free WiFi, a garden, a terrace and a restaurant.', 'улица Пирогова дом 76 В кв.20', 'Винница', '21000', 'Украина', '9.9', 'full/6fac76ac18e97efafea080821a19ce8ecae9a297.jpg', 'https://www.booking.com/hotel/ua/pirogovski.ru.html', '2019-07-29 12:12:04', '2019-07-29 12:12:04'),
(357, 'Smart Apart', 'Апартаменты Smart Apart расположены в Винннице. К услугам гостей бесплатный Wi-Fi. На территории обустроена частная парковка.', 'Архитектора Артынова 57а', 'Винница', '21000', 'Украина', '9.6', 'full/24238cd4b77cb701617a1a8f113e883b55e8445a.jpg', 'https://www.booking.com/hotel/ua/smart-apart.ru.html', '2019-07-29 12:12:06', '2019-07-29 12:12:06'),
