(421, 'Urban Stay Salzburg City', 'Отремонтированный в 2016 году гостевой дом Urban Stay Salzburg City расположен в Зальцбурге, всего в 5 минутах ходьбы от Главного железнодорожного вокзала. К услугам гостей современные номера и бесплатный Wi-Fi.', 'Rainerstraße 11', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.8', 'full/2d442895545e402e348dd7478fe9219c7c0b2505.jpg', 'https://www.booking.com/hotel/at/urban-stay-salzburg-city.ru.html', '2019-07-29 12:12:51', '2019-07-29 12:12:51'),
(422, 'Hotel Vogelweiderhof', 'Построенный в начале XX века отель Vogelweiderhof расположен возле главной дороги на окраине Зальцбурга. К услугам гостей номера с бесплатным Wi-Fi и бесплатная частная парковка.', 'Vogelweiderstraße 93', 'Зальцбург', '5020 Зальцбург', 'Австрия', '8.1', 'full/023a76632a6154868698acbcdb0492e58d7e6179.jpg', 'https://www.booking.com/hotel/at/und-restaurant-vogelweiderhof.ru.html', '2019-07-29 12:12:51', '2019-07-29 12:12:51'),
(423, 'Loft Collection Salzburg Mirabell', 'Отель Loft Collection Salzburg Mirabell расположен в Зальцбурге, в 300 м от дворца Мирабель. К услугам гостей общий лаундж, номера для некурящих и бесплатный Wi-Fi. Во всех номерах есть мини-кухня и собственная ванная комната. Отель расположен в 1,8 км от крепости Хоэнзальцбург и в 2 км от Фестивального зала Зальцбурга.', 'Rainerstraße 7', 'Зальцбург', '5020 Зальцбург', 'Австрия', '9.5', 'full/e234a716acdcde2d876703bcfbbbd1e00382a0b1.jpg', 'https://www.booking.com/hotel/at/loft-collection-salzburg-mirabell.ru.html', '2019-07-29 12:12:52', '2019-07-29 12:12:52'),
(424, 'OEKOTEL Salzburg Messe', 'Отель OEKOTEL Salzburg Messe расположен в Зальцбурге, всего в 3 км от выставочных центров Messezentrum и Salzburgarena. В числе удобств бесплатный Wi-Fi. Прямо перед отелем останавливаются автобусы линии 4, на которых можно добраться до исторического центра Зальцбурга.', 'Eugen-Müller-Strasse 9', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.7', 'full/3d1b4ed90958647b3dd201063d273835c3f86ae6.jpg', 'https://www.booking.com/hotel/at/oekotel-salzburg-messe.ru.html', '2019-07-29 12:12:52', '2019-07-29 12:12:52'),
(425, 'Vogelweiderhof-Rooms', 'Отель Vogelweiderhof-Rooms с номерами с бесплатным Wi-Fi расположен на окраине Зальцбурга. Прямо рядом с основным зданием отеля Vogelweiderhof обустроена бесплатная парковка.', 'Vogelweiderstraße 93b', 'Зальцбург', '5020 Зальцбург', 'Австрия', '8.1', 'full/fb94ff7c82ec04b4ecee74d5bc11bc9afa37e591.jpg', 'https://www.booking.com/hotel/at/vogelweider-rooms.ru.html', '2019-07-29 12:12:53', '2019-07-29 12:12:53'),
(426, 'Hotel Krone 1512', 'Отель Krone 1512 занимает отремонтированное здание 15 века в самом центре Старого города Зальцбурга. На всей территории отеля предоставляется бесплатный Wi-Fi.', 'Linzer Gasse 48', 'Зальцбург', '5020 Зальцбург', 'Австрия', '8.1', 'full/c2f02a60bfdfffaa85203c1a7ef3ccbe7a835434.jpg', 'https://www.booking.com/hotel/at/goldene-krone.ru.html', '2019-07-29 12:12:52', '2019-07-29 12:12:52'),
(427, 'Hotel Restaurant Itzlinger Hof', 'Just a 10-minute walk from Salzburg Main Train Station, the Itzlinger Hof is a 10-minute drive from Salzburg’s city centre. It offers free private parking and free WiFi, and guests can relax on the sun terrace.', 'Itzlinger Hauptstraße 11', 'Зальцбург', '5020 Зальцбург', 'Австрия', '5.9', 'full/4daca3ed301ff5c23dc46cbe70ee57576a621bcf.jpg', 'https://www.booking.com/hotel/at/itzlinger-hof.ru.html', '2019-07-29 12:12:53', '2019-07-29 12:12:53'),
(428, 'arte Hotel Salzburg', 'Отель arte Salzburg удобно расположен в городе Зальцбург, в 600 м от дворца Мирабель. Из всех номеров этого 4-звездочного отеля открывается вид на горы. Гости могут посещать сауну. Отель расположен в районе Элизабет-Форштадт и в 1,4 км от города Моцартеум.', '28 Rainerstraße', 'Зальцбург', '5020 Зальцбург', 'Австрия', '8.5', 'full/0fed405868564514ee68bf87d355236d797f9e2a.jpg', 'https://www.booking.com/hotel/at/arte-salzburg-salzburg.ru.html', '2019-07-29 12:12:54', '2019-07-29 12:12:54'),
(429, 'Appartment Salzburg City Center', 'Апартаменты Salzburg City Center расположены в Зальцбурге, в 2 км от Фестивального зала Зальцбурга. К услугам гостей сад, бесплатный Wi-Fi и круглосуточная стойка регистрации. К услугам гостей частная парковка. До крепости Хоэнзальцбург — 2,4 км.', '63 Maxglaner Hauptstraße', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.8', 'full/a0f9a973c2f8b44bf9724b9b40a593de6916e316.jpg', 'https://www.booking.com/hotel/at/appartment-salzburg-city-center.ru.html', '2019-07-29 12:12:55', '2019-07-29 12:12:55'),
(430, 'YoHo - International Youth Hostel', 'Хостел YoHo - International Youth расположен в Зальцбурге, всего в 10 минутах ходьбы от центрального железнодорожного вокзала. Хостел находится в 500 метрах от дворца Мирабель, в 600 метрах от консерватории Моцартеум и в 9 минутах ходьбы от монастыря Капуцинов и горы Капуцинерберг. К услугам гостей бесплатный Wi-Fi.', 'Paracelsusstraße 9', 'Зальцбург', '5020 Зальцбург', 'Австрия', '8.5', 'full/b64d44aa361ca4f66d702445e2e034951eb3e843.jpg', 'https://www.booking.com/hotel/at/yoho-international-youth-hostel.ru.html', '2019-07-29 12:12:54', '2019-07-29 12:12:54'),
(431, 'Hotel Drei Kreuz', 'Отель Drei Kreuz расположен в центре Зальцбурга, всего в 10 минутах ходьбы от Старого города. К услугам гостей бесплатный Wi-Fi на всей территории и места на частной парковке отеля (за дополнительную плату).', 'Vogelweiderstraße 9', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.8', 'full/2fab8a0022f15adaa14812e3dc45eb256de04234.jpg', 'https://www.booking.com/hotel/at/hoteldreikreuzsalzburg.ru.html', '2019-07-29 12:12:55', '2019-07-29 12:12:55'),
(432, 'Haus Wartenberg', 'Традиционных отель Haus Wartenberg он был построен в 1654 году. Он расположен в самом центре Зальцбурга, всего в 500 метрах от дворца Мирабель. В отеле есть бесплатный беспроводной доступ в Интернет и бесплатная парковка.', 'Riedenburger Str. 2', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.8', 'full/c57a35a0457667c9584cf789bd12decda5822ada.jpg', 'https://www.booking.com/hotel/at/haus-wartenberg.ru.html', '2019-07-29 12:12:55', '2019-07-29 12:12:55'),
(433, 'JUFA Hotel Salzburg', 'Отель JUFA Salzburg с видом на крепость Хоэнзальцбург расположен всего в 5 минутах ходьбы от Старого города Зальцбурга. К услугам гостей бар, лобби, терраса и бесплатный Wi-Fi в местах общего пользования.', 'Josef-Preis-Allee 18', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.7', 'full/012e0560540bfe6e2aa926b87ad247da2588653f.jpg', 'https://www.booking.com/hotel/at/jufa-salzburg-city.ru.html', '2019-07-29 12:12:55', '2019-07-29 12:12:55'),
(434, 'Hotel Haunspergerhof', 'Отель Haunspergerhof расположен в тихой части города Зальцбург, между главным железнодорожным вокзалом и историческим кварталом. Подключен бесплатный Wi-Fi.', 'Haunspergstraße 30', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.8', 'full/307f99b78e4789efbaafc869f4c15703963da3f9.jpg', 'https://www.booking.com/hotel/at/haunspergerhof.ru.html', '2019-07-29 12:12:56', '2019-07-29 12:12:56');
INSERT INTO `hotels` (`id`, `name`, `description`, `address`, `city`, `postcode`, `country`, `rating`, `image`, `url_hotel`, `created_at`, `updated_at`) VALUES
(435, 'Ferienhaus mit Wintergarten', 'Дом для отпуска Ferienhaus mit Wintergarten с видом на город расположен менее чем в 1 км от выставочного центра Messezentrum. К услугам гостей номера с балконом и чайником. Из окон открывается вид на горы. Расстояние до дворца Мирабель составляет 2,4 км, а до крепости Хоэнзальцбург — 2,7 км.', 'Jägerstraße 10', 'Зальцбург', '5020 Зальцбург', 'Австрия', '0.0', 'full/f86b9b63bf4ca73fad98bfc8952560aa4b3fb5f1.jpg', 'https://www.booking.com/hotel/at/ferienhaus-mit-wintergarten.ru.html', '2019-07-29 12:12:50', '2019-07-29 12:12:50'),
(436, 'Hotel Evido Salzburg City Center', 'Семейный отель Evido Salzburg City Center находится всего в 3 минутах ходьбы от центрального железнодорожного вокзала. К услугам гостей круглосуточная стойка регистрации и бесплатный Wi-Fi.', 'Saint-Julien-Straße 33', 'Зальцбург', '5020 Зальцбург', 'Австрия', '6.7', 'full/7c35196d44d75868bf471af9d3edc15a3c34f62e.jpg', 'https://www.booking.com/hotel/at/garni-evido.ru.html', '2019-07-29 12:12:56', '2019-07-29 12:12:56'),
(437, 'Boutique-Gasthof Ueberfuhr', 'Бутик-отель Gasthof Ueberfuhr расположен в городе Зальцбург, прямо на набережной реки Зальцах, в пределах 2 км от кафедрального собора Зальцбурга и в 2,2 км от горы Капуцинерберг и монастыря капуцинов. От дома, где родился Моцарт, отель отделяют 2,3 км, а от улицы Гетрайдегассе и Большого фестивального дворца — 2,4 км. Расстояние до университета Моцартеум составляет 2,6 км, а до крепости Хоэнзальцбург — 2,7 км.', '43 Ignaz-Rieder-Kai', 'Зальцбург', '5026 Зальцбург', 'Австрия', '8.5', 'full/a910002af0225ade281f51f2bed6bfbdcf069d02.jpg', 'https://www.booking.com/hotel/at/boutique-gasthof-ueberfuhr-salzburg.ru.html', '2019-07-29 12:12:51', '2019-07-29 12:12:51'),
(438, 'Cityhotel Junger Fuchs', 'Отель Stadtpension Junger Fuchs с бесплатным Wi-Fi на всей территории занимает центральное расположение на улице Линцер Гассе, в исторической части города Зальцбург, у подножия горы Капуцинерберг.', 'Linzer Gasse 54', 'Зальцбург', '5020 Зальцбург', 'Австрия', '7.3', 'full/8284019fc12135e5d43717fdd857b22bf10d771b.jpg', 'https://www.booking.com/hotel/at/pension-junger-fuchs.ru.html', '2019-07-29 12:12:51', '2019-07-29 12:12:51'),
(439, 'Nash Pratik Hotel', 'Отель Nash Pratik расположен в Куантране. В этом 3-звездочном отеле есть терраса, номера с кондиционером и бесплатным Wi-Fi. Стойка регистрации работает круглосуточно.', 'Chemin de la violette 13', 'Женева', '1216 Женева', 'Швейцария', '8.9', 'full/618efd1197b7c20a692f2a2e1047ad267ea6a671.jpg', 'https://www.booking.com/hotel/ch/nash-pratik-cointrin12.ru.html', '2019-07-29 12:14:36', '2019-07-29 12:14:36'),
(440, 'NH Geneva City', 'Отель NH Geneva City был полностью отремонтирован в июле 2017 года. К услугам гостей просторные и стильные номера. Отель находится в Женеве, в 20 минутах ходьбы от Старого города. На территории работает бесплатный Wi-Fi.', '42-44 avenue Wendt', 'Женева', '1203 Женева', 'Швейцария', '8.5', 'full/d1bdd73dd0d27ff0aafc4dd6c71ab319d01cd7da.jpg', 'https://www.booking.com/hotel/ch/nh-geneva-city.ru.html', '2019-07-29 12:14:36', '2019-07-29 12:14:36'),
(441, 'Hotel Tor', 'Уютный семейный отель Tor имеет превосходное расположение, он находится в 5 минутах ходьбы от железнодорожного вокзала Cornavin. Здесь гостей ожидают современные полностью оснащенные номера.', '3', 'Женева', '1201 Женева', 'Швейцария', '7.8', 'full/9c7ff22f25d03278dadeddbff5e5ac1023d184bd.jpg', 'https://www.booking.com/hotel/ch/tor.ru.html', '2019-07-29 12:14:37', '2019-07-29 12:14:37'),
(442, 'Hotel Rotary Geneva - MGallery', 'Отель Rotary Geneva MGallery Collection расположен в центре города, всего в 5 минутах ходьбы от железнодорожного вокзала Корнавен и в 3 минутах ходьбы от Женевского озера. В 2015 году в отеле был выполнен капитальный ремонт. В этом 4-звездочном улучшенном бутик-отеле работает бесплатный Wi-Fi. Ресторан с летней террасой был отмечен в ресторанном гиде Го Мийо.', '18-20', 'Женева', '1201 Женева', 'Швейцария', '8.9', 'full/b96328720fa0dd8e8ea05d5a27fecd370fcbca10.jpg', 'https://www.booking.com/hotel/ch/geneve.ru.html', '2019-07-29 12:14:37', '2019-07-29 12:14:37'),
(443, 'Central 2 bedroom flat in heart of Eaux-vives', 'Апартаменты Central 2 bedroom flat in heart of Eaux-vives с балконом и бесплатным Wi-Fi расположены в Женеве, в 400 м от фонтана Же-До, в 1,8 км от собора Сен-Пьер и в 3,8 км от здания Организации Объединенных Наций. Расстояние до стадиона Стад-де-Женев составляет 5 км, а до выставочного центра Palexpo — 7 км.', '7 Rue Cherbuliez', 'Женева', '1207 Женева', 'Швейцария', '7.6', 'full/2874fb74c4a5073b44a22cafca72f52c8d4b7f8a.jpg', 'https://www.booking.com/hotel/ch/central-2-bedroom-flat-in-heart-of-eaux-vives.ru.html', '2019-07-29 12:14:37', '2019-07-29 12:14:37'),
(444, 'Four Seasons Hotel des Bergues Geneva', 'not found', '33', 'Женева', '1201 Женева', 'Швейцария', '9.3', 'full/095f31c246c0831b8e4c01e90f72e16c5dfb21bf.jpg', 'https://www.booking.com/hotel/ch/four-seasons-geneva.ru.html', '2019-07-29 12:14:37', '2019-07-29 12:14:37'),
(445, 'Point Cardinal', 'Комплекс Point Cardinal расположен в Женеве, в 3 км от Женевского стадиона. К услугам гостей бар, бесплатный Wi-Fi и круглосуточная стойка регистрации. Апартаменты расположены в здании, построенном в 2015 году, в 5 км от собора Сен-Пьер и фонтана Же-До.', '132', 'Женева', '1212 Женева', 'Швейцария', '9.5', 'full/7ee43722f3d393951c28b978dcd8adc899703d07.jpg', 'https://www.booking.com/hotel/ch/point-cardinal.ru.html', '2019-07-29 12:14:38', '2019-07-29 12:14:38'),
(446, 'The Ritz-Carlton Hotel de la Paix, Geneva', 'Старинный фешенебельный отель The Ritz-Carlton de la Paix, Geneva, полностью отремонтированный в 2017 году, расположен в самом центре Женевы, на берегу Женевского озера, всего в 5 минутах ходьбы от исторической части города и основных достопримечательностей.', '11 Quai du Mont-Blanc', 'Женева', '1211 Женева', 'Швейцария', '9.1', 'full/e1eac3c36cad9cad109de265ac23b1f12eff8552.jpg', 'https://www.booking.com/hotel/ch/de-la-paix-ritz-carlton.ru.html', '2019-07-29 12:14:38', '2019-07-29 12:14:38'),
(447, 'Hotel d\'Allèves', 'Отель D\'allèves был построен в середине XVIII века. Он расположен в тихом месте в центре Женевы, всего в 5 минутах ходьбы от железнодорожного вокзала и в 100 метрах от Женевского озера. К услугам гостей бесплатный Wi-Fi.', 'Rue du Cendrier 16', 'Женева', '1201 Женева', 'Швейцария', '9.2', 'full/e9628487c3d7fdbaf11a02c58cedb880216d7cf0.jpg', 'https://www.booking.com/hotel/ch/hotel-d-alleves.ru.html', '2019-07-29 12:14:38', '2019-07-29 12:14:38'),
(448, 'Kipling Manotel', 'Отель Kipling Manotel расположен на тихой улице недалеко от Женевского озера, железнодорожного вокзала и офисов различных международных организаций. К услугам гостей номера с кондиционером и бесплатный WiFi.', 'Rue de la Navigation 27', 'Женева', '1201 Женева', 'Швейцария', '8.8', 'full/246cbcc1a5ec81969fa91010721f8295d7c7fe75.jpg', 'https://www.booking.com/hotel/ch/kipling.ru.html', '2019-07-29 12:14:39', '2019-07-29 12:14:39'),
(449, 'Starling Residence Genève', 'Отель Starling Résidence Genève расположен в 400 метрах от факультета бизнеса и экономики. К услугам гостей современные номера-студио с мини-кухней, телевизором с плоским экраном, транслирующим спутниковые каналы, а также различными туалетно-косметическими принадлежностями.', 'Route des Acacias 4', 'Женева', '1227 Женева', 'Швейцария', '8.4', 'full/4ee9bb192d4db06b3e2afa687a6a20b5631f8b00.jpg', 'https://www.booking.com/hotel/ch/starling-ra-c-sidence-gena-ve.ru.html', '2019-07-29 12:14:39', '2019-07-29 12:14:39'),
(450, 'NH Geneva Airport Hotel', 'Отель NH Geneva Airport расположен в 1 км от международного аэропорта Женева и в 2,5 км от торгово-выставочного центра Palexpo. Для гостей организован бесплатный трансфер от/до аэропорта с интервалом движения каждые 20 минут. До центра города можно добраться на общественном транспорте за 10 минут. Рядом со стойкой регистрации круглосуточно открыт бар, в котором подают напитки и легкие закуски.', 'Avenue de Mategnin 21', 'Женева', '1217 Женева', 'Швейцария', '8.1', 'full/54be02a7e16d5413d2d4c294d5b71cca23da83e1.jpg', 'https://www.booking.com/hotel/ch/nhgenevaairport.ru.html', '2019-07-29 12:14:39', '2019-07-29 12:14:39'),
(451, 'Fraser Suites Geneva - Serviced Apartments', 'Комплекс Fraser Suites Geneva расположен в районе Рю-дю-Марше, в 300 метрах от собора Сен-Пьер, в 10 минутах ходьбы от фонтана Же-До и в 800 метрах от железнодорожного вокзала Гар-де-Корнавин. К услугам гостей номера-студио с собственной мини-кухней и бесплатным Wi-Fi.', 'Rue de la Rotisserie 3-5', 'Женева', '1204 Женева', 'Швейцария', '9.2', 'full/a7e8c5e980e3b46a71046acf05f3e1e1f8941666.jpg', 'https://www.booking.com/hotel/ch/fraser-suites-geneva.ru.html', '2019-07-29 12:14:39', '2019-07-29 12:14:39'),
(452, 'Sagitta Swiss Quality Hotel', 'Отель Sagitta Swiss Quality удобно расположен в самом сердце Женевы, на левом берегу Женевского озера, всего в нескольких метрах от исторического центра города и в 10 минутах ходьбы от фонтана Же-До и берега озера. Во всех номерах есть мини-кухня и бесплатный Wi-Fi.', '6', 'Женева', '1207 Женева', 'Швейцария', '8.5', 'full/b3246a76bd1d40fdd4194fd9b184fbd02034d6c3.jpg', 'https://www.booking.com/hotel/ch/swissqhotelsagitta.ru.html', '2019-07-29 12:14:41', '2019-07-29 12:14:41'),
(453, 'Le Richemond', 'Престижный 5-звездочный отель Le Richemond удобно расположен на берегу Женевского озера. С территории открывается живописный вид на знаменитый фонтан Же-До и гору Монблан.', 'Rue Adhémar Fabri 8', 'Женева', '1201 Женева', 'Швейцария', '9.0', 'full/86c04e935328c08d9d64a8fd71b8c859e96636c7.jpg', 'https://www.booking.com/hotel/ch/lerichemond.ru.html', '2019-07-29 12:14:42', '2019-07-29 12:14:42'),
(454, 'Les Armures', 'Уникальный отель Les Armures с неповторимой атмосферой, очаровательными номерами и прекрасной кухней расположен в здании XVII века в самом центре Старого города Женевы.', 'Rue Puits-St-Pierre', 'Женева', '1204 Женева', 'Швейцария', '9.1', 'full/220a2319f9ac1e05193a3964e06ddeb59043d298.jpg', 'https://www.booking.com/hotel/ch/lesarmures.ru.html', '2019-07-29 12:14:42', '2019-07-29 12:14:42'),
(455, 'Studio quartier Jonction', 'Апартаменты-студио Quartier Jonction находятся в Женеве, в 1,3 км от собора Святого Петра. Здесь допускается размещение с домашними животными. В числе удобств бесплатный Wi-Fi.', 'Boulevard Carl Vogt 12 5 ème étage', 'Женева', '1205 Женева', 'Швейцария', '8.2', 'full/154e36c598508a6329aae265a3c49de707d1d92e.jpg', 'https://www.booking.com/hotel/ch/studio-quartier-jonction.ru.html', '2019-07-29 12:14:47', '2019-07-29 12:14:47'),
(456, 'Ibis Styles Geneve Mont Blanc', 'Отель Ibis Styles Geneve Mont Blanc находится в Женеве, в 900 метрах от фонтана Же-До и кафедрального собора Сен-Пьер. К услугам гостей ресторан.', '15 Rue de Berne', 'Женева', '1201 Женева', 'Швейцария', '9.0', 'full/41d5d8db341aa44a46090310b056e6b6a818ae7a.jpg', 'https://www.booking.com/hotel/ch/ibis-styles-geneve-mont-blanc-opening-end-2015.ru.html', '2019-07-29 12:14:48', '2019-07-29 12:14:48'),
(457, 'Hotel Strasbourg', 'The elegant Hotel Strasbourg is centrally located in quiet surroundings, in the heart of the business district, near the famous Mont Blanc pedestrian Street and Lake Leman.', 'Rue Pradier 10', 'Женева', '1201 Женева', 'Швейцария', '8.1', 'full/0c07d7d4f36518a41c2af73b842282840a492a33.jpg', 'https://www.booking.com/hotel/ch/best-western-hotel.ru.html', '2019-07-29 12:14:48', '2019-07-29 12:14:48'),
(458, 'Cool flat Geneva', 'Апартаменты Cool flat Geneva расположены в Женеве, в 2,2 км от штаб-квартиры ООН в Женеве. К услугам гостей бесплатный прокат велосипедов, бесплатный WiFi, круглосуточная стойка регистрации и камера хранения багажа. Из апартаментов с балконом открывается вид на город.', '22 Rue Lamartine', 'Женева', '1203 Женева', 'Швейцария', '8.8', 'full/e36e96adfaedcc16e313439dec5c63b4e40ba460.jpg', 'https://www.booking.com/hotel/ch/cool-flat-geneva.ru.html', '2019-07-29 12:14:48', '2019-07-29 12:14:48'),
(459, 'Mandarin Oriental, Geneva', 'Роскошный отель Mandarin Oriental, оформленный в изысканном стиле с сохранением архитектурных деталей ар-деко, расположен на правом берегу реки Рона всего в 5-10 минутах ходьбы от Женевского озера и банков, магазинов и галерей Женевы. На территории отеля работают 2 ресторана изысканной кухни.', 'Quai Turrettini 1', 'Женева', '1201 Женева', 'Швейцария', '8.7', 'full/0a6f0a5a6d8990c74f5404da7547809452808a30.jpg', 'https://www.booking.com/hotel/ch/mandarin-oriental-geneva.ru.html', '2019-07-29 12:14:48', '2019-07-29 12:14:48'),
(460, '9Hotel Paquis', 'Отель 9Hotel Paquis с номерами с кондиционером расположен в районе Паки города Женева, в 800 метрах от отеля фонтана Же-До. Отель находится недалеко от нескольких известных достопримечательностей, примерно в 1,1 км от собора Сен-Пьер и примерно в 1,4 км от штаб-квартиры ООН в Женеве. К услугам гостей гидромассажная ванна и сауна.', '31 Rue de Berne', 'Женева', '1201 Женева', 'Швейцария', '8.7', 'full/7c4b8c3420ec17689d5ec7422285210de03e1f38.jpg', 'https://www.booking.com/hotel/ch/9hotel-paquis.ru.html', '2019-07-29 12:14:49', '2019-07-29 12:14:49'),
(461, 'ibis budget Genève Petit-Lancy', 'Отель Ibis Budget Geneve Petit-Lancy находится в 10 минутах езды от Международного аэропорта Женева и в 5 минутах езды от центра города. К услугам гостей номера с ванной комнатой и телевизором с плоским экраном, а также бесплатный Wi-Fi.', 'Chemin des Olliquettes 6 Petit-Lancy', 'Женева', '1213 Женева', 'Швейцария', '7.8', 'full/99be48d782be43addcd31a914cedcc0feb3d0709.jpg', 'https://www.booking.com/hotel/ch/ibis-budget-geneve-petit-lancy.ru.html', '2019-07-29 12:14:50', '2019-07-29 12:14:50'),
(462, 'Hotel Century', 'Отель Century расположен в центре Женевы, всего в 5 минутах ходьбы от Женевского озера и в 20 минутах ходьбы от железнодорожного вокзала Корнавен. К услугам гостей круглосуточная стойка регистрации, снэк-бар и ежедневный завтрак «шведский стол».', 'Avenue de Frontenex', 'Женева', '1207 Женева', 'Швейцария', '7.0', 'full/f3871246ff2a0845f81b2d617aec364b8b55120a.jpg', 'https://www.booking.com/hotel/ch/century.ru.html', '2019-07-29 12:14:50', '2019-07-29 12:14:50'),
(463, 'Résidence Studio Genève Centre', 'Комплекс Résidence Genève Centre расположен в центре Женевы, в 450 метрах от железнодорожного вокзала Корнавин и в 400 метрах от озера. К услугам гостей номера-студио и апартаменты с бесплатным Wi-Fi.', 'Rue de Berne 36', 'Женева', '1201 Женева', 'Швейцария', '7.1', 'full/1a4323a1745a3e52ad1dc0fcbbb47f68f0776351.jpg', 'https://www.booking.com/hotel/ch/ra-c-sidence-gena-ve-centre.ru.html', '2019-07-29 12:14:50', '2019-07-29 12:14:50'),
(464, 'N’vY Manotel', 'Отель N’vY Manotel, полностью отремонтированный в 2012 году, находится всего в 300 метрах от берегов Женевского озера и в 15 минутах ходьбы от центра города и Дворца Наций. В стильных номерах к услугам гостей телевизор с плоским экраном и высокой четкостью изображения, аудиосистема Hi-Fi, мультимедийный порт, декоративная подсветка и бесплатный проводной доступ в Интернет и Wi-Fi.', '18', 'Женева', '1202 Женева', 'Швейцария', '8.5', 'full/1d58e57e4d7ada783acbce13360dfbd302d1f05f.jpg', 'https://www.booking.com/hotel/ch/epsom.ru.html', '2019-07-29 12:14:51', '2019-07-29 12:14:51'),
(465, 'Boël 5', 'Апартаменты Boël 5 с бесплатным Wi-Fi и видом на город расположены в Женеве, всего в 1,6 км от собора Сен-Пьер и в 800 м от Зала Виктории. Эти апартаменты расположены в здании XVIII века, в 4 км от штаб-квартиры ООН в Женеве и в 8 км от выставочного центра Palexpo.', '1 Rue de la Tour-de-Boël', 'Женева', '1204 Женева', 'Швейцария', '9.5', 'full/e8f0098bdf556f2b085e4c44d37efb807a31562e.jpg', 'https://www.booking.com/hotel/ch/boel-5.ru.html', '2019-07-29 12:14:51', '2019-07-29 12:14:51'),
(466, 'Hotel D Geneva', 'Отель D Geneva с фитнес-центром и видом на город расположен в Женеве, в 1,8 км от фонтана Же-До. К услугам гостей этого 4-звездочного отеля круглосуточная стойка регистрации, доставка еды и напитков в номер и бесплатный Wi-Fi. Гости могут почитать газеты, воспользоваться факсом и копировальным аппаратом.', '16 Rue de Fribourg', 'Женева', '1201 Женева', 'Швейцария', '8.4', 'full/b2de5f8fbd58fec96179208a0577967b3123d055.jpg', 'https://www.booking.com/hotel/ch/d-geneva.ru.html', '2019-07-29 12:14:52', '2019-07-29 12:14:52'),
(467, 'homeboat', 'На яхте Homeboat в 1,7 км от фонтана Же-До к услугам гостей общий лаундж, терраса и номера с кондиционером, балконом и бесплатным Wi-Fi.', 'Quai Wilson port wilson numero 32', 'Женева', '1201 Женева', 'Швейцария', '8.5', 'full/f974e01f5acc6db97ec9548d640839960b8d82ca.jpg', 'https://www.booking.com/hotel/ch/homeboat.ru.html', '2019-07-29 12:14:53', '2019-07-29 12:14:53'),
(468, 'Hôtel Longemalle', 'Just a 3-minute walk from the Old Town, the English Garden and from Lake Geneva, the elegant Hôtel Longemalle offers you air-conditioned rooms equipped with period furniture, an HD LED TV and free WiFi.', '13 Place Longemalle', 'Женева', '1204 Женева', 'Швейцария', '8.3', 'full/adf769ac35a50508475e8c812909d2cc5dc0875d.jpg', 'https://www.booking.com/hotel/ch/longemalle.ru.html', '2019-07-29 12:14:53', '2019-07-29 12:14:53'),
(469, 'Royal Manotel', 'Отель Royal Manotel находится в центральном районе города Женева, в 5 минутах ходьбы от железнодорожного вокзала, Старого города и Женевского озера. К услугам гостей элегантные номера со старинной мебелью и бесплатным Wi-Fi.', 'Rue de Lausanne 41-43', 'Женева', '1201 Женева', 'Швейцария', '8.2', 'full/fa196db4708de0d2832df6ab7ebf1ca03fac6b20.jpg', 'https://www.booking.com/hotel/ch/royalmanotel.ru.html', '2019-07-29 12:14:54', '2019-07-29 12:14:54'),
(470, 'The Ambassador', 'Отель Ambassador расположен на берегу Женевского озера, в 15 минутах езды от аэропорта и в 500 метрах от железнодорожного вокзала, в центре Женевы. На всей территории отеля работает бесплатный Wi-Fi.', '21', 'Женева', '1201 Женева', 'Швейцария', '8.7', 'full/af5aec09c73b96db48227dcefa99dd9383f97cf6.jpg', 'https://www.booking.com/hotel/ch/ambassadorgeneva.ru.html', '2019-07-29 12:14:55', '2019-07-29 12:14:55'),
(471, 'Novotel Genève Centre', 'Отель Novotel Genève Centre расположен в 2 минутах ходьбы от берега Женевского озера и в 5 минутах от железнодорожного вокзала Корнавин. В числе удобств — фитнес-центр, спа-центр, бесплатный Wi-Fi и бесплатный проездной билет на общественный транспорт.', 'Rue De Zurich 19', 'Женева', '1201 Женева', 'Швейцария', '7.8', 'full/e63d515613e72145c5c01d640a513c556e791f74.jpg', 'https://www.booking.com/hotel/ch/geneve-centre.ru.html', '2019-07-29 12:14:56', '2019-07-29 12:14:56'),
(472, 'Grenade', 'Комплекс апартаментов GRENADE с бесплатным Wi-Fi расположен в Женеве, в 500 м от фонтана Же-До.', 'Avenue Grenade 18', 'Женева', '1207 Женева', 'Швейцария', '9.4', 'full/7aee961665bf66f19c5f0f83abe6d5fc8825bca8.jpg', 'https://www.booking.com/hotel/ch/grenade.ru.html', '2019-07-29 12:15:00', '2019-07-29 12:15:00'),
(473, '39 route de Veyrier', 'Апартаменты 39 route de Veyrier с общим лаунджем и видом на сад расположены в Женеве, в 2,7 км от собора Сен-Пьер и в 2,9 км от фонтана Же-До. Расстояние до стадиона «Стад де Женев» составляет 2,9 км. К услугам гостей общая кухня.', '39 Route de Veyrier', 'Женева', '1227 Женева', 'Швейцария', '0.0', 'full/dcfe2bec26e6f2ae5a71f1fa3bc2427cfacf7f61.jpg', 'https://www.booking.com/hotel/ch/39-route-de-veyrier.ru.html', '2019-07-29 12:15:01', '2019-07-29 12:15:01'),
(474, 'Appart\'hôtel Résidence CityZen', 'Отель Résidence CityZen находится в 500 метрах от железнодорожного вокзала Корнавин. До набережной Женевского озера - 300 метров. К услугам гостей апартаменты с кондиционером, отдельным балконом и бесплатным беспроводным доступом в Интернет.', '10', 'Женева', '1201 Женева', 'Швейцария', '7.9', 'full/b2776c3c2b1e7ae535784dcea4db3e5c756760bc.jpg', 'https://www.booking.com/hotel/ch/residence-laffitte.ru.html', '2019-07-29 12:15:01', '2019-07-29 12:15:01'),
(475, 'Hotel Eden', 'Отель Eden расположен в нескольких шагах от Женевского озера, недалеко от центра города и всех международных организаций, и обращен фасадом к одному из красивейших парков Женевы.', '135', 'Женева', '1202 Женева', 'Швейцария', '8.6', 'full/99586d199d8d9117174ac757f20706d7706c5e7e.jpg', 'https://www.booking.com/hotel/ch/hoteledengeneva.ru.html', '2019-07-29 12:15:02', '2019-07-29 12:15:02'),
(476, 'Home Swiss Hotel', 'Полностью отремонтированный в 2016 году отель Home Swiss расположен в 10 минутах ходьбы от центра Женевы, в районе Женевского университета и музея Рат. Прогулка до железнодорожного вокзала Корнавина занимает 15 минут. Гости получают бесплатный проездной для пользования общественным транспортом.', 'Av. de Sainte-Clotilde 7', 'Женева', '1205 Женева', 'Швейцария', '8.5', 'full/37e972ae8b1c3dc2c1ccd89f84d1669df1070d5a.jpg', 'https://www.booking.com/hotel/ch/home-swiss-hotel.ru.html', '2019-07-29 12:15:02', '2019-07-29 12:15:02'),
(477, 'Tiffany Hotel', 'Отель Tiffany расположен на тихой улице в самом сердце Богемного квартала Женевы рядом с Большим театром, всего в нескольких минутах ходьбы от Женевского озера. К услугам гостей оздоровительный центр и библиотека. Предоставляется бесплатный Wi-Fi.', 'Rue de l\'Arquebuse 20', 'Женева', '1204 Женева', 'Швейцария', '8.7', 'full/938ff24889ee0bc21c9f8edb850aa6071a9ed8ae.jpg', 'https://www.booking.com/hotel/ch/tiffany.ru.html', '2019-07-29 12:15:02', '2019-07-29 12:15:02'),
(478, 'ibis Styles Geneva Gare', 'Отель ibis Styles Geneva Gare расположен в центре города Женева, рядом с главным железнодорожным вокзалом города и Собором Богоматери. Из его окон открывается вид на площади Корнавен и Шантепуле. Каждое утро в отеле сервируют завтрак «шведский стол».', 'Place de Cornavin 8', 'Женева', '1201 Женева', 'Швейцария', '8.8', 'full/5722c7dec23d5d320c5690d7bdfe0d88ec025e74.jpg', 'https://www.booking.com/hotel/ch/savoy-geneva.ru.html', '2019-07-29 12:15:03', '2019-07-29 12:15:03'),
(479, 'ibis Genève Centre Gare', 'Отель Ibis Genève Centre Gare расположен в самом сердце города. Он находится в 200 метрах от железнодорожного вокзала и в 5 км от аэропорта.', '10', 'Женева', '1201 Женева', 'Швейцария', '8.2', 'full/d0535ad543529ebb67c2f860ab7710b33bfa0115.jpg', 'https://www.booking.com/hotel/ch/geneve-centre-gare.ru.html', '2019-07-29 12:15:03', '2019-07-29 12:15:03'),
(480, 'Hôtel Pax', 'Отель Hôtel Pax расположен в жилом районе в центре Женевы, в 5 минутах ходьбы от Женевского озера, делового и торгового центра города, Старого города и музеев. В просторных номерах и апартаментах действует бесплатный Wi-Fi.', 'Rue du 31-Décembre 68', 'Женева', '1207 Женева', 'Швейцария', '7.9', 'full/e47df6387eff9239f3d06324e2dc5ee7c7487bcf.jpg', 'https://www.booking.com/hotel/ch/pax.ru.html', '2019-07-29 12:15:03', '2019-07-29 12:15:03'),
(481, 'Boël 3 studio', 'Расстояние до фонтана Же-До составляет 2,2 км, а до собора Святого Вита — 2,5 км. Апартаменты-студио Boël 3 расположены в Женеве, в 3,9 км от Женевского собора. Расстояние до штаб-квартиры ООН в Женеве составляет 4 км.', 'rue de la Tour-de-Boël 1', 'Женева', '1204 Женева', 'Швейцария', '9.3', 'full/2f104b345cfbcf6aad87273331aaaae4205c6391.jpg', 'https://www.booking.com/hotel/ch/boel-3-apartment.ru.html', '2019-07-29 12:15:04', '2019-07-29 12:15:04'),
(482, 'Cool & Central 2 bedroom in heart of Eaux-vives', 'Апартаменты Cool & Central 2 bedroom in heart of Eaux-vives расположены в Женеве, в 500 м от фонтана Же-До и в 1,2 км от собора Сен-Пьер. К услугам гостей кондиционер, патио и бесплатный Wi-Fi. Из апартаментов с балконом открывается вид на город.', '7 Rue Cherbuliez', 'Женева', '1207 Женева', 'Швейцария', '7.9', 'full/057debb9c04f386e59df072f7881c5f9b3f612f8.jpg', 'https://www.booking.com/hotel/ch/cool-amp-central-2-bedroom-in-heart-of-eaux-vives.ru.html', '2019-07-29 12:15:04', '2019-07-29 12:15:04'),
(483, 'Hotel des Horlogers', 'Отель Horlogers расположен в центре коммуны План-лез-Уат, в 4 км от центра Женевы и в 3 минутах ходьбы от ведущих фабрик Швейцарии по производству часов. В отеле представлена коллекция старинных инструментов часовщиков. К услугам гостей бесплатный Wi-Fi.', 'Route de Saint-Julien 135', 'Женева', '1228 Женева', 'Швейцария', '8.1', 'full/1b72f3b6815f1d272c9f08121bb68d793f71d426.jpg', 'https://www.booking.com/hotel/ch/des-horlogers.ru.html', '2019-07-29 12:15:04', '2019-07-29 12:15:04'),
(484, 'Hotel Diplomate', 'Отель Diplomate находится рядом с роскошным зеленым парком Маланью, в очаровательном женевском квартале О-Вив, недалеко от одноименного железнодорожного вокзала.', 'Rue de la Terrassière', 'Женева', '1207 Женева', 'Швейцария', '7.2', 'full/0b12ec1de5b014f5d720c47a3b777ff3c837b464.jpg', 'https://www.booking.com/hotel/ch/best-western-diplomate.ru.html', '2019-07-29 12:15:05', '2019-07-29 12:15:05'),
(485, 'Excelsior', 'Отель Excelsior расположен в центре города, в 5 минутах ходьбы от железнодорожного вокзала Корнавин и в 10 минутах ходьбы от Старого города Женевы. К услугам гостей бесплатный высокоскоростной Wi-Fi.', '34 Rue Rousseau', 'Женева', '1201 Женева', 'Швейцария', '8.2', 'full/3d9376cd387933b49e9ab23684ac61c6b080763f.jpg', 'https://www.booking.com/hotel/ch/excelsior.ru.html', '2019-07-29 12:15:05', '2019-07-29 12:15:05'),
(486, 'Eastwest Hôtel', 'Насладитесь домашней атмосферой в самом центре Женевы. Этот отель — рай роскоши и утонченности. Отель находится в нескольких шагах от озера, вблизи торговых и деловых районов.', 'Rue des Pâquis 6', 'Женева', '1201 Женева', 'Швейцария', '8.8', 'full/4e47cfdcc2aab2a0f814e3ba80286e2c990b98bc.jpg', 'https://www.booking.com/hotel/ch/eastwest.ru.html', '2019-07-29 12:15:06', '2019-07-29 12:15:06'),
(487, 'The New Midi', 'Частный отель The New Midi с видом на площадь рядом с рекой Рона находится в самом центре Женевы, всего в 3 минутах ходьбы через мост от Старого города. К услугам гостей номера с кондиционером и бесплатным Wi-Fi.', '4 place Chevelu', 'Женева', '1201 Женева', 'Швейцария', '8.7', 'full/24de08837c50481dc3c5e289bad1133ad8119e9b.jpg', 'https://www.booking.com/hotel/ch/hoteldumidigeneva.ru.html', '2019-07-29 12:15:06', '2019-07-29 12:15:06'),
(488, 'Hotel Balzac', 'Отель Balzac расположен в самом центре Женевы, в 200 метрах от озера и в 600 метрах от железнодорожного вокзала Корнавин. К услугам гостей снэк-бар, круглосуточная стойка регистрации и бесплатный WiFi на всей территории. Дворец Наций, где размещается отделение ООН в Женеве, находится в 1,3 км.', '14', 'Женева', '1201 Женева', 'Швейцария', '7.2', 'full/2de9aca0c295e594063b85973bc4476ff3c56062.jpg', 'https://www.booking.com/hotel/ch/balzac.ru.html', '2019-07-29 12:15:10', '2019-07-29 12:15:10'),
(489, 'Geneva city centre', 'Апартаменты Geneva city centre расположены в Женеве, недалеко от фонтана Же-До, собора Святого Петра и Цветочных часов. К услугам гостей бесплатный Wi-Fi.', '21 Rue de Monthoux', 'Женева', '1201 Женева', 'Швейцария', '6.7', 'full/e7b4675514eccb5ce9fed36ffed6424c7e4ce0af.jpg', 'https://www.booking.com/hotel/ch/geneva-city-centre.ru.html', '2019-07-29 12:15:11', '2019-07-29 12:15:11'),
