(491, 'NEST Geneva', 'Апартаменты Nest Geneva находятся в Женеве, в районе Сите, в 2,3 км от фонтана Же-До и в 4 км от стадиона Стад-де-Женев.', '12-14 Rue Etienne Dumont', 'Женева', '1204 Женева', 'Швейцария', '9.3', 'full/610432d8a1cf0e89b715f32b6015695582f73efe.jpg', 'https://www.booking.com/hotel/ch/nest-living-concept.ru.html', '2019-07-29 12:15:11', '2019-07-29 12:15:11'),
