(493, 'Larem Suites Old Town', 'Апартаменты Larem Suites Old Town расположены в Женеве. К услугам гостей гидромассажная ванна, бесплатные туалетно-косметические принадлежности и фен.', 'Grand rue 34', 'Женева', '1204 Женева', 'Швейцария', '7.4', 'full/adafdab3dfa10107ee7bf470641aa578225bfc37.jpg', 'https://www.booking.com/hotel/ch/larem-suites-old-tow.ru.html', '2019-07-29 12:15:12', '2019-07-29 12:15:12'),
(494, 'Studio Geneva City', 'Апартаменты-студио Geneva City расположены в Женеве, в 700 м от фонтана Же-До и в 800 м от собора Святого Пьера. К услугам гостей бесплатный Wi-Fi.', '36 route de Frontenex', 'Женева', '1207 Женева', 'Швейцария', '6.6', 'full/0af0c90e30a6490273216a9981c9bdd34f86c635.jpg', 'https://www.booking.com/hotel/ch/studio-geneva-city.ru.html', '2019-07-29 12:15:12', '2019-07-29 12:15:12'),
(495, 'Nash Suites Hotel', 'Отель Nash Suites расположен в Женеве, в 1,4 км от выставочного центра Palexpo. К услугам гостей фитнес-центр, бар и общий лаундж. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. В отеле предоставляются услуги консьержа, камеры хранения багажа и обмена валюты.', '88 Avenue Louis-Casaï', 'Женева', '1216 Женева', 'Швейцария', '8.8', 'full/7b203827caeb32819045c7ed040926c2a3c66c2f.jpg', 'https://www.booking.com/hotel/ch/nash-suite.ru.html', '2019-07-29 12:15:13', '2019-07-29 12:15:13'),
