(497, 'La Réserve Genève Hotel & Spa', 'Роскошный пятизвездочный спа-отель La Réserve Genève расположен на берегу Женевского озера, посреди живописного ландшафтного парка площадью 4,05 гектаров. К услугам гостей крытый и открытый бассейны, 4 ресторана и бар.', '301 route de Lausanne', 'Женева', '1293 Женева', 'Швейцария', '8.9', 'full/f41ed8a641499672feb449889c43bc887c672703.jpg', 'https://www.booking.com/hotel/ch/la-reserve-geneve-spa.ru.html', '2019-07-29 12:15:14', '2019-07-29 12:15:14'),
(498, 'Bémont 4', 'Апартаменты Bémont 4 расположены в Женеве, в 300 м от собора Сен-Пьер, в 1 км от фонтана Же-До и в 2,2 км от штаб-квартиры ООН в Женеве. На всей территории работает бесплатный Wi-Fi.', '4 Rue Bémont', 'Женева', '1204 Женева', 'Швейцария', '9.1', 'full/36418cdd0b25eae80d3736ca70781917f7660aa4.jpg', 'https://www.booking.com/hotel/ch/bemont-4-geneva.ru.html', '2019-07-29 12:15:14', '2019-07-29 12:15:14'),
(499, 'belo apartamento no coracao de Geneve', 'Апартаменты Belo no coracao de Geneve с террасой и общей кухней идеально расположены в Женеве, в 2,3 км от стадиона «Стад де Женев» и в 4,3 км от собора Сен-Пьер. В распоряжении гостей общий лаундж и ресторан.', 'Rue de la ferme 7', 'Женева', '1205 Женева', 'Швейцария', '0.0', 'full/2fb03e29091de0e5b96fcc089c8d8ac3f7a19771.jpg', 'https://www.booking.com/hotel/ch/belo-apartamento-no-coracao-de-geneve.ru.html', '2019-07-29 12:15:15', '2019-07-29 12:15:15'),
