(504, 'Appart\'Hôtel Residence Dizerens', 'Этот очаровательный гостевой дом расположен в спокойном уголке на пешеходной улице в центре Женевы. Номера с полностью оборудованной мини-кухней элегантно оформлены в стиле минимализм.', 'Rue Dizerens', 'Женева', '1205 Женева', 'Швейцария', '7.5', 'full/86dd8f1d9bb048107f686a5552dca6a31c9ee083.jpg', 'https://www.booking.com/hotel/ch/residence-dizerens.ru.html', '2019-07-29 12:15:17', '2019-07-29 12:15:17'),
(505, 'Appartement de charme au cœur de Genève', 'Апартаменты de charme. В апартаментах au cœur. Апартаменты De Genève расположены в Женеве, менее чем в 1 км от собора Сен-Пьер и в 19 минутах ходьбы от фонтана Же-До. Расстояние до штаб-квартиры Организации Объединенных Наций составляет 2,5 км, а до стадиона «Стад де Женев» — 2,7 км. Гостям предоставляется бесплатный Wi-Fi.', '60 Boulevard de Saint-Georges', 'Женева', '1205 Женева', 'Швейцария', '0.0', 'full/d094f11a40c772b8381338ef8f4745347b825eac.jpg', 'https://www.booking.com/hotel/ch/appartement-de-charme-au-coeur-de-geneve.ru.html', '2019-07-29 12:15:21', '2019-07-29 12:15:21'),
(506, 'Geneva Homely', 'Апартаменты Geneva Homely с балконом расположены в Женеве, всего в 1,7 км от собора Сен-Пьер и в 2 км от фонтана Же-До. Из окон открывается вид на город и горы. Предоставляется бесплатный Wi-Fi.', 'Route de Florissant', 'Женева', '1206 Женева', 'Швейцария', '7.4', 'full/ee2f489b26a3a438065c1e39fe26c2e6861ae474.jpg', 'https://www.booking.com/hotel/ch/studio-geneva-homely.ru.html', '2019-07-29 12:15:21', '2019-07-29 12:15:21'),
