(510, 'Studio Eaux-Vives', 'Апартаменты-студио Eaux-Vives in Geneva расположены в Женеве, в 200 м от фонтана Же-До, в 1,1 км от собора Сен-Пьер и в 3,7 км от штаб-квартиры ООН в Женеве. Расстояние до стадиона Стад-де-Женев составляет 5 км, а до выставочного центра Palexpo — 7 км.', 'Rue des Eaux-Vives', 'Женева', '1207 Женева', 'Швейцария', '5.7', 'full/39da956473ee548040074537b3108880be551de2.jpg', 'https://www.booking.com/hotel/ch/studio-eaux-vives.ru.html', '2019-07-29 12:15:22', '2019-07-29 12:15:22'),
(511, '51 Boulevard de la Cluse', 'Апартаменты 51 Boulevard de la Cluse in Geneva расположены в 1,5 км от собора Сен-Пьер, в 2 км от фонтана Же-До и в 3,3 км от стадиона Стад-де-Женев. К услугам гостей бесплатный Wi-Fi. Апартаменты находятся в 1,4 км от ратуши Женевы и в 1,5 км от Зала Виктории.', '51 Boulevard de la Cluse', 'Женева', '1205 Женева', 'Швейцария', '5.8', 'full/904557435d71267c5046a901bfb71e9d62bebdd0.jpg', 'https://www.booking.com/hotel/ch/51-boulevard-de-la-cluse.ru.html', '2019-07-29 12:15:22', '2019-07-29 12:15:22'),
(512, 'Antonio’s Place I', 'На территории апартаментов Antonio’s Place разбит сад. К услугам гостей бесплатный Wi-Fi. Из окон открывается вид на сад. Апартаменты расположены в здании, построенном в 1968 году, в 2,5 км от штаб-квартиры ООН в Женеве и в 3,1 км от выставочного центра Palexpo.', 'Route de Ferney', 'Женева', '1218 Женева', 'Швейцария', '0.0', 'full/3a0a41d99b6c2369cce7f65c4458e87b012e7b0c.jpg', 'https://www.booking.com/hotel/ch/antonios-place-i.ru.html', '2019-07-29 12:15:23', '2019-07-29 12:15:23'),
(513, 'Auberge de Confignon', 'Отель Auberge де Confignon расположен в самом центре городка Конфиньон на окраине Женевы, в 10 минутах езды на автомобиле от аэропорта Женевы и 20 минут на общественном транспорте от центра города Женева. К услугам гостей ресторан изысканной кухни, бистро и бесплатный доступ WiFi.', 'Place de l\'Eglise 6', 'Женева', '1232 Женева', 'Швейцария', '8.1', 'full/c502208a099bf047c6e2d0065ef48541d205b5b3.jpg', 'https://www.booking.com/hotel/ch/auberge-de-confignon.ru.html', '2019-07-29 12:15:23', '2019-07-29 12:15:23'),
(514, 'Hôtel Leprince', 'Отель Leprince расположен в центре Женевы, в 700 метрах от собора Святого Петра. Расстояние до автобусной и трамвайной остановки Плэмпале составляет 450 метров. Гостям предлагается размещение в функционально меблированных номерах. На всей территории отеля предоставляется бесплатный Wi-Fi.', '16', 'Женева', '1205 Женева', 'Швейцария', '7.8', 'full/1ffa581e2fe850554e54bc973f7d6d2a0e38db2a.jpg', 'https://www.booking.com/hotel/ch/leprince.ru.html', '2019-07-29 12:15:24', '2019-07-29 12:15:24'),
(515, 'Auberge Communale de Carouge', 'Отремонтированный в 2014 году гостевой дом Auberge Communale de Carouge разместился в историческом здании, расположенном в центре городка Каруж, в 4 км от центра Женевы. К услугам гостей ресторан и бесплатный Wi-Fi.', 'Rue Ancienne', 'Женева', '1227 Женева', 'Швейцария', '8.2', 'full/3f6eea9e8af8f79632865b36de41fce1ee8b5269.jpg', 'https://www.booking.com/hotel/ch/auberge-communale-de-carouge.ru.html', '2019-07-29 12:15:24', '2019-07-29 12:15:24'),
(516, 'The SC1 Apartment by Castaway Lodgings', 'Апартаменты The SC1 с балконом, стиральной машиной и бесплатным Wi-Fi расположены в 10 минутах ходьбы от железнодорожного вокзала Корнаван в Женеве.', 'Rue Samuel-Constant 1', 'Женева', '1201 Женева', 'Швейцария', '8.3', 'full/03243f25397c24f10c7757a70c26c89a554bf2fe.jpg', 'https://www.booking.com/hotel/ch/sc1-in-geneva.ru.html', '2019-07-29 12:15:25', '2019-07-29 12:15:25'),
(517, 'Ramada Encore by Wyndham Geneva', 'Отель Ramada Encore Geneve расположен между стадионом «Стад-де-Женев» и торговым центром La Praille. Гости отеля с легкостью доберутся до центра города и аэропорта Женевы.', '10-12 route des jeunes', 'Женева', '1212 Женева', 'Швейцария', '8.3', 'full/c52c9fb54de0633a773eaeddba0040219754ad5a.jpg', 'https://www.booking.com/hotel/ch/ramada-encore-geneve.ru.html', '2019-07-29 12:15:25', '2019-07-29 12:15:25'),
(518, 'City Hostel Geneva', 'К услугам гостей хостела City Geneva, размещенного в 750 метрах от Женевского озера и рядом с железнодорожным вокзалом, бесплатный Wi-Fi, полностью оборудованная общая кухня и просторный лаундж с компьютерами.', 'Rue Ferrier 2', 'Женева', '1202 Женева', 'Швейцария', '8.3', 'full/c127b9121bd08da71efb9883db5169223d2fc37d.jpg', 'https://www.booking.com/hotel/ch/city-hostel-geneva.ru.html', '2019-07-29 12:15:25', '2019-07-29 12:15:25'),
(519, 'Chez Maman Hotel & Restaurant', 'Современный бутик-отель Chez Maman расположен в Женеве, в 3 км от железнодорожного вокзала Корнавин и Женевского озера. Он открылся в 2014 году. К услугам гостей бесплатный Wi-Fi, бесплатная частная парковка и ресторан с живой музыкой по вечерам.', 'Rampe Quidort 2', 'Женева', '1227 Женева', 'Швейцария', '8.8', 'full/a0ac3858e56ec7f8783413be8b1b5152895f4e9b.jpg', 'https://www.booking.com/hotel/ch/chez-maman.ru.html', '2019-07-29 12:15:26', '2019-07-29 12:15:26'),
(520, 'Hotel Admiral', 'Этот современный 3-звездочный отель удобно расположен в центре Женевы, рядом со Старым городом и всего в 300 м от главного железнодорожного вокзала. Дойти пешком до озера можно всего за несколько минут.', '8', 'Женева', '1201 Женева', 'Швейцария', '7.0', 'full/914241be93801fed350166edb3fe683abe6ca947.jpg', 'https://www.booking.com/hotel/ch/hoteladmiralgeneva.ru.html', '2019-07-29 12:15:26', '2019-07-29 12:15:26'),
(521, 'Hotel Mon Repos', 'Этот отель расположен в живописном месте на берегу Женевского озера, всего в 400 метрах от штаб-квартиры Всемирной торговой организации. К услугам гостей бесплатный проезд на общественном транспорте в Женеве, а также современные номера с бесплатным WiFi. Отель находится в 120 метрах от автобусной остановки Mines, а поездка на автобусе до центрального железнодорожного вокзала Корнавен займет 8 минут.', '131', 'Женева', '1202 Женева', 'Швейцария', '8.5', 'full/1bd18886efbde58e47e0ddf8ef6c63455a845b80.jpg', 'https://www.booking.com/hotel/ch/swissqhotelmonrepos.ru.html', '2019-07-29 12:15:27', '2019-07-29 12:15:27'),
(522, 'Grand Hotel Kempinski Geneva', 'Пятизвездочный гранд-отель класса люкс Kempinski расположен в Женеве. К услугам гостей 3 ресторана изысканной кухни, спа-комплекс и крытый бассейн. Отель находится в престижном районе на берегу Женевского озера с прекрасным видом на фонтан Же-До, Монблан и французские Альпы. Во всех номерах предоставляется iPad.', 'Quai du Mont-Blanc 19', 'Женева', '1211 Женева', 'Швейцария', '8.7', 'full/bd9a5e9447aa992c99164fc9d4dd82a0f231e061.jpg', 'https://www.booking.com/hotel/ch/grand-kempinski-geneva.ru.html', '2019-07-29 12:15:28', '2019-07-29 12:15:28'),
(523, 'Geneva Downtown', 'Апартаменты Geneva Downtown расположены в женевском районе О-Вив, в 1,5 км от собора Сен-Пьер, в 3,8 км от штаб-квартиры ООН в Женеве и в 4,4 км от стадиона Стад-де-Женев. Расстояние до фонтана Же-До составляет менее 1 км. К услугам гостей бесплатный Wi-Fi и круглосуточная стойка регистрации.', '1 Rue de la Maison Rouge', 'Женева', '1207 Женева', 'Швейцария', '7.4', 'full/df6132d32aed3d4f08053d7babebfc8ef7b9bd6b.jpg', 'https://www.booking.com/hotel/ch/studio-geneva-downtown.ru.html', '2019-07-29 12:15:31', '2019-07-29 12:15:31'),
(524, 'Geneva Cozy', 'Апартаменты Geneva Cozy с балконом расположены в 1,8 км от стадиона «Стад де Женев».', '78 Avenue Eugène Lance', 'Женева', '1212 Женева', 'Швейцария', '9.7', 'full/afad6078992ed7b8f30385f6c715122e9edc14cb.jpg', 'https://www.booking.com/hotel/ch/geneva-cozy.ru.html', '2019-07-29 12:15:32', '2019-07-29 12:15:32'),
(525, 'Hotel Adriatica', 'Отель Adriatica расположен в Женеве, между районами Маланью и Шампель, в 5 минутах ходьбы от Большого театра. К услугам гостей круглосуточная стойка регистрации, бар, бесплатный бизнес-центр и бесплатный прокат велосипедов. На всей территории отеля предоставляется бесплатный Wi-Fi.', 'Rue Sautter', 'Женева', '1205 Женева', 'Швейцария', '8.9', 'full/ea5c24e1294c4e2435d0083df5515feb7a3518a6.jpg', 'https://www.booking.com/hotel/ch/adriatica.ru.html', '2019-07-29 12:15:33', '2019-07-29 12:15:33'),
(526, 'Aparthotel Adagio Genève Mont-Blanc', 'Апарт-отель Adagio Genève Mont-Blanc находится в центре Женевы. К вашим услугам элегантные апартаменты с кухней и стильной ванной комнатой. Здание отеля окружено бутиками, ресторанами и садами. Рядом находится берег Женевского озера.', 'Rue Thalberg 4', 'Женева', '1201 Женева', 'Швейцария', '8.1', 'full/2eebd776b0c0a70c8c0e1323db67595d290552fb.jpg', 'https://www.booking.com/hotel/ch/ra-c-sidence-mont-blanc.ru.html', '2019-07-29 12:15:33', '2019-07-29 12:15:33'),
(527, 'Le Cénacle', 'Вилла Le Cénacle находится среди большого парка в спокойном квартале Маланью в Женеве. До отеля легко добраться на машине или общественном транспорте. К вашим услугам бесплатная парковка и бесплатный Wi-Fi.', 'Promenade Charles Martin 17', 'Женева', '1208 Женева', 'Швейцария', '7.4', 'full/048e97efaacd4fcaf92d3cd46405f388c915afd5.jpg', 'https://www.booking.com/hotel/ch/le-cenacle.ru.html', '2019-07-29 12:15:34', '2019-07-29 12:15:34'),
(528, 'Hotel Central', 'Семейный отель Central расположен в центре Женевы, в нескольких минутах ходьбы от Цветочных часов и фонтана на Женевском озере.', 'Rue de la Rôtisserie', 'Женева', '1204 Женева', 'Швейцария', '8.1', 'full/e2ea078f3c9142a37a821a9aabcb2966d38caeb3.jpg', 'https://www.booking.com/hotel/ch/central-geneve.ru.html', '2019-07-29 12:15:34', '2019-07-29 12:15:34'),
(529, 'Charming Geneva', 'Апартаменты Charming Geneva с патио и бесплатным Wi-Fi расположены в Женеве, в 3,7 км от фонтана Же-До, в 5 км от собора Сен-Пьер и в 7 км от штаб-квартиры ООН в Женеве. Из окон открывается вид на город. Расстояние до стадиона «Стад де Женев» составляет 7 км, а до выставочного центра PalExpo — 9 км.', '19 Rue du Gothard', 'Женева', '1225 Женева', 'Швейцария', '9.1', 'full/f7a4bcdb03e14ae29f39af6922e834c7929d2d1b.jpg', 'https://www.booking.com/hotel/ch/charming-geneva.ru.html', '2019-07-29 12:15:36', '2019-07-29 12:15:36'),
(530, 'Auteuil Manotel', 'Отель Auteuil Manotel расположен в самом центре Женевы, всего в 3 минутах ходьбы от железнодорожного вокзала Женевы и в 5 минутах от берега Женевского озера. На территории работает фитнес-центр и предоставляется бесплатный Wi-Fi.', '33', 'Женева', '1201 Женева', 'Швейцария', '8.4', 'full/b729f4b72e97ca65f64483b3e3156ce0993cf563.jpg', 'https://www.booking.com/hotel/ch/auteuil.ru.html', '2019-07-29 12:15:35', '2019-07-29 12:15:35'),
(531, 'Novotel Suites Genève Aéroport', 'Комфортабельный 4-звездочный отель Novotel Suites Genève расположен напротив торгового центра Balexert и всего в 5 минутах от аэропорта Женевы. К услугам гостей уютные модульные люксы площадью 30 кв. м.', 'Avenue Louis Casaï 30', 'Женева', '1216 Женева', 'Швейцария', '8.5', 'full/33c6abc3028dcf7e2cf2541232000f26afad0fc4.jpg', 'https://www.booking.com/hotel/ch/suithotel-geneve.ru.html', '2019-07-29 12:15:36', '2019-07-29 12:15:36'),
(532, 'InterContinental Geneva', 'Отель InterContinental Geneva с летним открытым бассейном расположен всего в 3 минутах ходьбы от здания ООН и в 8 минутах езды на автобусе от аэропорта Женевы. С верхних этажей отеля InterContitnental открывается удивительный вид на Монблан, Женевское озеро и город. Гости могут посещать круглосуточный оздоровительный и фитнес-центр. За 5 минут на автобусе можно доехать до конгресс-центр CICG и выставочного комплекса Palexpo.', '7 - 9 Chemin du Petit Saconnex', 'Женева', '1209 Женева', 'Швейцария', '8.6', 'full/7aafa139012b89f04e08aecf74ba19076534bcfe.jpg', 'https://www.booking.com/hotel/ch/intercontinental-geneve.ru.html', '2019-07-29 12:15:37', '2019-07-29 12:15:37'),
(533, 'Central Appartement', 'Апартаменты Central с видом на город расположены в Женеве, в 2,2 км от фонтана Же-До и в 2,3 км от собора Сен-Пьер. К услугам гостей бесплатный Wi-Fi и круглосуточная стойка регистрации. Расстояние до штаб-квартиры ООН в Женеве составляет 1,6 км.', '39 Rue du Prieuré', 'Женева', '1202 Женева', 'Швейцария', '0.0', 'full/af00ad026402c3300ce22e86ce4da8de54261d1e.jpg', 'https://www.booking.com/hotel/ch/central-appartement.ru.html', '2019-07-29 12:15:38', '2019-07-29 12:15:38'),
(534, 'Hotel Bristol', 'Четырехзвездочный отель Bristol с видом на тихую площадь Монблан, бесплатным Wi-Fi, бесплатным спа-центром и превосходным рестораном изысканной средиземноморской кухни расположен в центре Женевы всего в нескольких шагах от Женевского озера и Центрального железнодорожного вокзала.', '10', 'Женева', '1201 Женева', 'Швейцария', '8.8', 'full/f39b8ead905a2d761dfc8b99bc2cdd6acda4bf60.jpg', 'https://www.booking.com/hotel/ch/bristolgeneva.ru.html', '2019-07-29 12:15:37', '2019-07-29 12:15:37'),
(535, 'Hotel Les Arcades', 'Отель для некурящих Hôtel Les Arcades расположен в центре Женевы напротив железнодорожного вокзала Корнавен в 10 минутах ходьбы от Женевского озера и Старого города. Высокоскоростной Wi-Fi предоставляется бесплатно на всей территории отеля.', 'Place Cornavin 14-16', 'Женева', '1201 Женева', 'Швейцария', '8.6', 'full/42f8efa1c13a0284c90bd512736b4fd33446f514.jpg', 'https://www.booking.com/hotel/ch/les-arcades.ru.html', '2019-07-29 12:15:39', '2019-07-29 12:15:39');
INSERT INTO `hotels` (`id`, `name`, `description`, `address`, `city`, `postcode`, `country`, `rating`, `image`, `url_hotel`, `created_at`, `updated_at`) VALUES
(536, 'Crowne Plaza Geneva', 'Отель Crowne Plaza Geneva был отремонтирован и реконструирован в 2014 году. Он находится в 3 минутах езды от аэропорта Женева и выставочного центра Palexpo и 10 минутах езды от центра города. К услугам гостей бесплатный Wi-Fi и бесплатный трансфер от/до аэропорта.', 'Avenue Louis Casai 75-77', 'Женева', '1216 Женева', 'Швейцария', '8.6', 'full/e285bf39db6119fe6c718a5e9e6f8336baac0fd2.jpg', 'https://www.booking.com/hotel/ch/crown-plaza-geneve.ru.html', '2019-07-29 12:15:38', '2019-07-29 12:15:38'),
(537, 'Holiday Inn Express Geneva Airport', 'Отель Holiday Inn Express Geneva Airport находится в 800 метрах от аэропорта Женева. Сотрудники организуют бесплатный трансфер до главного терминала. На всей территории предоставляется бесплатный Wi-Fi.', 'Route de Pré Bois 16', 'Женева', '1215 Женева', 'Швейцария', '8.2', 'full/8243b4d0935b7fd2ad240c1d55bf08441854a6ea.jpg', 'https://www.booking.com/hotel/ch/geneva-airport.ru.html', '2019-07-29 12:15:39', '2019-07-29 12:15:39'),
(538, 'Hôtel de la Cigogne', 'Элегантный отель Hôtel de la Cigogne занимает историческое здание в центре Женевы, на красивой площади Лонжмаль рядом с Старым городом, Английским садом и Женевским озером. Все номера обставлены старинной мебелью.', '17 Place Longemalle', 'Женева', '1204 Женева', 'Швейцария', '9.0', 'full/3438ff842287f5158838b6ddb030d7b2feef4da4.jpg', 'https://www.booking.com/hotel/ch/de-la-cigogne.ru.html', '2019-07-29 12:15:39', '2019-07-29 12:15:39'),
(539, 'Hotel International & Terminus', 'Этот 3-звездочный отель расположен всего в 80 метрах от железнодорожного вокзала Женевы Корнавин, в 10-минутах ходьбы от центра города и Женевского озера. Во всех номерах работает бесплатный Wi-Fi.', '20', 'Женева', '1201 Женева', 'Швейцария', '8.1', 'full/2a0f5e454a355961926409c9771cdd7a45a33c89.jpg', 'https://www.booking.com/hotel/ch/international-terminus.ru.html', '2019-07-29 12:15:40', '2019-07-29 12:15:40'),
(540, 'Hotel Montana', 'Located in the centre of Geneva, the Montana is only a few steps away from the Cornavin Train Station. It has modern rooms with soundproof windows, and offers a daily breakfast buffet.', '23', 'Женева', '1201 Женева', 'Швейцария', '8.0', 'full/5ea44ba77fa481f29d2812e4edda7a8f854587b9.jpg', 'https://www.booking.com/hotel/ch/montana.ru.html', '2019-07-29 12:15:40', '2019-07-29 12:15:40'),
(541, 'Fontaine', 'Апартаменты Fontaine с бесплатным Wi-Fi и видом на город расположены в Женеве, всего в 1,1 км от фонтана Же-До и в 1,3 км от собора Сен-Пьер. Расстояние до штаб-квартиры ООН в Женеве составляет 3,7 км, а до стадиона «Стад де Женев» — 4,4 км.', '43 Rue de la Fontaine', 'Женева', '1204 Женева', 'Швейцария', '9.3', 'full/7e073813e32105f55b8682c8ee086e144668faa9.jpg', 'https://www.booking.com/hotel/ch/fontaine.ru.html', '2019-07-29 12:15:46', '2019-07-29 12:15:46'),
(542, 'Hôtel Résidence Cité-Verdaine', 'Комплекс Hôtel Résidence Cité-Verdaine расположен в деловом квартале Женевы, в 200 метрах от Старого города и в 400 метрах от озера. К услугам гостей номера-студио с телевизором, бесплатным Wi-Fi, ванной комнатой и мини-кухней.', 'Rue du Vieux-Collège 5', 'Женева', '1204 Женева', 'Швейцария', '8.1', 'full/7bdde19797a55f61f22dab5b4f51895225ec11f6.jpg', 'https://www.booking.com/hotel/ch/ha-tel-ra-c-sidence-cita-c-verdaine.ru.html', '2019-07-29 12:15:46', '2019-07-29 12:15:46'),
(543, 'Starling Hotel Geneva', 'К услугам гостей 4-звездочного отеля Starling Geneva фитнес-центр и оздоровительный центр с крытым бассейном, а также конференц-зал площадью 5 500 кв. м. Конференц-центр Palexpo находится в 3 минутах ходьбы от отеля. К услугам гостей бесплатный трансфер от/до аэропорта и бесплатный Wi-Fi.', '34', 'Женева', '1218 Женева', 'Швейцария', '8.5', 'full/4bced1f3783638900df558fd2ecb994b4c3b8937.jpg', 'https://www.booking.com/hotel/ch/starling-hotel-geneva.ru.html', '2019-07-29 12:15:46', '2019-07-29 12:15:46'),
(544, 'Jade Manotel', 'Отель Jade Manotel находится всего в 5 минутах ходьбы от Женевского озера и в 10 минутах ходьбы от железнодорожного вокзала Корнавин. К услугам гостей бесплатный Wi-Fi и просторные номера с кондиционером. Все номера и места общего пользования разработаны в соответствии с принципами фэн-шуй.', 'Rue Rothschild 55', 'Женева', '1202 Женева', 'Швейцария', '8.6', 'full/de0e380757ca57012e16e7b8c6e9ded3d35c5184.jpg', 'https://www.booking.com/hotel/ch/ascotmanotel.ru.html', '2019-07-29 12:15:47', '2019-07-29 12:15:47'),
(545, 'Hotel des Alpes', 'Полностью отремонтированный отель des Alpes находится в самом центре Женевы, на полпути между железнодорожным вокзалом Корнавен и Женевским озером, прогулка до которого занимает 5 минут. К услугам гостей номера с кондиционером.', '14 rue des Alpes', 'Женева', '1201 Женева', 'Швейцария', '8.5', 'full/90fe47f61b2d8d2f8037912ff61b37528c430c66.jpg', 'https://www.booking.com/hotel/ch/des-alpes-geneve.ru.html', '2019-07-29 12:15:47', '2019-07-29 12:15:47'),
(546, 'Edelweiss Manotel', 'Отель Edelweiss Manotel отличается очарованием настоящего швейцарского шале. Он расположен в нескольких шагах от центра Женевы, между Женевским озером, которое находится в 200 метрах, и офисом ООН, расстояние до которого составляет 1 км.', 'Place de la Navigation 2', 'Женева', '1201 Женева', 'Швейцария', '8.5', 'full/ba2750fe25c1e995255dbec6a9ea5e0194bcf494.jpg', 'https://www.booking.com/hotel/ch/edelweiss.ru.html', '2019-07-29 12:15:48', '2019-07-29 12:15:48'),
(547, 'Hotel Montbrillant', 'Отель Montbrillant расположен возле главного железнодорожного вокзала Корнавин в центре Женевы. К услугам гостей ресторан и пивной бар. Прогулка до Старого города занимает всего 10 минут. Поблизости налажено отличное транспортное сообщение, благодаря которому можно быстро доехать на общественном транспорте до аэропорта и центрального делового района. На всей территории отеля работает бесплатный Wi-Fi.', '2', 'Женева', '1201 Женева', 'Швейцария', '8.2', 'full/e2d7a41acdea7f696e4e6b86509a4ae525527241.jpg', 'https://www.booking.com/hotel/ch/hotelmontbrillant.ru.html', '2019-07-29 12:15:48', '2019-07-29 12:15:48'),
(548, 'Warwick Geneva', 'Отель Warwick Geneva находится напротив главного железнодорожного вокзала, в 300 метрах от Женевского озера и в 6 минутах от международного аэропорта Женевы.', 'Rue de Lausanne 14', 'Женева', '1201 Женева', 'Швейцария', '8.3', 'full/8c5cf9e5ded92db163e3e2fafb2c56ce521cbc4a.jpg', 'https://www.booking.com/hotel/ch/warwickgeneva.ru.html', '2019-07-29 12:15:48', '2019-07-29 12:15:48'),
(549, 'Geneva Hostel', 'Хостел Geneva расположен в историческом здании XIX века в центре города Женевы. К услугам гостей бесплатный Wi-Fi и ресторан, где по вечерам подаются блюда швейцарской кухни. Женевское озеро находится всего в 250 метрах от хостела.', 'Rue Rothschild', 'Женева', '1202 Женева', 'Швейцария', '8.1', 'full/cb3ddd23f3ef3ae2ba59515e3f2dc3b04443d112.jpg', 'https://www.booking.com/hotel/ch/geneva-hostel.ru.html', '2019-07-29 12:15:49', '2019-07-29 12:15:49'),
(550, 'Hapimag Resort Dresden', 'Курортный отель Hapimag занимает историческое здание 1717 года постройки в самом центре Дрездена, всего в 200 м от церкви Фрауэнкирхе и в 5 минутах ходьбы от дворца Цвингер. На всей территории предоставляется бесплатный Wi-Fi.', '6 Landhausstraße', 'Дрезден', '01067 Дрезден', 'Германия', '0.0', 'full/3f30a6687611925eae11aca161a7652992432623.jpg', 'https://www.booking.com/hotel/de/hapimag-resort-dresden.ru.html', '2019-07-29 12:16:31', '2019-07-29 12:16:31'),
(551, 'Novum Hotel Dresden Airport', 'Отель расположен в эксклюзивном жилом районе, в 9 км к северу от Старого города Дрездена и в 3 км от аэропорта Дрезден. К услугам гостей номера для некурящих и подземная парковка.', 'Königsbrücker Landstr. 71', 'Дрезден', '01109 Дрезден', 'Германия', '7.7', 'full/e15ac1de56b1b2693f40636f7441193a1f7ce6aa.jpg', 'https://www.booking.com/hotel/de/point.ru.html', '2019-07-29 12:16:32', '2019-07-29 12:16:32'),
(552, 'Courtyard by Marriott Dresden', 'Отель Courtyard Dresden расположен в дрезденском районе Нойштадт, всего в 3,5 км от центра города, построенного в стиле барокко. К услугам гостей номера с кондиционером, современный ресторан и крытый бассейн.', 'Stauffenbergallee 25a', 'Дрезден', '01099 Дрезден', 'Германия', '8.2', 'full/f028024ce04290c523ef0925a6cb0305e5a6bb0a.jpg', 'https://www.booking.com/hotel/de/holiday-inn-dresden.ru.html', '2019-07-29 12:16:31', '2019-07-29 12:16:31'),
(553, 'Hotel Amadeus', 'Отель Amadeus находится в северной части Дрездена, в 1 минуте ходьбы от трамвайной остановки и в 5 минутах езды от автострады А4. К услугам гостей бесплатная парковка и ресторан в деревенском стиле, расположенный в подвале.', 'Grossenhainer Str. 118', 'Дрезден', '01129 Дрезден', 'Германия', '6.9', 'full/2deda04cc002a890828752824f7d29affff549e8.jpg', 'https://www.booking.com/hotel/de/hotel_amadeus_dresden.ru.html', '2019-07-29 12:16:33', '2019-07-29 12:16:33'),
(554, 'Bergwirtschaft Wilder Mann Hotel und Restaurant', 'Этот 4-звездочный отель расположен в тихом районе Трахау Дрездена. К услугам гостей ежедневный завтрак \"шведский стол\" и 2 террасы с панорамным видом на город. Стойка регистрации работает круглосуточно. Гостям предоставляется бесплатная парковка.', 'Großenhainer Str. 243', 'Дрезден', '01129 Дрезден', 'Германия', '8.4', 'full/ba9780bab681e401c817593d6addba903a7c4fc7.jpg', 'https://www.booking.com/hotel/de/bergwirtschaft-wilder-mann-und-restaurant-gmbh.ru.html', '2019-07-29 12:16:32', '2019-07-29 12:16:32'),
(555, 'Hotel Burgk', 'Этот семейный отель расположен в тихом месте в районе Лебтау, в 10 минутах езды от центра Дрездена. К услугам гостей отеля Burgk современные номера с бесплатным Wi-Fi, а также бесплатная парковка на территории отеля.', 'Burgkstr. 15', 'Дрезден', '01159 Дрезден', 'Германия', '8.7', 'full/65f72b6d0a5798659a4f36bf55131ea2c8834d08.jpg', 'https://www.booking.com/hotel/de/burgk.ru.html', '2019-07-29 12:16:34', '2019-07-29 12:16:34'),
(556, 'AZIMUT Hotel Dresden', 'Этот 4-звездочный отель расположен в районе Рейк, на юго-востоке Дрездена. К услугам гостей итальянский ресторан, бар, летняя терраса и бесплатный Wi-Fi.', 'Hülssestr. 1', 'Дрезден', '01237 Дрезден', 'Германия', '8.4', 'full/990bf9365a7b558342ff2d80c85139b33e5dcace.jpg', 'https://www.booking.com/hotel/de/azimut-dresden.ru.html', '2019-07-29 12:16:33', '2019-07-29 12:16:33'),
(557, 'Best Western Macrander Hotel Dresden', 'К услугам гостей этого 4-звездочного отеля, расположенного в Дрездене, бесплатный WiFi, номера с кондиционером и близлежащий спа-салон, который можно посещать бесплатно. Отель размещен в районе Нойштадт, откуда за 10 минут вы сможете доехать на трамвае до центра города.', 'Buchenstr. 10', 'Дрезден', '01097 Дрезден', 'Германия', '8.1', 'full/eebb0e2318006131403cf4460a8151b492f8c4dc.jpg', 'https://www.booking.com/hotel/de/comfort-dresden.ru.html', '2019-07-29 12:16:35', '2019-07-29 12:16:35'),
(558, 'Cityhotel Stadt Dresden', 'Этот отель расположен в самом центре оживленного района Нойштадт в Дрездене. К услугам гостей отеля Cityhotel Stadt Dresden крытый бассейн, спа-салон, бесплатный Wi-Fi и детская игровая площадка.', 'Rothenburger Str. 15', 'Дрезден', '01099 Дрезден', 'Германия', '8.3', 'full/d0cef7214f7d1fae369dc1e9fcd08561930c3e9e.jpg', 'https://www.booking.com/hotel/de/cityhotel-stadt-dresden.ru.html', '2019-07-29 12:16:32', '2019-07-29 12:16:32'),
(559, 'ACHAT Premium Dresden', 'Этот отель находится в тихом квартале дрезденского района Лаубегаст всего в 10 минутах ходьбы от реки Эльбы. В отеле работает ресторан региональной кухни No. 18 с великолепным обслуживанием и уютной атмосферой.', 'Brünner Str. 11', 'Дрезден', '01279 Дрезден', 'Германия', '7.8', 'full/6f82beb19fce4418d5c2f7d0542ccc1bc62e38f8.jpg', 'https://www.booking.com/hotel/de/ramadaresidentdresden.ru.html', '2019-07-29 12:16:35', '2019-07-29 12:16:35'),
(560, 'Novum Hotel am Bonhöfferplatz', 'This hotel is a beautifully restored manor house, dating back to around 1900. Novum Hotel am Bonhöfferplatz enjoys a peaceful, central location in Dresden’s historic Löbtau district.', 'Bonhoefferplatz 13', 'Дрезден', '01159 Дрезден', 'Германия', '7.4', 'full/bcede7f3fcc96da8bb5f57e70647c7d3145a6a1e.jpg', 'https://www.booking.com/hotel/de/novum-hotel-am-bonhofferplatz.ru.html', '2019-07-29 12:16:35', '2019-07-29 12:16:35'),
(561, 'DORMERO Hotel Dresden Airport', 'Отель DORMERO Dresden Airport расположен рядом с природным парком Дрезденская Пустошь, в 5 минутах езды от аэропорта Дрездена и автомагистрали А4. Предоставляется бесплатный Wi-Fi.', 'Karl-Marx-Str. 25', 'Дрезден', '01109 Дрезден', 'Германия', '8.2', 'full/d5d06cb6c5bbbba6f87d68afb9da028b0ad19672.jpg', 'https://www.booking.com/hotel/de/airporthoteldresden.ru.html', '2019-07-29 12:16:36', '2019-07-29 12:16:36'),
(562, 'Hostel Mondpalast', 'Этот ярко оформленный хостел расположен в оживленном квартале искусств Дрездена Нойштадт, всего в 6 минутах езды на трамвае от Старого города Дрездена. К услугам гостей индивидуально оформленные номера.', 'Louisenstr. 77', 'Дрезден', '01099 Дрезден', 'Германия', '8.3', 'full/5c2a69b55a6c532c2c335de2d087dd1aa986f934.jpg', 'https://www.booking.com/hotel/de/hostel-mondpalast.ru.html', '2019-07-29 12:16:37', '2019-07-29 12:16:37'),
(563, 'ACHAT Comfort Dresden', 'В этом современном отеле, расположенном в Дрездене, к услугам гостей просторные номера и апартаменты с бесплатным Wi-Fi, круглосуточная стойка регистрации и бесплатная подземная парковка. Отель находится в 15 минутах ходьбы от центрального вокзала Дрездена.', 'Budapester Str. 34', 'Дрезден', '01069 Дрезден', 'Германия', '8.0', 'full/cbc940d2699da07a0918a14372c86fa6d0352063.jpg', 'https://www.booking.com/hotel/de/achdresdenat.ru.html', '2019-07-29 12:16:37', '2019-07-29 12:16:37'),
(564, 'NH Collection Dresden Altmarkt', 'Четырехзвездочный отель NH Collection Dresden Altmarkt расположен на площади Альтмаркт в центре Старого города Дрездена. К услугам гостей тренажерный зал с террасой на крыше. В каждом из современных номеров установлен телевизор с плоским экраном и подключен бесплатный высокоскоростной Wi-Fi.', 'An der Kreuzkirche 2', 'Дрезден', '01067 Дрезден', 'Германия', '9.1', 'full/9f5c8dc7b2975db313845fec162e3bb6b6f2e608.jpg', 'https://www.booking.com/hotel/de/nh-dresden-altmarkt.ru.html', '2019-07-29 12:16:38', '2019-07-29 12:16:38'),
(565, 'Hostel Lollis Homestay Dresden', 'Этот хостел, оформленный в ярких тонах, находится в Дрезденском районе Нойштадт, в окружении красочных кафе и пабов. К услугам гостей индивидуально оформленные номера и бесплатный Wi-Fi.', 'Görlitzer Str. 34', 'Дрезден', '01099 Дрезден', 'Германия', '8.4', 'full/7b17323b82902bc11f58f1df2afc2ab2d224cafc.jpg', 'https://www.booking.com/hotel/de/hostel-lollis-homestay-dresden.ru.html', '2019-07-29 12:16:33', '2019-07-29 12:16:33'),
(566, 'Hotel My Bed Dresden', 'Этот пансион предлагает гостям современные номера для некурящих, бесплатный Wi-Fi и ежедневный завтрак \"шведский стол\". Пансион расположен в 5-ти минутах ходьбы от реки Эльба и в 10 минутах езды на трамвае от центра Дрездена.', 'Rehefelderstr. 19', 'Дрезден', '01127 Дрезден', 'Германия', '7.3', 'full/a63e5c832ab8b77263bba03b2cfabc542b85b0f5.jpg', 'https://www.booking.com/hotel/de/my-bed-dresden.ru.html', '2019-07-29 12:16:44', '2019-07-29 12:16:44'),
(567, 'Aparthotel Am Schloss', 'Эти стильные апартаменты находятся в 5 минутах ходьбы от исторической церкви Фрауэнкирхе. К услугам гостей бесплатный Wi-Fi. Гости могут посещать террасу на крыше, откуда открывается вид на внутренний двор и церковь Кройцкирхе.', 'Schössergasse 16', 'Дрезден', '01067 Дрезден', 'Германия', '9.3', 'full/9925fdcff5d401546b185c8aac954b3118db6b43.jpg', 'https://www.booking.com/hotel/de/aparthotel-am-schloss.ru.html', '2019-07-29 12:16:45', '2019-07-29 12:16:45'),
(568, 'Hyperion Hotel Dresden Am Schloss', 'Этот отель расположен в самом центре исторической части Дрездена, в 200 метрах от оперы Земпера и в 500 метрах от церкви Фрауенкирхе. К услугам гостей тренажерный зал, спа-центр и стильно оформленные номера с бесплатным Wi-Fi.', 'Schlossstrasse 16', 'Дрезден', '01067 Дрезден', 'Германия', '9.3', 'full/79c3439748f365ec820793a5524678bf0584068c.jpg', 'https://www.booking.com/hotel/de/swissa-tel-dresden-am-schloss.ru.html', '2019-07-29 12:16:46', '2019-07-29 12:16:46'),
(569, 'IntercityHotel Dresden', 'Отель расположен прямо напротив центрального железнодорожного вокзала города Дрезден. К услугам гостей звукоизолированные номера с телевизором с плоским экраном, ресторан традиционной саксонской кухни и бесплатный Wi-Fi со скоростью до 1 Мбит/с. Кроме того, гостям предоставляется бесплатный проезд на местном общественном транспорте.', 'Wiener Platz 8', 'Дрезден', '01069 Дрезден', 'Германия', '8.8', 'full/c4f21d3b6d30b47cda2724c3cb0642ed45e9385b.jpg', 'https://www.booking.com/hotel/de/intercityhotel-dresden.ru.html', '2019-07-29 12:16:46', '2019-07-29 12:16:46'),
(570, 'Hotel Suitess', 'Этот 5-звездочный отель повышенной комфортности с оригинальным барочным фасадом находится рядом со знаменитым дрезденским собором Фрауэнкирхе. К услугам гостей стильный спа-салон и бесплатный WiFi во всех помещениях.', 'An der Frauenkirche 13', 'Дрезден', '01067 Дрезден', 'Германия', '9.3', 'full/77b9a24247509f0d9531f9c0e21e69db670c29fb.jpg', 'https://www.booking.com/hotel/de/suitess.ru.html', '2019-07-29 12:16:47', '2019-07-29 12:16:47'),
(571, 'Hotel Villa am Waldschlösschen', 'Гостевой дом, предназначенный для некурящих, расположен недалеко от Дрезденской пустоши и прекрасно подходит для спокойного отдыха. Гостей порадует очаровательный архитектурный стиль и ухоженный сад. Предоставляется также бесплатный Wi-Fi.', 'Klarastr. 3', 'Дрезден', '01099 Дрезден', 'Германия', '8.7', 'full/d272195a1de515049bcf26a1e99468c188bb0db4.jpg', 'https://www.booking.com/hotel/de/villa-am-waldschloesschen.ru.html', '2019-07-29 12:16:48', '2019-07-29 12:16:48'),
(572, 'Aparthotels Münzgasse An der Frauenkirche', 'Эти современные люксы и апартаменты находятся в историческом центре Дрездена, рядом с церковью Фрауэнкирхе или Старой рыночной площадью. К услугам гостей бесплатный Wi-Fi и кухня со стиральной машиной.', 'Münzgasse 10', 'Дрезден', '01067 Дрезден', 'Германия', '8.7', 'full/31ee9b34ef003c803ef76f20d44ebdade46b99b0.jpg', 'https://www.booking.com/hotel/de/apartmentsanderfrauenkirche.ru.html', '2019-07-29 12:16:49', '2019-07-29 12:16:49'),
(573, 'Aparthotel Mitte', 'Этот апарт-отель расположен в центре города Дрезден, в 10 минутах ходьбы от конгресс-центра, дворцового комплекса Цвингер, Оперы Земпера и церкви Фрауэнкирхе. Во всех номерах и апартаментах есть собственная кухня и работает бесплатный WiFi.', 'Schweriner Strasse 52', 'Дрезден', '01067 Дрезден', 'Германия', '8.7', 'full/9a5c52554d7f14988760c9208b6f1e8948e14fbf.jpg', 'https://www.booking.com/hotel/de/appartements-musikhochschule.ru.html', '2019-07-29 12:16:49', '2019-07-29 12:16:49'),
(574, 'Sax Imperial', 'This hotel is an Art Nouveau villa in the elegant Weißer Hirsch district of Dresden. It offers rooms with historic charm and free high-speed Wi-Fi.', 'Stechgrundstr. 2', 'Дрезден', '01324 Дрезден', 'Германия', '8.1', 'full/05445d0d546294db5885ef20629fca6bdddf931f.jpg', 'https://www.booking.com/hotel/de/villa-emma-dresden.ru.html', '2019-07-29 12:16:49', '2019-07-29 12:16:49'),
(575, 'Elbe\'s Hotel Dresden', 'Хостел расположен в центре Дрездена, в 500 метрах от железнодорожного вокзала Дрезден-Нойштадт. К услугам гостей бар, бесплатная парковка на территории, а также отдельные и общие номера, оформленные в светлых тонах.', 'Leipziger Str. 1', 'Дрезден', '01097 Дрезден', 'Германия', '7.6', 'full/564a29ca185f48bf65d499ab8818cfc32876fa84.jpg', 'https://www.booking.com/hotel/de/elbe-s-dresden.ru.html', '2019-07-29 12:16:50', '2019-07-29 12:16:50'),
(576, 'Holiday Inn Express Dresden City Centre', 'Отель для некурящих Holiday Inn Express Dresden City Centre расположен на площади Альтмаркт в центре города Дрезден. К услугам гостей звукоизолированные номера с принадлежностями для чая/кофе, подземная парковка и завтрак «шведский стол». Стойка регистрации работает круглосуточно.', 'Dr-Kuelz Ring 15a', 'Дрезден', '01067 Дрезден', 'Германия', '8.3', 'full/3398ca705b4829f95f2a17af607fe038346145c5.jpg', 'https://www.booking.com/hotel/de/holiday-inn-express-dresden-city-centre.ru.html', '2019-07-29 12:16:50', '2019-07-29 12:16:50'),
(577, 'Best Western Quintessenz-Forum', 'Отель Best Western расположен в районе Котта города Дрезден, всего в 250 метрах от набережной реки Эльба. К услугам гостей хорошо укомплектованные номера и апартаменты, а также бесплатный Wi-Fi. Расстояние до центра Дрездена составляет 3,5 км.', 'Mobschatzer Str. 17', 'Дрезден', '01157 Дрезден', 'Германия', '8.6', 'full/b8267a066de11405698a81e86b7f2aafcba8492b.jpg', 'https://www.booking.com/hotel/de/quintessenzforum.ru.html', '2019-07-29 12:16:51', '2019-07-29 12:16:51'),
(578, 'Hotel Aviv Dresden', 'Этот отель для некурящих расположен в дрезденском районе Котта. Здесь вас ждут номера, оформленные в восточном стиле, и обильный завтрак \"шведский стол\". Вы сможете легко добраться от отеля до центра города на трамвае. Расстояние до автомагистрали A4 составляет 1.5 км.', 'Flügelweg 4-6', 'Дрезден', '01157 Дрезден', 'Германия', '8.1', 'full/29e690d34cd82bbd48ffb0323d288bd0c743cfa0.jpg', 'https://www.booking.com/hotel/de/aviv-dresden.ru.html', '2019-07-29 12:16:51', '2019-07-29 12:16:51'),
(579, 'Hotel & Pension NOlift', 'Отремонтированный гостевой дом NOlift удобно расположен в центре Дрездена в районе Лёбтау. К услугам гостей просторные номера и возможность круглосуточной регистрации заезда.', 'Kesselsdorfer Str. 37', 'Дрезден', '01159 Дрезден', 'Германия', '7.3', 'full/4651cf36f22ab70e68b0e5615c01e1b7de405a43.jpg', 'https://www.booking.com/hotel/de/hostel-pension-nolift.ru.html', '2019-07-29 12:16:48', '2019-07-29 12:16:48'),
(580, 'Park Inn by Radisson Dresden', 'Этот современный 3-звездочный отель расположен в районе Нойштадт города Дрезден, в 5 минутах ходьбы от берега реки Эльбы. К услугам гостей просторные номера и лобби-бар.', 'Melanchthonstr. 2', 'Дрезден', '01099 Дрезден', 'Германия', '8.3', 'full/9129f293693881f152a16903fa01f7e722177fff.jpg', 'https://www.booking.com/hotel/de/mercure-dresden-albertbrucke.ru.html', '2019-07-29 12:16:52', '2019-07-29 12:16:52'),
(581, 'Innside by Meliá Dresden', 'Centrally located in Dresden’s historic Old Town, this design hotel offers the 6th-floor Sky-Bar with views of the Frauenkirche Church. The Innside by Meliá Dresden offers a free spa and stylish, contemporary-style rooms.', 'Salzgasse 4', 'Дрезден', '01067 Дрезден', 'Германия', '9.1', 'full/068aae6a0b8ca2c47fe8180b2236e33274a71730.jpg', 'https://www.booking.com/hotel/de/innside-dresden.ru.html', '2019-07-29 12:16:48', '2019-07-29 12:16:48'),
(582, 'Pension Olé', 'Этот гостевой дом расположен в шаговой доступности от трамвайной остановки Bischofswe и оснащен бесплатным Wi-Fi. Постояльцы гостевого дома Olé размещаются в номерах, оформленных в стиле минимализма, а также в полностью оборудованных апартаментах в модном районе Нойштадт.', 'Bischofsweg 17', 'Дрезден', '01097 Дрезден', 'Германия', '8.2', 'full/352c373ae215258984aeb68becb41ad2b48e00c0.jpg', 'https://www.booking.com/hotel/de/pension-ola-c.ru.html', '2019-07-29 12:16:56', '2019-07-29 12:16:56'),
(583, 'DD Apartments', 'Апартаменты DD с садом и бесплатным Wi-Fi расположены в Дрездене, в 6 км от Международного конгресс-центра Дрездена и в 7 км от дворцово-паркового комплекса Цвингер.', 'Meißner Str. 29', 'Дрезден', '01445 Дрезден', 'Германия', '8.4', 'full/39920d0a7dccc4c5e13956be06377eb74d3e9993.jpg', 'https://www.booking.com/hotel/de/dd-apartments.ru.html', '2019-07-29 12:16:56', '2019-07-29 12:16:56'),
(584, 'Hotel-Villa Lalee', 'Отель Villa Lalee расположен в Дрездене, в 2,7 км от города Фюрстенцуг. К услугам гостей сад, номера для некурящих, бесплатный WiFi и общий лаундж. Отель находится в 2,7 км от террасы Брюль, в 2,8 км от Королевского дворца Дрездена и в 2,9 км от Старого и Нового крепостных стен. Церковь Фрауэнкирхе находится в 3,2 км от отеля, а опера Земпера — в 3,3 км.', '41 Wiener Straße', 'Дрезден', '01219 Дрезден', 'Германия', '0.0', 'full/de31bf6be257f05e81bee9bb887118d53851c476.jpg', 'https://www.booking.com/hotel/de/villa-lalle.ru.html', '2019-07-29 12:16:57', '2019-07-29 12:16:57'),
(585, 'Sportpension Dresden', 'Расположенный лишь в 15 минутах от центра Дрездена этот семейный спортивный пансионат находится в идиллическом месте рядом с дрезденским велосипедным маршрутом здоровья на Эльбе.', 'Marienallee 14 b', 'Дрезден', '01099 Дрезден', 'Германия', '8.5', 'full/9f3897b3ebfc18cf40759fb5ab62875a05b95730.jpg', 'https://www.booking.com/hotel/de/sportpension-dresden.ru.html', '2019-07-29 12:16:57', '2019-07-29 12:16:57'),
(586, 'Heinrich Schütz Residenz', 'Отель Heinrich-Schütz-Residenz расположен в Старом городе Дрездена, недалеко от церкви Фрауэнкирхе и в 5 минутах ходьбы от дворца Цвингер. К услугам гостей платный спа-центр и бесплатный Wi-Fi. По прибытии гостям предлагается приветственный напиток.', 'Frauenstraße 14', 'Дрезден', '01067 Дрезден', 'Германия', '9.4', 'full/b5188162a684978faf27fb7d54b92045d2262b12.jpg', 'https://www.booking.com/hotel/de/heinrich-schutz-residenz.ru.html', '2019-07-29 12:16:58', '2019-07-29 12:16:58'),
(587, 'Hotel Köhlerhütte', 'Отель Köhlerhütte с бесплатным Wi-Fi расположен в тихом месте на краю леса Дрезднер Хайде в Дрездене.', 'zum Sportplatz 2', 'Дрезден', '01108 Дрезден', 'Германия', '8.5', 'full/aba0bfa53d2f221c9d51d0838dca538a466ac471.jpg', 'https://www.booking.com/hotel/de/kohlerhutte-dresden123.ru.html', '2019-07-29 12:16:58', '2019-07-29 12:16:58'),
(588, 'Hotel Villa Loschwitz', 'Этот отель для некурящих расположен в тихом месте, всего в 10 минутах езды от Старого города Дрездена. К услугам гостей звукоизолированные номера с бесплатным проводным доступом в Интернет, терраса в саду и богатый завтрак \"шведский стол\".', 'Bautzner Straße 179', 'Дрезден', '01099 Дрезден', 'Германия', '8.9', 'full/df592ee87fc1d412589c3fc86eb2b8b70156e978.jpg', 'https://www.booking.com/hotel/de/villa-loschwitz.ru.html', '2019-07-29 12:16:58', '2019-07-29 12:16:58'),
(589, 'Schiffsherberge Pöppelmann', 'Set in a large ship on the Elbe River, Schiffsherberge Pöppelmann offers unique accommodation with a terrace. It is docked between Dresden\'s Old Town and New Town districts.', 'Uferstraße 14', 'Дрезден', '01097 Дрезден', 'Германия', '8.4', 'full/7a6614f5482d2706db4d9fa897d34b8e9183017a.jpg', 'https://www.booking.com/hotel/de/beherbergungsschiff-d-papppelmann.ru.html', '2019-07-29 12:16:59', '2019-07-29 12:16:59'),
(590, 'Hotel Pesterwitzer Siegel', 'Этот семейный отель расположен в прекрасном, удобном месте на юго-западной окраине Дрездена, всего в 6 км от центра города. От него открывается замечательный вид на долину реки Эльбы.', 'Elbtalblick 23', 'Дрезден', '01705 Дрезден', 'Германия', '8.5', 'full/404e84f5f808cfa5a3ac1a9c7feba2a7da26775c.jpg', 'https://www.booking.com/hotel/de/pesterwitzer-siegel.ru.html', '2019-07-29 12:16:59', '2019-07-29 12:16:59'),
(591, 'Relais & Châteaux Bülow Palais', 'Превосходный 5-звездочного отель располагает элегантными номерами с бесплатным WiFi, дневным спа-салоном площадью 400 кв. м и рестораном Caroussel, удостоенного звездой Мишлен, и находится в самом сердце района Барокко города Дрездена, в 15 минутах ходьбы от Старого города.', 'Königsstr. 14', 'Дрезден', '01097 Дрезден', 'Германия', '9.5', 'full/75c265bfa3508e90a4368f2bc9558da4cfcb31a2.jpg', 'https://www.booking.com/hotel/de/bulow-palais.ru.html', '2019-07-29 12:16:59', '2019-07-29 12:16:59'),
(592, 'Ferienwohnung mit Charme in Dresden Pillnitz', 'Апартаменты Ferienwohnung mit Charme in Dresden Pillnitz расположены в Дрездене, менее чем в 1 км от замка и парка Пильниц. К услугам гостей патио, сад и бесплатный Wi-Fi. Из окон открывается вид на сад. Расстояние до города Фюрстенцуг и террасы Брюль составляет 12 км.', 'Dresdner Str.72', 'Дрезден', '01326 Дрезден', 'Германия', '9.4', 'full/aaea7d12e2d3e462bfb7027ed0465eab10470ece.jpg', 'https://www.booking.com/hotel/de/ferienwohnung-dresden-pillnitz-pillnitz.ru.html', '2019-07-29 12:17:00', '2019-07-29 12:17:00'),
(593, 'Holiday Inn Dresden - City South', 'Отель Holiday Inn Dresden - City South расположен в районе Плауэн города Дрезден. К услугам гостей тренажерный зал и ресторан. Поблизости находится технический университет Дрездена (TUDIAS), а также налажено отличное автобусное сообщение с городом.', 'Bamberger Str. 14', 'Дрезден', '01187 Дрезден', 'Германия', '8.7', 'full/93603062c8ef50b9eab3803ed6cd19994a4c621d.jpg', 'https://www.booking.com/hotel/de/holiday-inn-dresden-city-south.ru.html', '2019-07-29 12:17:01', '2019-07-29 12:17:01'),
(594, 'Pullman Dresden Newa', 'Этот первоклассный дизайн-отель расположен на торговой улице Прагер Штрассе, в 3 минутах ходьбы от центрального железнодорожного вокзала города Дрезден. К услугам гостей современный спа-центр и стильные номера. Из отеля открывается панорамный вид на город.', 'Prager Str. 2c', 'Дрезден', '01069 Дрезден', 'Германия', '8.6', 'full/1bbfdeea4a0d1684f386ba99d5126a2038c95367.jpg', 'https://www.booking.com/hotel/de/mercuredresdennewa.ru.html', '2019-07-29 12:17:02', '2019-07-29 12:17:02'),
(595, 'Hilton Dresden', 'Отель Hilton Dresden расположен в самом центре Старого города Дрездена, напротив знаменитой церкви Фрауэнкирхе. К услугам гостей 12 ресторанов и баров, спа-салон и фитнес-центр общей площадью 1 100 кв. м.', 'An der Frauenkirche 5', 'Дрезден', '01067 Дрезден', 'Германия', '8.2', 'full/e6e56ce26111682dbaf01fb75c6eecfc49e17303.jpg', 'https://www.booking.com/hotel/de/hilton-dresden.ru.html', '2019-07-29 12:17:03', '2019-07-29 12:17:03'),
(596, 'Ferien in Dresden', 'Гостям этого хостела предлагается размещение в номерах и апартаментах с бесплатным WiFi в центре исторической части города Дрездена. На территории хостела Ferien in Dresden разбит сад с принадлежностями для барбекю.', 'Emerich Ambros Ufer 48', 'Дрезден', '01159 Дрезден', 'Германия', '6.7', 'full/cf7b793f0f14fe8e92bd369aa80c121e41491309.jpg', 'https://www.booking.com/hotel/de/ferien-in-dresden.ru.html', '2019-07-29 12:17:04', '2019-07-29 12:17:04'),
(597, 'Hotel Pension zu Dresden Altpieschen', 'Исторический пансион для некурящих находится в районе Пишен Дрездена, всего в 10 минутах езды на трамвае от модного района Нойштадт.', 'Altpieschen 5 b', 'Дрезден', '01127 Дрезден', 'Германия', '8.6', 'full/eea424d7115ef56da66e26d479fba2bc6ff276ef.jpg', 'https://www.booking.com/hotel/de/altpieschen.ru.html', '2019-07-29 12:17:03', '2019-07-29 12:17:03'),
(598, 'Aparthotel Altes Dresden', 'В этом апарт-отеле, расположенном в центре города, можно остановиться в современных номерах с плазменным телевизором и бесплатным Wi-Fi. Отель находится рядом с церковью Фрауенкирхе, в историческом центре Дрездена.', 'An der Frauenkirche 19', 'Дрезден', '01067 Дрезден', 'Германия', '8.7', 'full/d4198f9126413fdd8b66761a922b4c850c92c6f4.jpg', 'https://www.booking.com/hotel/de/aparthotel-altes-dresden-dresden.ru.html', '2019-07-29 12:17:09', '2019-07-29 12:17:09'),
(599, 'Ferienwohnung mit Dachterrasse in Dresden Kaditz', 'Апартаменты Ferienwohnung mit. Апартаменты Dachterrasse in Dresden Kaditz с бесплатным прокатом велосипедов и террасой расположены в Дрездене, в 5 км от Международного конгресс-центра Дрездена, в 6 км от дворцово-паркового комплекса Цвингер и в 6 км от Оперы Земпера. Расстояние до террасы Брюль и Королевского дворца Дрездена составляет 6 км.', '4 Rankestraße', 'Дрезден', '01139 Дрезден', 'Германия', '0.0', 'full/64d5906fd411942932a19455f78743d8a99e8a2f.jpg', 'https://www.booking.com/hotel/de/ferienwohnung-mit-dachterrasse-in-dresden-kaditz.ru.html', '2019-07-29 12:17:09', '2019-07-29 12:17:09'),
(600, 'Super 8 by Wyndham Dresden', 'Отель Super 8 by Wyndham Dresden расположен в Дрездене, в 2,2 км от террасы Брюль. К услугам гостей бар, частная парковка и терраса. Во всех номерах есть телевизор с плоским экраном и спутниковыми каналами, а также собственная ванная комната. Номера с видом на город оснащены кондиционером, письменным столом и бесплатным Wi-Fi.', 'Antonstraße 43', 'Дрезден', '01097 Дрезден', 'Германия', '8.9', 'full/ba5e9703ac6e1441f2d9c5db498b12033df38c82.jpg', 'https://www.booking.com/hotel/de/super-8-dresden.ru.html', '2019-07-29 12:17:09', '2019-07-29 12:17:09'),
(601, 'Hundemüde in Dresden', 'Апартаменты Hundemüde in Dresden расположены в Дрездене, в 7 км от замка и парка Пильниц и в 7 км от города Фюрстенцуг. К услугам гостей бесплатный Wi-Fi и сад с принадлежностями для барбекю и видом на сад.', '5 Mügelner Straße', 'Дрезден', '01237 Дрезден', 'Германия', '9.1', 'full/6b6bca9de4e97b1a878c6f7ad824e22950ed1ff8.jpg', 'https://www.booking.com/hotel/de/hundemude-in-dresden-de.ru.html', '2019-07-29 12:17:09', '2019-07-29 12:17:09'),
(602, 'modern living in Dresden Neustadt', 'Апартаменты Modern living in Dresden Neustadt расположены в Дрездене, в 2,7 км от террасы Брюль. К услугам гостей балкон, сад и бесплатный Wi-Fi. К услугам гостей частная парковка. До международного конгресс-центра Дрездена — 3 км.', '31 Louisenstraße', 'Дрезден', '01099 Дрезден', 'Германия', '9.6', 'full/4c6eb0233a76929973f8c77d7c3f18b099b09d57.jpg', 'https://www.booking.com/hotel/de/modern-living-in-dresden-neustadt.ru.html', '2019-07-29 12:17:10', '2019-07-29 12:17:10'),
(603, 'Romantik Landhaus', 'Апарт-отель Romantik Landhaus расположен в Дрездене, всего в 5 км от достопримечательностей Старого города. К услугам гостей терраса и детская игровая площадка.', 'Hofwiesenstr.24', 'Дрезден', '01169 Дрезден', 'Германия', '9.0', 'full/bbdbccc6ce0c072fc50c9d633155cf92d1693a98.jpg', 'https://www.booking.com/hotel/de/romantik-landhaus-dresden.ru.html', '2019-07-29 12:17:10', '2019-07-29 12:17:10'),
(604, 'Villa Kreisel', 'Вилла Kreisel расположена в Дрездене. К услугам гостей бесплатный Wi-Fi, телевизор, сад и принадлежности для барбекю.', 'Rippiener Str.16', 'Дрезден', '01217 Дрезден', 'Германия', '0.0', 'full/67a616fff3f0313c87ff36886b35c94fee6e6eda.jpg', 'https://www.booking.com/hotel/de/villa-kreisel-dresden.ru.html', '2019-07-29 12:17:11', '2019-07-29 12:17:11'),
(605, 'Weber Apartments', 'Апартаменты Weber с видом на сад и бесплатным Wi-Fi расположены в Дрездене, в 5 км от замка и парка Пильниц и в 7 км от террасы Брюль.', 'Oesterreicher Str. 17 Erdgeschoss', 'Дрезден', '01279 Дрезден', 'Германия', '9.4', 'full/57b8b46472594c3a7865a290aa9191bbca81380c.jpg', 'https://www.booking.com/hotel/de/weber-apartments.ru.html', '2019-07-29 12:17:10', '2019-07-29 12:17:10'),
(606, 'Quartier-Dresden', 'Апартаменты Quartier-Dresden расположены в Дрездене, в 3,2 км от замка и парка Пильниц и в 8 км от террасы. Расстояние до церкви Фрауэнкирхе в Дрездене составляет 8 км.', '10 Dieselstraße', 'Дрезден', '01257 Дрезден', 'Германия', '0.0', 'full/7bfc7c862b4e4261a016be6d59a76015c0c5c5a3.jpg', 'https://www.booking.com/hotel/de/quartier-dresden.ru.html', '2019-07-29 12:17:11', '2019-07-29 12:17:11'),
