(608, 'Gewandhaus Dresden, Autograph Collection', 'Этот полностью отремонтированный отель оформлен в сочетании современного и барочного стилей и расположен в 10 минутах ходьбы от центра Дрездена с его достопримечательностями, такими как церковь Фрауэнкирхе.', 'Ringstr. 1', 'Дрезден', '01067 Дрезден', 'Германия', '9.0', 'full/439082b9227e3bc6746e7307463cf26340885921.jpg', 'https://www.booking.com/hotel/de/radsasgewandhaushotel.ru.html', '2019-07-29 12:17:12', '2019-07-29 12:17:12'),
(609, 'Hotel Elbflorenz Dresden', 'Этот гостеприимный отель находится всего в 10 минутах ходьбы от центра Дрездена и его исторической части. К услугам гостей номера в итальянском стиле, сауна и фитнес-центр (оба за дополнительную плату) с террасой, откуда открывается панорамный вид на город.', 'Rosenstr. 36', 'Дрезден', '01067 Дрезден', 'Германия', '8.8', 'full/0be669dc6ce5275f92d263070c962e3e627639b9.jpg', 'https://www.booking.com/hotel/de/elbflorenz.ru.html', '2019-07-29 12:17:12', '2019-07-29 12:17:12'),
