(611, 'Hotel Am Blauen Wunder - Privathotel', 'Этот превосходный отель расположен в Блазевице — одном из самых красивых районов Дрездена. До исторического центра города можно быстро доехать на общественном транспорте, который останавливается рядом с отелем.', 'Loschwitzer Str. 48', 'Дрезден', '01309 Дрезден', 'Германия', '7.8', 'full/4e394e4891ac8dc3e86318fc0d5e182b22a24afb.jpg', 'https://www.booking.com/hotel/de/hotelamblauenwunder.ru.html', '2019-07-29 12:17:14', '2019-07-29 12:17:14'),
(612, 'Pension Helgoländ', 'Этот пансион расположен в тихом уголке оживленного района Дрездена Нойштадт. Гостей ожидает бесплатная частная парковка. В 2-х минутах ходьбы находится трамвайная остановка.', 'Helgolandstraße 9b', 'Дрезден', '01097 Дрезден', 'Германия', '6.7', 'full/a560f444509f55b0d3aa665a743314f7b9e28db0.jpg', 'https://www.booking.com/hotel/de/pension-helgola-nd.ru.html', '2019-07-29 12:17:14', '2019-07-29 12:17:14'),
(613, 'Hotel Villa Weltemühle Dresden', 'Этот отель расположен в тихом месте в красивом парке к западу от Дрездена. От отеля можно легко добраться до центра города на автомобиле или на поезде.', 'Merbitzer Str. 53', 'Дрезден', '01157 Дрезден', 'Германия', '8.4', 'full/70c3c0498b0b54258540d08d8d67dc2b09e95a36.jpg', 'https://www.booking.com/hotel/de/hotel-weltemuehle.ru.html', '2019-07-29 12:17:15', '2019-07-29 12:17:15'),
(614, 'AMEDIA Hotel Dresden Elbpromenade', 'Этот улучшенный 3-звездочный отель находится в Дрездене, на велосипедном маршруте Эльбрадвег вдоль реки Эльба. К услугам гостей сауна с панорамным балконом, звукоизолированные номера и Wi-Fi.', 'Hamburger Str. 64-68', 'Дрезден', '01157 Дрезден', 'Германия', '7.9', 'full/588690d38e52458da28b12834b2381652494c802.jpg', 'https://www.booking.com/hotel/de/mercureelbpromenade.ru.html', '2019-07-29 12:17:18', '2019-07-29 12:17:18'),
