(618, 'Dorint Hotel Dresden', 'Этот четырехзвездочный отель расположен в Дрездене, в 10 минутах ходьбы от церкви Фрауэнкирхе и в 2,5 км от главного железнодорожного вокзала Дрездена. К услугам гостей современные номера и зона отдыха с крытым бассейном.', 'Grunaer Straße 14', 'Дрезден', '01069 Дрезден', 'Германия', '8.3', 'full/5ee46d066499c3e5af3f58071bf2b9bfc4e6eed1.jpg', 'https://www.booking.com/hotel/de/dresden.ru.html', '2019-07-29 12:17:20', '2019-07-29 12:17:20'),
