(624, 'Hotel boutique Arte y Descanso', 'К услугам гостей этого 2-звездочного отеля сад и номера с кондиционером, бесплатным Wi-Fi и собственной ванной комнатой. В баре можно заказать напитки.', 'Ronda San Francisco', 'Альмагро', '13270 Альмагро', 'Испания', '9.3', 'full/8a46bb0459e73eeea68fd625958a30769590af59.jpg', 'https://www.booking.com/hotel/es/boutique-arte-y-descanso.ru.html', '2019-07-29 12:20:00', '2019-07-29 12:20:00'),
