(627, 'Casa Rural Tia Pilar de Almagro', 'Отель Tia Pilar находится в очаровательном старинном загородном доме XVIII века. К услугам гостей небольшой открытый бассейн. Этот элегантный отель идеально расположен в самом центре исторического города Альмагро в регионе Ла-Манча.', 'Carrascos', 'Альмагро', '13270 Альмагро', 'Испания', '9.3', 'full/6180a614cc7cae7b46126d50fb6254ff95dbc82d.jpg', 'https://www.booking.com/hotel/es/casa-rural-tia-pilar-de-almagro.ru.html', '2019-07-29 12:20:01', '2019-07-29 12:20:01'),
