(792, 'Hotel Exotica', 'Отель Exotica с собственным садом, плавательным бассейном, тренажерами, общим лаунджем, игровой площадкой для детей, бесплатным Wi-Fi и номерами с кондиционером находится всего в 5 минутах ходьбы от пляжа на побережье Черного моря.', 'Takaishvili Street Turn Ureki', 'Уреки', '6000 Уреки', 'Грузия', '9.6', 'full/d470ed14d609b536c077aaf3423861bd96eed11b.jpg', 'https://www.booking.com/hotel/ge/exotica.ru.html', '2019-07-29 12:25:30', '2019-07-29 12:25:30'),
(793, 'Hotel Inter', 'В отеле Inter, расположенном в поселке Уреки, к услугам гостей сезонный открытый бассейн, сад, бар и общий лаундж. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. К услугам гостей спа-центр, вечерняя развлекательная программа и детский клуб.', 'Ekvtime Takaishvili Street ', 'Уреки', '2484 Уреки', 'Грузия', '8.3', 'full/bf60092a5f8fd6b1c3c7fa445edfd74eb80e1fc9.jpg', 'https://www.booking.com/hotel/ge/inter.ru.html', '2019-07-29 12:25:22', '2019-07-29 12:25:22'),
