(797, 'Otium Hotel Life - Ultra All Inclusive & Kids Concept', 'В отеле Otium Life предлагаются многочисленные и единственные в своем роде удобства, предназначенные специально для детей, такие как детский клуб Kids\' World, оснащенный видеокамерами наблюдения. Здесь проводятся киносеансы, можно воспользоваться игровой приставкой PlayStation или поиграть в компьютерные игры и в разнообразные настольные игры. Кроме того, в отеле есть бассейны для детей и маленьких детей, а также специальная детская пляжная зона.', 'Göynük Mevkii', 'Кемер', '07600 Кемер', 'Турция', '9.2', 'full/26c83c112fadf5d2a6b950272aefa9fa57e977e3.jpg', 'https://www.booking.com/hotel/tr/otium-life.ru.html', '2019-07-29 12:27:17', '2019-07-29 12:27:17'),
