(806, 'Sherwood Exclusive Kemer - Kids Concept', 'В распоряжении гостей отеля Sherwood Exclusive Kemer многочисленные удобства, специально рассчитанные для детей, в том числе кинозал, комнаты для сна и различные комнаты для игр. На территории отеля также есть бассейны для детей и младенцев. Помимо этого, гости могут принять участие в таких мероприятиях, как посадка деревьев и цветов.', 'Sakip Sabanci Cad. No:37 Goynuk', 'Кемер', '07994 Кемер', 'Турция', '8.5', 'full/479f47fb597af2d7410ed9a1b5336ff25465cbcd.jpg', 'https://www.booking.com/hotel/tr/sherwood-club-kemer.ru.html', '2019-07-29 12:27:20', '2019-07-29 12:27:20'),
(807, 'Minta Apart Hotel', 'not found', 'Ataturk Bulvari No:24', 'Кемер', '07980 Кемер', 'Турция', '9.4', 'full/6d1d517ec159c717c003841b2d025b532f3828f1.jpg', 'https://www.booking.com/hotel/tr/minta-apart-antalya-kemer.ru.html', '2019-07-29 12:27:20', '2019-07-29 12:27:20'),
(808, 'Truemar Hotels & Suites', 'В апарт-отеле Truemar Hotels & Suites в Кемере к услугам гостей апартаменты с видом на сад, сезонный открытый бассейн, сад и терраса.', 'Merkez Mahallesi Atatürk Cad.B-Blok 103/1 Kemer ANTALYA', 'Кемер', '07980 Кемер', 'Турция', '9.9', 'full/cffe03be2f0d8cfb8e02909c23f3daafeb704362.jpg', 'https://www.booking.com/hotel/tr/truemar-hotels-amp-suits.ru.html', '2019-07-29 12:27:22', '2019-07-29 12:27:22'),
(809, 'Sultan Homes Garden', 'Комплекс Sultan Homes Garden расположен в городе Кемер, в 2,9 км от парка и пляжа Мунлайт и пристани для яхт Кемера. К услугам гостей апартаменты с бесплатным Wi-Fi, кондиционером и выходом в сад с открытым бассейном.', 'Yeni mah. Ahmet Cavus cad. 527 sokak', 'Кемер', '07980 Кемер', 'Турция', '7.7', 'full/385a70504e9ff2dd24a414d93008505e82c81fe7.jpg', 'https://www.booking.com/hotel/tr/sultan-homes-garden-kiemier.ru.html', '2019-07-29 12:27:22', '2019-07-29 12:27:22'),
(810, 'Armas Gul Beach', 'Курортный отель Armas Gul Beach с проживанием по системе «все включено» расположен всего в нескольких шагах от морской набережной. В распоряжении гостей открытый бассейн, небольшой аквапарк и терраса с видом на Средиземное море. Из отеля можно напрямую пройти к частному пляжу. На территории есть бесплатная частная парковка.', 'Yeni Mahalle Atatürk Cad. No:81 Antalya', 'Кемер', '07980 Кемер', 'Турция', '6.7', 'full/5e7640ce8cb3a2b9a0d7a3cdc46dc22cc691178a.jpg', 'https://www.booking.com/hotel/tr/grand-gul-beach.ru.html', '2019-07-29 12:27:28', '2019-07-29 12:27:28'),
(811, 'Club Marco Polo-Ultra All Inclusive', 'Отремонтированный в 2018 году отель Club Marco Polo расположен на побережье Средиземного моря, на территории площадью 12,67 га. К услугам гостей частный песчано-галечный пляж, 5 открытых бассейнов, аквапарк, спа-центр и 4 теннисных корта. Для юных гостей работает детский клуб.', 'Turizm Caddesi Marco Polo Tatil köyü Çamyuva - Kemer', 'Кемер', '07990 Кемер', 'Турция', '8.6', 'full/34921e367aa2cc941be9ec62c920f9353a5a3568.jpg', 'https://www.booking.com/hotel/tr/club-marco-polo.ru.html', '2019-07-29 12:27:28', '2019-07-29 12:27:28'),
(812, 'Bade Hotel', 'Отель Bade находится в Кемере, в 750 метрах от пристани Кемера. К услугам гостей сезонный открытый бассейн и частный пляж. Расстояние до берега моря составляет всего 400 метров. На территории отеля работает ресторан.', 'Merkez Mahallesi 110.Sok No:18-1 Antalya', 'Кемер', '07980 Кемер', 'Турция', '8.2', 'full/74da7c315eae0165c31eea6344eedaa280edb60d.jpg', 'https://www.booking.com/hotel/tr/bade.ru.html', '2019-07-29 12:27:29', '2019-07-29 12:27:29'),
(813, 'Felice Hotel', 'Отель Felice расположен всего в 1 км от песчаного пляжа Кемера. К услугам гостей открытый бассейн, фитнес-центр и сауна. Гостям предлагается проживание в комфортабельных номерах с кондиционером и бесплатным Wi-Fi.', 'Ataturk cad.no 47', 'Кемер', '07980 Кемер', 'Турция', '6.3', 'full/720ea0c6fd95bc84b6b0f99e26442190e3ae10bb.jpg', 'https://www.booking.com/hotel/tr/felice.ru.html', '2019-07-29 12:27:31', '2019-07-29 12:27:31'),
(814, 'Golden Lotus Hotel', 'Этот курортный отель с обслуживанием по системе «все включено» расположен рядом с пляжем в городе Кемер. К услугам гостей частный пляж с бесплатными шезлонгами, пирс и открытый бассейн. В отеле работает полностью оборудованный спа-центр с турецкой баней, сауной, фитнес-залом, а также массажными и процедурными кабинетами. Гостям предоставляется бесплатный Wi-Fi и высокоскоростной доступ в интернет за дополнительную плату. На территории обустроена бесплатная парковка.', 'Deniz Cad. No:13 Antalya', 'Кемер', '07995 Кемер', 'Турция', '8.2', 'full/a31aa234d6e928eced30329a8e724e95ec4fd092.jpg', 'https://www.booking.com/hotel/tr/golden-lotus-kemer.ru.html', '2019-07-29 12:27:31', '2019-07-29 12:27:31'),
(815, 'Miranda Moral Beach', 'Отель Miranda Moral Beach расположен рядом с пляжем. На пляже у отеля имеется собственный участок. Также к услугам гостей открытый бассейн с бесплатными зонтиками и шезлонгами. Кроме того, на всей территории работает бесплатный Wi-Fi.', 'Merkez Mah. Deniz Cad. NO: 34-35', 'Кемер', '07980 Кемер', 'Турция', '7.1', 'full/7c4e9eda6bb505a97a20e37ecec9213de59fb574.jpg', 'https://www.booking.com/hotel/tr/viking-moral-beach.ru.html', '2019-07-29 12:27:32', '2019-07-29 12:27:32'),
(816, 'Crystal De Luxe Resort & Spa', 'Этот курортный отель с обслуживанием по системе «все включено» находится в красивом саду площадью 8 000 кв. м. К услугам гостей частный галечный пляж и аквапарк. На территории работает спа-центр. Во всех номерах имеется балкон.', 'Yeni Mahalle 501 Sok. No:9', 'Кемер', '07100 Кемер', 'Турция', '8.4', 'full/af70ec63c6ba7f19e9a1680889e02db890eaab0c.jpg', 'https://www.booking.com/hotel/tr/crystal-de-luxe-resort-spa.ru.html', '2019-07-29 12:27:34', '2019-07-29 12:27:34'),
(817, 'Lanova Hotel', 'Отель Lanova расположен в 800 метрах от берега моря в городе Кемер. К услугам гостей открытый бассейн, тихий сад и бесплатный Wi-Fi во всем здании. Предоставляются услуги консьержа.', 'Merkez Mah. Karayer Cad. No:3 Kemer / Antalya', 'Кемер', '07980 Кемер', 'Турция', '7.2', 'full/ee93e1bec734de1ea7ddd3683f57123fe7ee3d2b.jpg', 'https://www.booking.com/hotel/tr/lanova.ru.html', '2019-07-29 12:27:34', '2019-07-29 12:27:34'),
(818, 'Beydagi Konak Hotel', 'Из этого небольшого отеля, расположенного на побережье в окружении апельсиновых деревьев, открывается восхитительный вид на бухту и горы. В нём Вас ожидает необыкновенный спокойный отдых.', 'Cumhuriyet Mah.Seyid Onbaşı Cad. No:11', 'Кемер', '07994 Кемер', 'Турция', '8.6', 'full/49533a72be636595b4cdd28374c9128dce8fa6c5.jpg', 'https://www.booking.com/hotel/tr/beydagi-konak.ru.html', '2019-07-29 12:27:35', '2019-07-29 12:27:35'),
(819, 'Caner Hotel', 'Отель Caner находится в центре Кемера и располагает садом и открытым бассейном с бесплатными зонтиками и шезлонгами. На всей территории отеля предоставляется бесплатный Wi-Fi.', 'Atatürk Caddesi. 139 Sok. No:6 Kemer', 'Кемер', '07980 Кемер', 'Турция', '8.4', 'full/d6d3c862fbdcaeac8d17d9b4f67ed039f5ec183c.jpg', 'https://www.booking.com/hotel/tr/caner.ru.html', '2019-07-29 12:27:37', '2019-07-29 12:27:37'),
(820, 'Forest Park Hotel', 'Этот отель с видом на Таврские горы расположен в городе Кемер, в 20 минутах ходьбы от средиземноморского пляжа. К услугам гостей цветочный сад, открытый бассейн и традиционный хаммам.', 'Merkez Mah. Atatürk Cad. No: 115', 'Кемер', '07890 Кемер', 'Турция', '8.7', 'full/d1e3974e9436bb0fc3e1f4f9c93584fba5b5ec5a.jpg', 'https://www.booking.com/hotel/tr/forest-park.ru.html', '2019-07-29 12:27:36', '2019-07-29 12:27:36'),
(821, 'Monna Roza Garden Hotel', 'В отеле Monna Roza Garden, расположенном в городе Кемер, к услугам гостей сад, фитнес-центр, бар и общий лаундж. К услугам гостей круглосуточная стойка регистрации, ресторан, аквапарк и открытый бассейн. Гости могут воспользоваться услугой доставки еды и напитков в номер, посетить детский клуб и обменять валюту.', 'Cumhuriyet Cad.102. Sok. No.4', 'Кемер', '07040 Кемер', 'Турция', '7.1', 'full/c6cc8a44b4435e6a80dc2d720c23a20f37bc41ea.jpg', 'https://www.booking.com/hotel/tr/monnaroza-garden.ru.html', '2019-07-29 12:27:38', '2019-07-29 12:27:38'),
(822, 'FUN&SUN Miarosa Ghazal Resort', 'Курортный отель Tui Fun & Sun Miarosa Ghazal расположен на южных склонах гор Тавр в Гёйнюке, в окружении мирных сосновых деревьев и предлагает 100-метровый частный пляж с мягким песком. На территории работает большой открытый бассейн с водными горками, 2 крытых бассейна и большой спа-центр с сауной, гидромассажной ванной, турецкой баней, массажным кабинетом и тренажерным залом.', 'Cumhuriyet Mah. Ahu-Unal Aysal Cad. No:43 Goynuk', 'Кемер', '07994 Кемер', 'Турция', '8.2', 'full/cd12ee165dc53a0a8463cf0e87c9098bdaf50863.jpg', 'https://www.booking.com/hotel/tr/ma-biche-hotel.ru.html', '2019-07-29 12:27:16', '2019-07-29 12:27:16'),
(823, 'Palma-Rosa', 'Отель Palma Rosa находится всего в 700 метрах от пляжа. К услугам гостей открытый бассейн, бесплатный Wi-Fi, а также номера с кондиционером и балконом.', 'Ahmet Can Caddesi Camyuva Mah.No:18 Camyuva/Kemer', 'Кемер', '07990 Кемер', 'Турция', '0.0', 'full/fb6a3ab850f91c667717ffd8f73012a1b4086c86.jpg', 'https://www.booking.com/hotel/tr/palma-rosa.ru.html', '2019-07-29 12:27:41', '2019-07-29 12:27:41'),
(824, 'PGS Rose Residence Beach', 'Отель Rose Residence Beach находится за пределами шумного приморского курорта Кемер, он занимает первую линию на средиземноморском побережье у подножья гор Торос.', 'Atatürk Bul. Yenimahalle ', 'Кемер', '07980 Кемер', 'Турция', '6.6', 'full/dab357a3b0ef73edaf61885427230eecf90e437a.jpg', 'https://www.booking.com/hotel/tr/rose-residence-beach.ru.html', '2019-07-29 12:27:41', '2019-07-29 12:27:41'),
(825, 'Amanda Hotel', 'Отель Amanda расположен в городе Кемер, в 1,1 км от парка и пляжа Мунлайт. К услугам гостей номера для некурящих, сезонный открытый бассейн, бесплатный Wi-Fi и сад. Отель находится в 1,1 км от пристани Кемера и в 14 км от древнего города Фаселис. К услугам гостей терраса для загара и круглосуточная стойка регистрации. Из окон открывается вид на сад.', 'Merkez mah. 130.sok No:3 Kemer', 'Кемер', '07980 Кемер', 'Турция', '7.7', 'full/10e31eba7363e3a8970faf622f0b25caf8e4c0d0.jpg', 'https://www.booking.com/hotel/tr/amanda.ru.html', '2019-07-29 12:27:42', '2019-07-29 12:27:42'),
(826, 'Tropicano Family Villas', 'Виллы Tropicano расположены всего в 5 минутах езды от моря. К услугам гостей открытый бассейн и бесплатный Wi-Fi в зонах общественного пользования, а также просторные виллы с кондиционером, полностью оборудованной кухней и стиральной машиной.', 'Yeni Mahalle 445 Sok. Kemer Antalya', 'Кемер', '07200 Кемер', 'Турция', '0.0', 'full/adb81243312e25eed58480957242fd872d3e43a0.jpg', 'https://www.booking.com/hotel/tr/tropicano-family-villas.ru.html', '2019-07-29 12:27:43', '2019-07-29 12:27:43'),
(827, 'Garden Prizma Pension', 'Гостевой дом Garden Prizma расположен на пешеходной улице города Кемер. К услугам гостей открытый бассейн, бесплатный WiFi и круглосуточная стойка регистрации.', 'Merkez Mah.Liman Cad.136. Sok. No:6 Antalya', 'Кемер', '07980 Кемер', 'Турция', '10.0', 'full/d64df82df2b995d521d033971fd3e63a53e38c89.jpg', 'https://www.booking.com/hotel/tr/garden-prizma-pansiyon.ru.html', '2019-07-29 12:27:44', '2019-07-29 12:27:44'),
(828, 'Garden Resort Bergamot', 'Курортный отель Garden Bergamot расположен на фоне Таврских гор в окружении цитрусовых садов, в 2 км от своего частного пляжа на берегу Средиземного моря. К услугам гостей бесплатный трансфер до пляжа.', 'Yeni Mahalle 513.Sok No:3', 'Кемер', '07980 Кемер', 'Турция', '8.1', 'full/7a6d7286cff8109e2b8cc3b64a5789081f560407.jpg', 'https://www.booking.com/hotel/tr/garden-resort-bergamot.ru.html', '2019-07-29 12:27:44', '2019-07-29 12:27:44'),
(829, 'DoubleTree By Hilton Antalya-Kemer', 'Отель Doubletree By Hilton Antalya-Kemer расположен в центре города Кемер. К услугам гостей открытый бассейн и пляж, пляжный клуб, эклектичная программа ежедневных мероприятий и 12 ресторанов для гурманов и мобильных кухонь.', 'Yeni Mahalle Ataturk Bulvari', 'Кемер', '7980 Кемер', 'Турция', '8.6', 'full/554384a2bfbf6d068aff640cc13cb38b1c6e3e16.jpg', 'https://www.booking.com/hotel/tr/sauce-hotel-kemer.ru.html', '2019-07-29 12:27:45', '2019-07-29 12:27:45'),
(830, 'Tatil Evi 3', 'Дом для отпуска Tatil Evi 3 расположен в городе Кемер, в 6 км от парка и пляжа Мунлайт. К услугам гостей сад, бесплатный Wi-Fi и круглосуточная стойка регистрации. Из окон открывается вид на сад.', 'Ballıtaş Caddesi 27. Sokak', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/ae108c27074287924377777d30c9d65d23452a0c.jpg', 'https://www.booking.com/hotel/tr/tatil-evi-3.ru.html', '2019-07-29 12:27:45', '2019-07-29 12:27:45'),
(831, 'Simena Hotel', 'Отель Simena расположен всего в 500 метрах от морского побережья. К услугам гостей открытые бассейны с водными горками, частный пляж на берегу Средиземного моря с его чистейшей бирюзовой водой, спа-центр, а также номера с кондиционером, спутниковым телевидением и балконом. По вечерам в отеле Simena проводится развлекательная программа.', 'Camyuva Mevkii ', 'Кемер', '07990 Кемер', 'Турция', '6.9', 'full/ac76b3198275590432dcceb6fe8dd8252226f78b.jpg', 'https://www.booking.com/hotel/tr/simena.ru.html', '2019-07-29 12:27:46', '2019-07-29 12:27:46'),
(832, 'Akka Claros Hotel', 'Этот отель находится вблизи морского курорта Кемер, всего в нескольких минутах ходьбы от пляжа. К услугам гостей открытый бассейн, турецкая баня и сауна.', 'Kiris Mevkii', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/531b3de29c0d88c34b26141116a608802aad116f.jpg', 'https://www.booking.com/hotel/tr/akka-hotels-claros.ru.html', '2019-07-29 12:27:47', '2019-07-29 12:27:47'),
(833, 'Tatil Evleri', 'Комплекс Tatil Evleri с садом и принадлежностями для барбекю расположен в Кемере. К услугам гостей бесплатный Wi-Fi. Из окон открывается вид на сад. С балкона открывается вид на горы.', 'Ballitas Caddesi 27. Sokak Kemer Antalya', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/0808e183ebb881911c774478eed4c4c0da21c97d.jpg', 'https://www.booking.com/hotel/tr/tatil-evileri.ru.html', '2019-07-29 12:27:47', '2019-07-29 12:27:47'),
(834, 'Marina Loft', 'Комплекс Marina Loft расположен в 28 км от античного города Фаселис. К услугам гостей сад, бар и номера с кондиционером, балконом и бесплатным Wi-Fi.', 'Ulupinar mahallesi', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/2a4a1d744ac7b6c501a680c54fa879fabcedb265.jpg', 'https://www.booking.com/hotel/tr/marina-loft.ru.html', '2019-07-29 12:27:47', '2019-07-29 12:27:47'),
(835, 'THE NORDİC HOTEL', 'Отель THE NORDIC расположен в городе Кемер, в 1,3 км от парка и пляжа Мунлайт. К услугам гостей сезонный открытый бассейн, сад и бар. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. В каждом номере есть балкон с видом на бассейн.', 'MERKEZ MAH ATATÜRK CAD NO:49 KEMER ANTALYA', 'Кемер', '07990 Кемер', 'Турция', '0.0', 'full/5aafcc556e34398e7451a9412ba060405ed47421.jpg', 'https://www.booking.com/hotel/tr/the-nordic.ru.html', '2019-07-29 12:27:50', '2019-07-29 12:27:50'),
(836, 'OffRoad House', 'Отель Offroad House расположен в Кемере. К услугам гостей сад, бар и ресторан. В отеле запрещено курение. Расстояние до античного города Фаселис составляет 22 км.', 'Çıralı Yolu', 'Кемер', '07982 Кемер', 'Турция', '0.0', 'full/2871049404e354c679041e59dfc6bb94429b3db5.jpg', 'https://www.booking.com/hotel/tr/offroad-house.ru.html', '2019-07-29 12:27:51', '2019-07-29 12:27:51'),
(837, 'Belinda Ap.', 'Комплекс Belinda Ap находится в городе Кемер, в 6 км от античного города Фаселис и в 10 км от парка Мунлайт и пляжа. К услугам гостей бесплатный Wi-Fi, кондиционер, сезонный открытый бассейн и сад. К услугам гостей собственный бассейн. В окрестностях можно заняться такими видами активного отдыха, как пешие походы, сноркелинг и велоспорт.', 'Hacı Ardıç Caddesi No. 3', 'Кемер', '07990 Кемер', 'Турция', '0.0', 'full/1cb880c9c50d71aa5eaecf4964cad797687b739b.jpg', 'https://www.booking.com/hotel/tr/belinda-ap.ru.html', '2019-07-29 12:27:51', '2019-07-29 12:27:51'),
(838, 'lily family apart', 'Отель типа «постель и завтрак» lily family расположен в 2,6 км от парка и пляжа Мунлайт. К услугам гостей сезонный открытый бассейн, сад и номера с кондиционером, балконом и бесплатным Wi-Fi.', 'yeni mah.511.sok.35/1 kemer ANTALYA', 'Кемер', '07900 Кемер', 'Турция', '0.0', 'full/51a96f5d674083c53da6c7522e60fd7fb219981d.jpg', 'https://www.booking.com/hotel/tr/lily-family-apart-antalya-kemer1.ru.html', '2019-07-29 12:27:53', '2019-07-29 12:27:53'),
(839, 'can apart hotel', 'Апарт-отель расположен в 7 км от античного города Фаселис. К услугам гостей сезонный открытый бассейн, сад и номера с кондиционером, балконом и бесплатным Wi-Fi.', 'çamyuva mahallesi 5081 sokak no.14', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/987c63827af8f3bf4db8d3b76ba0d024290334c2.jpg', 'https://www.booking.com/hotel/tr/can-apart-antalya.ru.html', '2019-07-29 12:27:52', '2019-07-29 12:27:52'),
(840, 'Waldvilla', 'Комплекс Waldvilla расположен в 20 км от античного города Фаселис. К услугам гостей сад, терраса и общая кухня.', 'Çıralı Yolu Alasini mevkii', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/41c73f1978e706b3e9b010817c5f4a745a6d0765.jpg', 'https://www.booking.com/hotel/tr/waldvilla-kemer.ru.html', '2019-07-29 12:27:53', '2019-07-29 12:27:53'),
(841, 'Stone House Çıralı', 'Отель типа «постель и завтрак» Stone House расположен в городе Кемер, в 22 км от античного города Фаселис и в 36 км от парка и пляжа Мунлайт. В отеле типа «постель и завтрак» Çıralı к услугам гостей бесплатный Wi-Fi, кондиционер, сад и бар.', 'Çıralı Yolu 86', 'Кемер', '07982 Кемер', 'Турция', '4.2', 'full/fa7163df7ff6174ab5167e48079ede3cf622aa60.jpg', 'https://www.booking.com/hotel/tr/stone-house-cirali.ru.html', '2019-07-29 12:27:53', '2019-07-29 12:27:53'),
(842, 'ANTALYA, KEMER, KIRIS VILLA PARK', 'Апартаменты с балконом ANTALYA, KEMER, KIRIS VILLA PARK находятся в Кемере. Апартаменты находятся в 12 км от античного города Фаселис.', 'KIRIS VILLA PARK', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/1cca51afb92aceb50ad7350d7a8c91da10bb9d8e.jpg', 'https://www.booking.com/hotel/tr/antalya-kemer-kiris-villa-park.ru.html', '2019-07-29 12:27:54', '2019-07-29 12:27:54'),
(843, 'Flower Villa Apart', 'Виллы комплекса Flower Apart находятся в центре Кемера, всего в 200 метрах от пляжа. Они окружены садом с полевыми цветами и фруктовыми деревьями. К услугам гостей открытый бассейн.', 'Merkez mah.Dumlupınar cad.No:8 Kemer', 'Кемер', '07980 Кемер', 'Турция', '8.8', 'full/1edb2a14c622fd0b1c14bf5746612693c628105e.jpg', 'https://www.booking.com/hotel/tr/flower-villa-apart.ru.html', '2019-07-29 12:27:55', '2019-07-29 12:27:55'),
(844, 'kemer merkezde full esyali villa', 'Вилла kemer merkezde full esyali удобно расположена в Кемере, в 1,3 км от парка и пляжа Мунлайт и пристани для яхт Кемера. К услугам гостей терраса и общая кухня. К услугам гостей сад, общий лаундж и частный пляж.', 'Merkez mah. 129. Sok', 'Кемер', '07980 Кемер', 'Турция', '0.0', 'full/52e49e0330d71bcf71f9fae7ebda29de76dbbe6d.jpg', 'https://www.booking.com/hotel/tr/kemer-merkezde-full-esyali-villa.ru.html', '2019-07-29 12:27:56', '2019-07-29 12:27:56'),
(845, 'meşe otel', 'Отель meşe otel расположен в Кемере, менее чем в 1 км от парка и пляжа Мунлайт. К услугам гостей номера с кондиционером и бар. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. К услугам гостей открытый бассейн, сад и номера с видом на бассейн.', 'Karapınar Caddesi no:8', 'Кемер', '07990 Кемер', 'Турция', '0.0', 'full/6664ddb2bb856f0a3563d091f614e5a490d1388d.jpg', 'https://www.booking.com/hotel/tr/mese-otel.ru.html', '2019-07-29 12:27:57', '2019-07-29 12:27:57'),
(846, 'Queen\'s Park Goynuk Hotel - All Inclusive', 'В отеле Queen\'s Park Goynuk, расположенном на берегу моря в Кемере, обустроен собственный пляж длиной 50 метров с бесплатными шезлонгами и зонтиками. Помимо этого, к услугам гостей 2 открытых бассейна, детский бассейн, крытый бассейн с подогревом, аквапарк и 2 теннисных корта.', 'Cumhuriyet Mah. Ahu Ünal Aysal Cad. No:31', 'Кемер', '07994 Кемер', 'Турция', '8.1', 'full/845ea9638830f1fa05e077cffd39322dd60738ae.jpg', 'https://www.booking.com/hotel/tr/queen-39-s-park-goynuk.ru.html', '2019-07-29 12:27:54', '2019-07-29 12:27:54'),
(847, 'Amara Prestige', 'Этот прибрежный отель имеет частную пляжную территорию на побережье Средиземного моря, отмеченную голубым флагом. В отеле есть 2 открытых бассейна с водной горкой, тренажерный зал и спа-центр.', 'Esentepe Mah. Atatürk Cad. No.17 Göynük 07994 - Antalya / Türkiye ', 'Кемер', '07994 Кемер', 'Турция', '0.0', 'full/04e41140c5f58131623a9afe742df49c21586ea9.jpg', 'https://www.booking.com/hotel/tr/le-chateau-de-prestige.ru.html', '2019-07-29 12:27:57', '2019-07-29 12:27:57'),
(848, 'Monna Roza Beach Hotel', 'В отеле Monna Roza Beach, расположенном в городе Кемер, к услугам гостей сад, фитнес-центр, бар и общий лаундж. К услугам гостей круглосуточная стойка регистрации, ресторан, аквапарк и открытый бассейн, работающий круглый год. К услугам гостей хаммам, вечерняя развлекательная программа и детский клуб.', 'Goynuk Mahallesi 4021', 'Кемер', '07985 Кемер', 'Турция', '6.8', 'full/c63ef46f04932931cda5abc7a826cf3bf97935e2.jpg', 'https://www.booking.com/hotel/tr/monnaroza-beach.ru.html', '2019-07-29 12:28:01', '2019-07-29 12:28:01'),
(849, 'Eldar Resort Hotel', 'Отель Eldar находится в Гейнюке в 9 километрах от Кемера. До моря - всего 500 метров. К услугам гостей большой открытый бассейн оригинальной формы и отдельный детский бассейн. В спа-салоне отеля есть турецкая баня, сауна, паровая баня и фитнес-центр.', 'Cumhuriyet Mah.Sakip Sabanci Cad no 24 ', 'Кемер', '07980 Кемер', 'Турция', '8.8', 'full/91d88bf293b7ea5a7d141b14ea15717a64cf2a7b.jpg', 'https://www.booking.com/hotel/tr/eldar-resort.ru.html', '2019-07-29 12:28:02', '2019-07-29 12:28:02'),
(850, 'Sima Resort', 'Курортный отель Sima расположен в регионе Кемер в Анталье, всего в 5 минутах ходьбы от Средиземного моря. К услугам гостей открытый бассейн и бесплатный Wi-Fi в местах общего пользования.', 'Merkez Mah Kavakli Cad. 103. Sok No:6', 'Кемер', '07100 Кемер', 'Турция', '7.4', 'full/d974a4bdc80355395f68a38a0538d328c892db73.jpg', 'https://www.booking.com/hotel/tr/sima-otel.ru.html', '2019-07-29 12:28:02', '2019-07-29 12:28:02'),
(851, 'Erol Apart', 'Апартаменты расположены менее чем в 1 км от парка и пляжа Мунлайт. К услугам гостей апартаментов Erol сад, кондиционер, балкон и бесплатный Wi-Fi.', 'Liman cad. Merkez mah. 119.sk no:21', 'Кемер', '07980 Кемер', 'Турция', '9.3', 'full/26b25f62ddc0c19980ae9c749cd0591b133c7d5d.jpg', 'https://www.booking.com/hotel/tr/erol-apart.ru.html', '2019-07-29 12:28:03', '2019-07-29 12:28:03'),
(852, 'Han-De Homes', 'Комплекс Han-De Homes расположен в Кемере, в 6 км от парка и пляжа Мунлайт и пристани для яхт Кемера. К услугам гостей апартаменты с бесплатным Wi-Fi, кондиционером, открытым бассейном и садом. К услугам гостей сауна.', 'Aslanbucak mahallesi ', 'Кемер', '07980 Кемер', 'Турция', '9.4', 'full/4d5579c0abc0160143c9867929020141c114bd1f.jpg', 'https://www.booking.com/hotel/tr/han-de-homes.ru.html', '2019-07-29 12:28:04', '2019-07-29 12:28:04'),
(853, 'Tebriz Apart', 'Апартаменты Tebriz расположены в городе Кемер. К услугам гостей открытый бассейн, сад и частный пляж.', 'Arslanbucak mahallesi Mustafa Rüştü Tuncer caddesi no:14 Kemer/ANTALYA', 'Кемер', '07980 Кемер', 'Турция', '8.8', 'full/e25e8c2d07c06c2fc3c4ffacde3ff063515cc31c.jpg', 'https://www.booking.com/hotel/tr/tebriz-apart.ru.html', '2019-07-29 12:28:05', '2019-07-29 12:28:05'),
(854, 'Dinara Hotel', 'Отель Dinara располагается в прибрежном районе Кемера, всего в 400 метрах от песчаного пляжа. Здание, в целом, отличается уникальной архитектурой, а на балконах установлены изящные перила. К услугам гостей открытый бассейн, сауна и номера с кондиционером.', 'Merkez mah.Liman cad 119 sok no 12', 'Кемер', '07980 Кемер', 'Турция', '8.2', 'full/63a0de1ee7dbf454a854801de63e251acd3eee8b.jpg', 'https://www.booking.com/hotel/tr/dinara.ru.html', '2019-07-29 12:28:06', '2019-07-29 12:28:06'),
(855, 'Agva Apart Otel', 'Из окон открывается вид на сад. К услугам гостей апарт-отеля Agva Apart Otel Kemer номера, сезонный открытый бассейн, сад, бар, частный пляж и принадлежности для барбекю.', 'Camyuva Mah. 5025 Sok No:6', 'Кемер', '07990 Кемер', 'Турция', '4.4', 'full/f3b3941375f5ca01ab8f5235dcd4b56056eee4d4.jpg', 'https://www.booking.com/hotel/tr/agva-apart-otel.ru.html', '2019-07-29 12:28:06', '2019-07-29 12:28:06'),
(856, 'Queen\'s Park Le Jardin', 'Курортный отель Queen\'s Park Le Jardin расположен рядом с береговой линией. К услугам гостей собственный частный пляж, спа-салон, крытый и открытый бассейны. Номера располагают балконом, кондиционером и телевизором со спутниковым каналами. В зонах общественного пользования отеля предоставляется бесплатный WiFi.', 'Turizm Cad. Kiriş Mevkii Kemer', 'Кемер', '07580 Кемер', 'Турция', '8.0', 'full/cf59761dc48cb0b9769711ff78589e240db94da6.jpg', 'https://www.booking.com/hotel/tr/queens-park-le-jardin.ru.html', '2019-07-29 12:28:08', '2019-07-29 12:28:08'),
(857, 'Latino Hotel', 'Отель Latino разместился в центре города Кемер. К услугам гостей сад и возможность бесплатно посещать отдельные ночные клубы в Кемере. Также предоставляется бесплатный Wi-Fi и бесплатная парковка.', 'Ataturk Cad. 143. Sok. No: 5 Kemer', 'Кемер', '07980 Кемер', 'Турция', '7.9', 'full/6846630f64efc92a64ce4d0913e4f803d203b513.jpg', 'https://www.booking.com/hotel/tr/latino.ru.html', '2019-07-29 12:28:07', '2019-07-29 12:28:07'),
(858, 'Armas Beach', 'Отель Armas Beach расположен у подножия Таврских гор, в центре курорта Кемер. В числе удобств открытый бассейн и сауна. В оздоровительном центре гостям предлагают косметические процедуры.', 'Yeni Mahalle Ataturk Bulvari No:21', 'Кемер', '07980 Кемер', 'Турция', '6.9', 'full/590ee8fa0c9518dd0a9f2ff7c676393562744312.jpg', 'https://www.booking.com/hotel/tr/arma-s-beach.ru.html', '2019-07-29 12:28:08', '2019-07-29 12:28:08'),
(859, 'Parus Hotel', 'Отель Parus расположен всего в 500 метрах от пляжа и центра города Кемер. К услугам гостей сад, терраса и открытый бассейн с бесплатными зонтиками и шезлонгами. На всей территории предоставляется бесплатный Wi-Fi.', 'Merkez Mah. Karayer Cad. No:7', 'Кемер', '07980 Кемер', 'Турция', '7.3', 'full/d5017a17d1b5de3d7139fdb8ae89ed7d71a84597.jpg', 'https://www.booking.com/hotel/tr/parus-hotel.ru.html', '2019-07-29 12:28:09', '2019-07-29 12:28:09'),
(860, 'Derin Luxury Hotel', 'Отель Derin Luxury расположен в городе Кемер, в 1,2 км от парка и пляжа Мунлайт. К услугам гостей номера для некурящих, сезонный открытый бассейн, бесплатный Wi-Fi и сад. К услугам гостей ресторан, бар и общий лаундж. К услугам гостей круглосуточная стойка регистрации, доставка еды и напитков в номер и обмен валюты.', 'Merkez Mahallesi Liman Caddesi 106. Sokak No:3 Kemer', 'Кемер', '07980 Кемер', 'Турция', '8.3', 'full/c8e936f8757ebd426f956c98dc369010352b39c1.jpg', 'https://www.booking.com/hotel/tr/derin-luxury.ru.html', '2019-07-29 12:28:09', '2019-07-29 12:28:09'),
(861, 'Las Palmeras Hotel', 'Отель Las Palmeras, с открытым бассейном и бесплатным Wi-Fi, расположен всего в 650 метрах от моря. К услугам гостей номера с кондиционером, спутниковым телевидением и балконом.', 'Uzun cinar mah. Hurriyet cad. No:14 Camyuva Kemer', 'Кемер', '07990 Кемер', 'Турция', '8.2', 'full/8991c1a107e9de1441832c798d31e07b47089a4b.jpg', 'https://www.booking.com/hotel/tr/las-palmeras.ru.html', '2019-07-29 12:28:13', '2019-07-29 12:28:13'),
(862, 'Pine House Hotel', 'Этот отель расположен в сосновом лесу с видом на Средиземное море и горы Таурус. К услугам гостей частный пляж и большой открытый бассейн. Античный город Олимпос расположен в 15 км от отеля.', 'Uzuncinar Mah. Turizm Cd. No:9 Camyuva', 'Кемер', '07990 Кемер', 'Турция', '8.3', 'full/f619df51fe4f524f327cec46353e0a3c46ce35c1.jpg', 'https://www.booking.com/hotel/tr/pine-house.ru.html', '2019-07-29 12:28:14', '2019-07-29 12:28:14'),
(863, 'Agon Hotel', 'Отель Agon расположен в городе Кемер, в 1,1 км от парка и пляжа Мунлайт. К услугам гостей номера для некурящих, сезонный открытый бассейн, бесплатный Wi-Fi и сад. К услугам гостей этого 3-звездочного отеля бар и номера с кондиционером и собственной ванной комнатой. К услугам гостей круглосуточная стойка регистрации, доставка еды и напитков в номер и обмен валюты.', 'Karayer Caddesi 2', 'Кемер', '07990 Кемер', 'Турция', '7.4', 'full/0b33688a3860eaa0e1ba5601008ac4c99f5efa12.jpg', 'https://www.booking.com/hotel/tr/agon.ru.html', '2019-07-29 12:28:14', '2019-07-29 12:28:14'),
(864, 'Korient Mira Hotel', 'Отель Korient Mira расположен на берегу моря в Кемере, в 2,2 км от парка и пляжа Мунлайт. К услугам гостей сезонный открытый бассейн, сад и бар. К услугам гостей ресторан, круглосуточная стойка регистрации, камера хранения багажа и бесплатный Wi-Fi. К услугам гостей сауна и вечерние развлекательные программы.', 'Atatürk Caddesi no 12 ', 'Кемер', '07980 Кемер', 'Турция', '8.1', 'full/423afcbe86f0eec1e167b200daa464c4817ec1be.jpg', 'https://www.booking.com/hotel/tr/korient-mira-otel.ru.html', '2019-07-29 12:28:16', '2019-07-29 12:28:16'),
(865, 'Fame Residence Goynuk', 'Отель Fame Residence Goynuk расположен на побережье Средиземного моря, всего в 90 метрах от частного пляжа с шезлонгами и зонтиками. К услугам гостей большой открытый бассейн.', 'Cumhuriyet mah Ahu Ünal Aysal Cad.no 14 Goynuk', 'Кемер', '07970 Кемер', 'Турция', '7.5', 'full/0606f2d3b4633358c5164d15f21de3aa8bde0c50.jpg', 'https://www.booking.com/hotel/tr/fame-resa-dence-goynuk.ru.html', '2019-07-29 12:28:17', '2019-07-29 12:28:17');
INSERT INTO `hotels` (`id`, `name`, `description`, `address`, `city`, `postcode`, `country`, `rating`, `image`, `url_hotel`, `created_at`, `updated_at`) VALUES
(866, 'Orange County Resort Hotel Kemer - Ultra All Inclusive', 'Этот современный отель, работающий по системе «все включено», расположен в здании, построенном в стиле архитектуры Амстердама XVI века. К услугам гостей частный пляж на берегу Средиземного моря, собственная пристань, а также 3 открытых бассейна и 1 крытый бассейн. В ресторане с открытой кухней подают деликатесы голландской и османской кухни, приготовленные из органических продуктов.', 'Ataturk Bulvari Yeni Mahalle', 'Кемер', '07980 Кемер', 'Турция', '8.1', 'full/e0339c2d459000696f601bdede5e83f1d8d5c6ec.jpg', 'https://www.booking.com/hotel/tr/orange-county-resort.ru.html', '2019-07-29 12:28:17', '2019-07-29 12:28:17'),
(867, 'Green Garden Otel', 'Отель Green Garden Otel с садом, террасой для загара с плавательным бассейном и баром расположен в городе Кемер, в 11 км от парка и пляжа Мунлайт и пристани для яхт Кемера. К услугам гостей ресторан, круглосуточная стойка регистрации, общая кухня и бесплатный Wi-Fi. В распоряжении гостей общий лаундж, бизнес-центр и пункт обмена валюты.', 'Esentepe Mahallesi', 'Кемер', '07994 Кемер', 'Турция', '9.3', 'full/c26a39140a959ab46460e58e4fc6895a33b5e323.jpg', 'https://www.booking.com/hotel/tr/green-villa-garden.ru.html', '2019-07-29 12:28:19', '2019-07-29 12:28:19'),
(868, 'Melissa Moment Apart', 'Комплекс Melissa Moment расположен в 3,4 км от парка Мунлайт и пляжа. К услугам гостей сезонный открытый бассейн, бар и круглосуточная стойка регистрации.', 'Merkez Mahallesi Atatürk Bulvari 28', 'Кемер', '07990 Кемер', 'Турция', '8.2', 'full/17e89b25cc2c2af2df6a62d3554606204dc94412.jpg', 'https://www.booking.com/hotel/tr/melissa-moment-apart.ru.html', '2019-07-29 12:28:20', '2019-07-29 12:28:20'),
(869, 'Elegance Hotel Kemer', 'К услугам гостей отеля Elegance Kemer сезонный открытый бассейн, сад, общий лаундж и частный пляж в Кемере. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. К услугам гостей хаммам, вечерняя развлекательная программа и камера хранения багажа.', 'Merkez Mahallesi', 'Кемер', '07980 Кемер', 'Турция', '9.1', 'full/287c2b2d7a10546bd0e5242f36f3ddf993ca6295.jpg', 'https://www.booking.com/hotel/tr/elegance-kemer.ru.html', '2019-07-29 12:27:16', '2019-07-29 12:27:16'),
(870, 'Kemer Park Otel', 'Отель Kemer Park Otel с садом и видом на горы расположен в городе Кемер, в 1,5 км от парка и пляжа Мунлайт. Номера с видом на сад оснащены кондиционером, шкафом для одежды и бесплатным Wi-Fi.', 'Merkez Mah. Kemer Cad. No:8', 'Кемер', '07980 Кемер', 'Турция', '6.7', 'full/3043b90af1da0f550adab6665bb0b98304404bfc.jpg', 'https://www.booking.com/hotel/tr/kemer-park-otel.ru.html', '2019-07-29 12:27:57', '2019-07-29 12:27:57'),
