(899, 'Отель БрэндХаус', 'Отель Brandhouse с частным пляжем расположен в поселке Бостери. К услугам гостей ресторан, бар и бесплатный Wi-Fi.', 'Bor-Bor 1', 'Бостери', '722101 Бостери', 'Киргизия', '0.0', 'full/3f8fe5c9d63ce0e11da73ed8de23f0cdb4c41fe5.jpg', 'https://www.booking.com/hotel/kg/brendkhaus.ru.html', '2019-07-29 12:31:33', '2019-07-29 12:31:33'),
(900, 'Смайлик', 'Гостевой дом «Смайлик» расположен в поселке Бостери. К услугам гостей номера с собственным балконом. Предоставляются частная парковка и бесплатный Wi-Fi.', 'Центр отдыха Бор-Бор Смайлик', 'Бостери', '722104 Бостери', 'Киргизия', '0.0', 'full/fa77f6e59c119bac23e95c61132e2fda01b7522f.jpg', 'https://www.booking.com/hotel/kg/smailik.ru.html', '2019-07-29 12:31:34', '2019-07-29 12:31:34'),
(901, 'Aliya', 'Гостевой дом «Алия» с террасой расположен в селе Бостери. Гости могут воспользоваться принадлежностями для барбекю и заказать доставку еды и напитков в номер. К услугам гостей круглосуточная стойка регистрации, трансфер от/до аэропорта, общая кухня и бесплатный Wi-Fi.', 'A363 64 44/1', 'Бостери', '720044 Бостери', 'Киргизия', '0.0', 'full/7afbaa01169cc7d32fe70536f83fdf118757f44c.jpg', 'https://www.booking.com/hotel/kg/aliya.ru.html', '2019-07-29 12:31:35', '2019-07-29 12:31:35'),
(902, 'RAZAM', 'Гостевой дом RAZAM расположен в городе Бостери. К услугам гостей номера с кондиционером и бесплатным Wi-Fi. Гости могут отдохнуть на частном пляже.', 'Алея Акматова 1а/1 4-этажный', 'Бостери', '722104 Бостери', 'Киргизия', '0.0', 'full/d6dc7b4b1084fa2da471d3ad92ed3dbe0bf43311.jpg', 'https://www.booking.com/hotel/kg/razam-bosteri.ru.html', '2019-07-29 12:31:34', '2019-07-29 12:31:34'),
(903, 'Тунук', 'Гостевой дом «Тунук» расположен в селе Бостери. К услугам гостей номера с балконом с видом на озеро, в номерах можно воспользоваться бесплатным Wi-Fi.', 'Бостери. Ц.О Борбор Гостевой дом Тунук', 'Бостери', '722101 Бостери', 'Киргизия', '0.0', 'full/8cdd0fe634cf412d617e3affb050e1c3220ccb61.jpg', 'https://www.booking.com/hotel/kg/tunuk.ru.html', '2019-07-29 12:31:35', '2019-07-29 12:31:35'),
(904, 'Meerim Murok', 'Гостевой дом «Мээрим-Мурок» расположен в поселке Бостери на берегу озера Иссык-Куль. Гости могут заняться рыбалкой, рафтингом и фотоохотой. В номерах установлен телевизор с плоским экраном.', 'Bosteri Village', 'Бостери', '720000 Бостери', 'Киргизия', '8.3', 'full/204285449ffcb7f6565ce4b4ec1d5e9751a8b038.jpg', 'https://www.booking.com/hotel/kg/meerim-murok.ru.html', '2019-07-29 12:31:38', '2019-07-29 12:31:38'),
(905, 'Bely Parus', 'В мини-гостинице «Белый парус» есть сад, бар, общий лаундж и частный пляж в Бостери. К услугам гостей ресторан, круглосуточная стойка регистрации и бесплатный Wi-Fi. Осуществляется доставка еды и напитков в номер. В каждом номере есть патио с видом на озеро.', 'A363 108 4', 'Бостери', '722103 Бостери', 'Киргизия', '9.1', 'full/da8859254a6fe09644fde198a46099702fb19a6d.jpg', 'https://www.booking.com/hotel/kg/bely-parus.ru.html', '2019-07-29 12:31:38', '2019-07-29 12:31:38'),
(906, 'Fly Ship', 'Гостевой дом Fly Ship расположен в поселке Бостери.', 'Золотые пески Этаж', 'Бостери', '720020 Бостери', 'Киргизия', '0.0', 'full/064d063beedd6118211045d0d24a23e0ff12de68.jpg', 'https://www.booking.com/hotel/kg/fly-ship-bosteri.ru.html', '2019-07-29 12:31:38', '2019-07-29 12:31:38'),
(907, 'Гостевой дом «Достук»', 'Гостевой дом «Достук» с садом находится в Бостери. В номерах есть балкон.', 'Акматова аллея дом 2/7 2этажа', 'Бостери', '722111 Бостери', 'Киргизия', '0.0', 'full/d4967f7fee6bdb628349191b05805a43f31230e7.jpg', 'https://www.booking.com/hotel/kg/gostevoi-dom-dostuk.ru.html', '2019-07-29 12:31:38', '2019-07-29 12:31:38'),
(908, 'Bor-bor', 'Мини-гостиница при ресторане Bor-bor расположена в Бостери. К услугам гостей частная парковка и бесплатный Wi-Fi.', 'Центр отдыха Бор-бор 3', 'Бостери', '722101 Бостери', 'Киргизия', '0.0', 'full/98644bd464c1184e423dd5d7109cc4e0d74af1f6.jpg', 'https://www.booking.com/hotel/kg/bor-bor.ru.html', '2019-07-29 12:31:38', '2019-07-29 12:31:38'),
(909, 'Delfin Murok', 'Гостевой дом Delfin Murok расположен на берегу моря в Бостери. К услугам гостей частная парковка и бесплатный Wi-Fi.', 'Pansionat Murok', 'Бостери', '720000 Бостери', 'Киргизия', '8.7', 'full/bd0101ba758c0cb0c7e430d4807a179d313b2a70.jpg', 'https://www.booking.com/hotel/kg/delfin-murok.ru.html', '2019-07-29 12:31:39', '2019-07-29 12:31:39'),
(910, 'Eden', 'Гостевой дом Eden с садом, баром и террасой находится в Бостери. К услугам гостей детская игровая площадка и доставка еды и напитков в номер. К услугам гостей круглосуточная стойка регистрации, трансфер от/до аэропорта, общая кухня и бесплатный Wi-Fi.', 'Кыргызская 44/3', 'Бостери', '720021 Бостери', 'Киргизия', '0.0', 'full/fb9ad9af0bde4fc5eba1a7bfd1a2082e13c397df.jpg', 'https://www.booking.com/hotel/kg/eden-bosteri12.ru.html', '2019-07-29 12:31:39', '2019-07-29 12:31:39'),
(911, 'Hotel U Rybaka', 'Отель «У рыбака» расположен в поселке Бостери. К услугам гостей бесплатный Wi-Fi, терраса, ресторан, бар и аквапарк на территории. Автомобиль можно оставить на частной парковке.', 'Центр отдыха Бор бор', 'Бостери', '722103 Бостери', 'Киргизия', '7.6', 'full/5da614fe3db11396f641fe861dc1096cd1ee390a.jpg', 'https://www.booking.com/hotel/kg/u-rybaka.ru.html', '2019-07-29 12:31:39', '2019-07-29 12:31:39'),
(912, 'Kristall Hotel', 'Отель Kristall с видом на пляж Бостери располагает садом и баром. К услугам гостей ресторан, круглосуточная стойка регистрации, общий лаундж и бесплатный Wi-Fi. В отеле работают аниматоры и экскурсионное бюро.', 'Asek Sultanaliev', 'Бостери', '722103 Бостери', 'Киргизия', '8.3', 'full/e79c734d33d756bdfb452c52e73ee4e64566d77b.jpg', 'https://www.booking.com/hotel/kg/kristall.ru.html', '2019-07-29 12:31:43', '2019-07-29 12:31:43');
